UPDATE `quest_template_locale` SET `QuestDescription`='Eure Tapferkeit hat es dem Ardenwald ermöglicht, wieder zu wachsen. Das hat auch erneut die Aufmerksamkeit von Mittlern auf sich gezogen.\n\nZo\'Sorg wünscht ein weiteres Mal Eure Anwesenheit in Oribos. Geht sofort.\n\nWir möchten nicht die Gunst des Kartells Zo riskieren. Das Vertrauen eines Mittlerklans ist nicht leicht verdient.\n\nVielleicht haben sie noch mehr Belohnungen, die sie Euch zuteilwerden lassen möchten.', `VerifiedBuild`=39653 WHERE (`ID`=63347 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='Der Ardenwald ist so sicher wie schon seit Langem nicht mehr, dank Euch.\n\nEure Leistungen sind nicht unbemerkt geblieben, selbst über die Grenzen des Ardenwalds hinaus.\n\nDie Erzählungen über Eure Siege klingen in den Hallen von Oribos wider. Zo\'Sorg, der Meister des Konflikts, wünscht Euch in der Enklave zu treffen.\n\nEr ist außerordentlich interessiert an der Kunst des Krieges. Ich empfehle, dass Ihr ihn nicht warten lasst.', `VerifiedBuild`=39653 WHERE (`ID`=63346 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='Seht Euch um, $n. Die Elysische Feste zeigt in aller Deutlichkeit, wie weit wir gekommen sind, dank Euch.\n\nZo\'Sorg wünscht ein weiteres Mal Eure Anwesenheit in Oribos. Geht sofort.\n\nWir möchten nicht die Gunst von Kartell Zo riskieren. Das Vertrauen eines Mittlerklans ist nicht leicht verdient.\n\nVielleicht hat er noch mehr Belohnungen, die er Euch zuteilwerden lassen möchte.', `VerifiedBuild`=39653 WHERE (`ID`=63345 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='Ihr habt den Nekrolords große Ehre erwiesen. Solche Ehrerweisung erregt wiederum die Aufmerksamkeit anderer.\n\nZo\'Sorg wünscht ein weiteres Mal Eure Anwesenheit in Oribos. Geht sofort.\n\nWir möchten nicht die Gunst von Kartell Zo riskieren! Das Vertrauen eines Mittlerklans ist nicht leicht verdient.\n\nVielleicht hat er noch mehr Belohnungen, die er Euch zuteilwerden lassen möchte.', `VerifiedBuild`=39653 WHERE (`ID`=63343 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='Sündensturz erhält mehr Respekt, als es sich Denathrius je hätte erhoffen können! Das ist alles Eurem Einsatz zu verdanken, $n.\n\nZo\'Sorg wünscht ein weiteres Mal Eure Anwesenheit in Oribos. Geht sofort.\n\nWir möchten nicht die Gunst des Kartells Zo riskieren! Das Vertrauen eines Mittlerklans ist nicht leicht verdient.\n\nVielleicht haben sie noch mehr Belohnungen, die sie Euch zuteilkommen lassen möchten.', `VerifiedBuild`=39653 WHERE (`ID`=63341 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='Prinz Renathal wagt eine kühne Rebellion gegen seinen Vater, den ruchlosen Grafen Denatharius, der uns alle betrog, indem er Revendreths reiche Animavorräte in den Schlund schüttete.\n\nIhr müsst nach Revendreth reisen, um Renathal bei seinen Bemühungen zu unterstützen. Er ist unsere größte Hoffnung, um die Ordnung in Revendreth wiederherzustellen.\n\nPfadschreiber Roh-Avonavi im Ring der Übertragung wird für Euren Transport sorgen.', `VerifiedBuild`=39653 WHERE (`ID`=63037 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='Der Ardenwald ist für den Wiedergeburtszyklus der Nachtgeister, die ihr Reich betreten, von großer Wichtigkeit.\n\nLeider führte die Animadürre zum Verlust ganzer Haine – diese Seelen werden ihren Zyklus nie vollenden.\n\nJetzt wollen die Feinde auch noch den Rest des einst ruhigen Walds zerstören, sie bedrohen den bereits in Mitleidenschaft gezogenen Hof der Nacht. \n\nLady Mondbeere vom Hof bittet um Hilfe. Pfadschreiber Roh-Avonavi im Ring der Übertragung wird für Euren Transport sorgen.', `VerifiedBuild`=39653 WHERE (`ID`=63036 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='Obwohl sie einst vereint die Schattenlande verteidigt haben, liegen die Häuser von Maldraxxus jetzt im Zwist miteinander.\n\nIn ihrem Reich prallen die Armeen aufeinander, selbst die Bastion bleibt nicht verschont. Nur noch die Nekrolords halten dem Primus die Treue.\n\nSprecht mit Secutor Mevix am Sitz des Primus in Maldraxxus. Mit seinem strategischen Gespür wird er Euch dorthin senden, wo Ihr am meisten gebraucht werdet.\n\nPfadschreiber Roh-Avonavi im Ring der Übertragung kann für Euren Transport sorgen.', `VerifiedBuild`=39653 WHERE (`ID`=63035 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='Reist zur Bastion, dem ewigen Zuhause der geflügelten Kyrianer.\n\nLasst Euch nicht von Ihren goldenen Feldern und glänzenden Türmen täuschen... die große Animadürre hat die Kyrianer geschwächt und an den Rand eines Bürgerkriegs mit ihren eigenen gefallenen Brüdern gedrängt.\n\nEure Unterstützung wird von großem Nutzen für sie sein. Sucht in Eurem neuen Sanktum, der Elysischen Feste, nach der, die Kalisthene genannt wird. Sie kann Euch weiterhelfen.\n\nPfadschreiber Roh-Avonavi im Ring der Übertragung wird für Euren Transport sorgen.', `VerifiedBuild`=39653 WHERE (`ID`=63034 AND `locale`='deDE');
