UPDATE `quest_template_locale` SET `QuestDescription`='Obwohl sie einst vereint die Schattenlande verteidigt haben, liegen die Häuser von Maldraxxus jetzt im Zwist miteinander.\n\nIn ihrem Reich prallen die Armeen aufeinander, selbst die Bastion bleibt nicht verschont. Nur noch die Nekrolords halten dem Primus die Treue.\n\nSprecht mit Secutor Mevix an der Düsteren Wehr in Maldraxxus. Mit seinem strategischen Gespür wird er Euch dorthin senden, wo Ihr am meisten gebraucht werdet.\n\nPfadschreiber Roh-Avonavi im Ring der Übertragung kann für Euren Transport sorgen.', `VerifiedBuild`=39653 WHERE (`ID`=62738 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='Reist zur Bastion, dem ewigen Zuhause der geflügelten Kyrianer.\n\nLasst Euch nicht von Ihren goldenen Feldern und glänzenden Türmen täuschen... die große Animadürre hat die Kyrianer geschwächt und an den Rand eines Bürgerkriegs mit ihren eigenen gefallenen Brüdern gedrängt.\n\nEure Unterstützung wird von großem Nutzen für sie sein. Sucht am Wegekreuz namens Heldenrast nach der, die Kalisthene genannt wird. Sie kann Euch weiterhelfen.\n\nPfadschreiber Roh-Avonavi im Ring der Übertragung wird für Euren Transport sorgen.', `VerifiedBuild`=39653 WHERE (`ID`=62707 AND `locale`='deDE');
