UPDATE `quest_template_locale` SET `LogDescription`='Bringt die Hippogryphenseele zu Lady Muunn im Herz des Waldes.', `QuestDescription`='<Die Hippogryphenseele ist intelligent und tapfer. Ihr könnt jetzt die Gestalt der Hippogryphenseele nutzen.>', `QuestCompletionLog`='Bringt die Hippogryphenseele zu Lady Muunn im Herz des Waldes.', `VerifiedBuild`=39653 WHERE (`ID`=62427 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='Wir haben König Anduin in Torghast nicht ausfindig machen können. Ich fürchte, dass wir eine Ewigkeit lang vergeblich diese endlosen Korridore absuchen könnten.\n\nWir müssen erfahren, welches Schicksal ihm widerfahren ist. Ein Blick in diesen Turm ist mit großen Risiken verbunden, aber wir haben keine andere Wahl.\n\nIch brauche Eure Hilfe, $n. Wir werden den zerbrochenen Helm der Herrschaft verwenden und einen Blick in diesen höllischen Ort werfen.\n\nVielleicht können wir zusammen dieser hungrigen Dunkelheit trotzen.', `VerifiedBuild`=39653 WHERE (`ID`=61730 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `LogDescription`='Besiegt $1oa schlundgebundene Fessler und $2oa schlundgebunene Scharfschützen im Tremaculum im Schlund.', `VerifiedBuild`=39653 WHERE (`ID`=61103 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='<Der Umschlag enthält eine Nachricht von Valeera Sanguinar.>\n\n$n,\n\nich bin gerade von einem Treffen mit König Wrynn in Sturmwind zurückgekehrt.\n\nWir haben viel zu besprechen.\n\nTrefft mich so bald wie möglich im Großen Siegel.\n\nAl diel shala,\nValeera', `VerifiedBuild`=39653 WHERE (`ID`=58582 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='<Der Umschlag enthält eine Nachricht von König Anduin Wrynn.>\n\n$n,\n\nobwohl die Streitkräfte der Horde und der Allianz zusammenarbeiten, haben wir immer noch keine Spur der Armeen von N\'Zoth finden können. Seit seiner Befreiung hat uns der Alte Gott um jeden Preis gemieden.\n\nNur das Licht weiß, was er für furchtbare Pläne für Azeroth hat.\n\nTrefft mich in Burg Sturmwind. Wir müssen einen Plan schmieden, wie wir N\'Zoths Ränke aufdecken können, bevor es zu spät ist!\n\nMöge das Licht Euch beflügeln,\nKönig Anduin Wrynn', `VerifiedBuild`=39653 WHERE (`ID`=58496 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `LogDescription`='Sprecht mit Kleia, um den Schlund zu verlassen, und kehrt dann zu Polemarch Adrestes in die Elysische Feste zurück.', `VerifiedBuild`=39653 WHERE (`ID`=57125 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `LogDescription`='Beschafft gedörrtes Salzwildbret, Grimms spezielle Pfeifentabakmischung und einen Strauß Ringelblumen.', `VerifiedBuild`=39653 WHERE (`ID`=47744 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='Um das Wissen für die Herstellung uralter Waffen wiederzuerlangen, benötigt man zunächst uralte Gaben.$b$bWenn Ihr lernen möchtet, wie man luftgeschmiedete Waffen herstellt, müsst Ihr Euch den Wesen stellen, die aus jener geboren wurden.$b$bBringt mir ihre Kerne. Dann werde ich Euch das Wissen zuteilwerden lassen, das Ihr sucht.', `VerifiedBuild`=39653 WHERE (`ID`=44863 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='Als Herr des Immergrünen Flors war es meine Aufgabe, die Natur in Waffen zu verwandeln.$B$BIhr habt wahrscheinlich die Früchte meiner Arbeit während Eurer Reisen durch meine Welt gesehen.$B$BMeine Entdeckungen haben es meinem Volk erlaubt, die eindringenden Spezies von Draenor durch zersetzenden Befall unter Kontrolle zu halten. Ich spreche von absoluter systemischer Kontrolle des einfallenden Organismus... über Geist und Körper.$B$BJetzt, da Ihr $gmein Meister:meine Meisterin; seid, biete ich Euch diese Fähigkeiten an, aber zunächst müsst Ihr meine Forschungen und meine Werkzeuge aus dem Immergrünen Flor bergen.$B$BWenn Ihr das tut, wird Euch große Macht zuteilwerden.', `VerifiedBuild`=39653 WHERE (`ID`=36813 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `LogTitle`='Der große Ezra Grimm', `LogDescription`='Bergt einen Kasten von Ezra Grimms Tollem Tabak.', `QuestDescription`='Männer von weit entfernten Orten wie Kul Tiras sprechen von Ezra Grimms Tollem Tabak. Dieses Genussmittel wurde von jeder wichtigen Person, die Stratholme je besuchte, konsumiert. König Terenas, Uther Lichtbringer, Hochlord Fordring... ja, alle genossen sie Grimms Spezialität.$B$BLeider verblieb Ezra in seinem Laden, als Stratholme überfallen wurde, und er schwörte auf sein Leben, dass die Geißel seinen Tabak nicht anfassen würde. Wagt Euch hinein und seht nach, ob etwas von dem Tabak übrig geblieben ist. Er ist sein Gewicht in Gold wert, das kann ich Euch versichern.', `VerifiedBuild`=39653 WHERE (`ID`=27192 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `LogTitle`='Erstattet Lord Devrestrasz Bericht', `LogDescription`='Sprecht mit Lord Devrestrasz im Wyrmruhtempel.', `QuestDescription`='Ich verabscheue den Verlust von Leben... egal welches es auch sein mag. Doch ich werde nicht untätig dabei zusehen, wie Malygos uns auslöschen und den Tempel schänden wird!$B$BIch habe Lord Devrestrasz zum Kommandanten der Verteidigung des Wyrmruhtempels ernannt.$B$BSprecht mit Torastrasza, damit sie Euch einen Drachen zur Verfügung stellt, mit dem Ihr zu ihm fliegen könnt.$B$BIch bitte Euch, $n, leistet ihm Hilfe. Eure Beteiligung an der Verteidigung des Wyrmruhtempels wird für unseren Sieg über den blauen Drachenschwarm von entscheidender Bedeutung sein.', `VerifiedBuild`=39653 WHERE (`ID`=12435 AND `locale`='deDE');
UPDATE `quest_template_locale` SET `QuestDescription`='Ich hoffe, Ihr seid nicht schockiert, wenn ich Euch verrate, dass die Teile des Medaillons von Karabor, die Ihr von meinen Dienern beschafft habt, nichts als Nachbauten sind.$B$B<Akama zeigt Euch ein identisches Medaillon, das auf seiner Handfläche liegt.>$B$BMeine Todeshörigen haben dieses Geheimnis so lange wie möglich vor Illidan bewahrt. Dennoch fehlt uns noch das letzte Stück.$B$BSeher Udalo erschien mir in meinen Träumen und sagte mir, dass er das letzte Stück gefunden habe. Er wird jedoch von Kael\'thas auf der Arkatraz in der Festung der Stürme gefangen gehalten. Sucht ihn und findet heraus, was er weiß.', `VerifiedBuild`=39653 WHERE (`ID`=10705 AND `locale`='deDE');
