(64651, 'deDE', 'Kobraseele', 'Bringt die Kobraseele zu Lady Muunn im Herz des Waldes.', '<Die Kobraseele ist begierig und hat einen ausgeprägten Beschützerinstinkt. Ihr könnt jetzt die Gestalt der Kobra nutzen.>', '', '', '', '', '', 'Bringt die Kobraseele zu Lady Muunn im Herz des Waldes.', 39653),
(64650, 'deDE', 'Hyänenseele', 'Bringt die Hyänenseele zu Lady Muunn im Herz des Waldes.', '<Die Hyänenseele ist feurig und agil. Ihr könnt jetzt die Gestalt der Hyäne nutzen.>', '', '', '', '', '', 'Bringt die Hyänenseele zu Lady Muunn im Herz des Waldes.', 39653),
(64640, 'deDE', 'AubriesTestQuestForJeff', '', '', '', '', '', '', '', '', 39653),
(64607, 'deDE', 'Tazavesh: Harte Geschäfte', 'Sucht Au\'manals Geschäftspartner auf und bietet ihm Eure Unterstützung an.', 'Ah, meine Arbeit steht Euch wirklich fabelhaft zu Gesicht. Ihr seid das Sinnbild der Legitimität!\n\nUnd da ich Euch nun meine Talente zur Verfügung gestellt habe, werdet Ihr mir mit den Euren dienen. Trefft Euch in der Güldenen Landung mit meinem Geschäftspartner Fe\'tajid und bietet ihm Eure Unterstützung an.\n\nIch freue mich schon darauf, von Eurem Erfolg zu hören.', '', '', '', '', '', '', 39653),
(64599, 'deDE', 'Sanktum der Herrschaft - Und täglich grüßt das Schlundgetier', 'Sammelt 4 Phylakteriumsplitter von Kel\'Thuzad im Sanktum der Herrschaft auf dem Schwierigkeitsgrad \'Mythisch\'.', 'Ich spüre Kel\'Thuzads Präsenz in diesen Hallen. Sammelt Splitter seines Phylakteriums, damit ich einen neuen Weg in seine Kammern öffnen kann.\n\nVier Splitter sollten reichen. Wir wollen ja schließlich nicht, dass er zurückkehrt, oder?', '', '', '', '', '', '', 39653),
(64598, 'deDE', 'Sanktum der Herrschaft - Und täglich grüßt das Schlundgetier', 'Sammelt 4 Phylakteriumsplitter von Kel\'Thuzad im Sanktum der Herrschaft auf dem Schwierigkeitsgrad \'Heroisch\'.', 'Ich spüre Kel\'Thuzads Präsenz in diesen Hallen. Sammelt Splitter seines Phylakteriums, damit ich einen neuen Weg in seine Kammern öffnen kann.\n\nVier Splitter sollten reichen. Wir wollen ja schließlich nicht, dass er zurückkehrt, oder?', '', '', '', '', '', '', 39653),
(64597, 'deDE', 'Sanktum der Herrschaft - Und täglich grüßt das Schlundgetier', 'Sammelt 4 Phylakteriumsplitter von Kel\'Thuzad im Sanktum der Herrschaft auf dem Schwierigkeitsgrad \'Normal\'.', 'Ich spüre Kel\'Thuzads Präsenz in diesen Hallen. Sammelt Splitter seines Phylakteriums, damit ich einen neuen Weg in seine Kammern öffnen kann.\n\nVier Splitter sollten reichen. Wir wollen ja schließlich nicht, dass er zurückkehrt, oder?', '', '', '', '', '', '', 39653),
(64571, 'deDE', 'Tazavesh: Suchen und nicht zerstören', '', '', '', '', '', '', '', '', 39653),
(64567, 'deDE', 'Der vermisste Gelehrte', 'Findet den Gelehrten Roh-Suir in Korthia.', 'Ah, $gSchlundgänger:Schlundgängerin;. Eure Rückkehr bringt uns Grund zur Hoffnung und die so dringend erforderliche Hilfe.\n\nNach wie vor werden einige Gelehrte vermisst. Wir glauben, dass sie zuletzt im großen Hof ihren Studien nachgingen. Es steht zu befürchten, dass wir sie verloren haben oder, was noch schlimmer wäre, dass sie von jenen verschleppt wurden, die unsere Lebensweise stören wollen.\n\nKehrt zu mir zurück, wenn Ihr ein paar Antworten gefunden habt.\n\nMöge der Pfad Euch leiten.', '', '', '', '', '', '', 39653),
(64562, 'deDE', 'Heiler gesucht', 'Heilt $1oa verwundete Paktverbündete im Quorum des Suchers.', 'Es gibt zu viele Verwundete auf dem Schlachtfeld!\n\nNicht jeder lässt sich durch Draufklopfen wieder hinbiegen. Wir brauchen mehr Heiler.\n\nNehmt mein Gerät und sorgt dafür, dass die Verwundeten wieder auf die Beine kommen!', '', '', '', '', '', '', 39653),
(64561, 'deDE', 'Beobachtungsdaten', 'Sammelt $1oa Beobachtungsdaten am Windgepeitschten Nistgipfel und am Ästuarium des Erwachens in Korthia ein.', 'Ich grüße Euch, $gSchlundgänger:Schlundgängerin;. Habt Ihr einen Moment Zeit?\n\nWie Ihr sicher wisst, hat mein Kartell insgeheim Beobachtungsgeräte über ganz Korthia verteilt. Aber diese Daten nützen uns nichts, wenn sie nicht abgerufen werden. Und genau da kommt Ihr ins Spiel.\n\nDie Aufzeichnungen am Windgepeitschten Nistgipfel und am Ästuarium des Erwachens sollten zur Abholung bereit sein. Die Geräte selbst werdet Ihr nicht sehen können, aber die Daten erscheinen Euch als hell leuchtende Kugel.\n\nUnd vergesst nicht, auch unter der Erde nachzusehen!\n\nWenn Ihr mir diese Daten bringt, werde ich Euch großzügig belohnen.', '', '', '', '', '', '', 39653),
(64560, 'deDE', 'Animarücknahme', 'Gewinnt $1oa verschlungene Anima von den Verschlingern im Refugium der Weisung zurück.', 'Für unseren Einsatz hier brauchen wir konstanten Nachschub an Truppen, Vorräten und Anima. Letztere zu besorgen, gestaltet sich augenscheinlich am schwierigsten, aber ich habe einen gewissen Einfallsreichtum entwickelt.\n\nIn der Nähe gibt es eine üppige Quelle an Anima: die Verschlinger, die gerade das Refugium der Weisung überrennen. Das ist nicht so leicht, wie sie einer Seele zu entreißen, aber genauso effektiv. Zumindest wenn man stark genug ist. Seid Ihr das?', '', '', '', '', '', '', 39653),
(64557, 'deDE', 'In der Dunkelheit gefunden', 'Findet Ve\'nish in Torghast, Turm der Verdammten.', 'Das Kartell Ve hat den Ruf, sich an gefährlichen Orten herumzutreiben, um nach Schätzen zu suchen. Mit ein wenig Vernunft würde es begreifen, dass man die Beschaffung und den Verkauf solcher Waren den Xy überlässt. Nun gut.\n\nEines seiner Mitglieder ist mit einer geplünderte Kiste voller mächtiger Gegenstände nach Torghast verschwunden. Er hat wohl gedacht, damit seine Erkundung absichern zu können. Was für ein Irrsinn!', '', '', '', '', '', '', 39653),
(64556, 'deDE', 'Freunde in der Not', 'Schließt in ganz Korthia 3 tägliche Quests von Mikanikos, Ta\'nasi und Kael\'thas ab.', 'Die Bewohner von Korthia haben viel durchgemacht. Ohne uns hätten die Streitkräfte des Kerkermeisters wohl auch den Rest der Stadt der Geheimnisse in Trümmer gelegt.\n\nWenn wir hier etwas erreichen wollen, müssen wir den Bedürftigen helfen.\n\nSteht unseren Verbündeten zur Seite, $gSchlundgänger:Schlundgängerin;. Seht Euch überall genau um und lasst keinen Verbündeten des Kerkermeisters lebendig entkommen.', '', '', '', '', '', '', 39653),
(64555, 'deDE', 'Geheimnis und Erkenntnis', 'Sprecht mit den Spähern in Korthia.', 'Jeder Pakt hat seine eigenen Spezialisten mitgebracht, allesamt Koryphäen auf ihrem jeweiligen Gebiet. Einige von ihnen haben sich aufgemacht, um dieses unbekannte Land zu erkunden.\n\nSprecht mit ihnen. Sie alle sollten einen Bericht zu ihren Erkenntnissen verfasst haben. Bringt sie zu mir.', '', '', '', '', '', '', 39653),
(64554, 'deDE', 'Venthyrangriff', 'Schließt $1oa Quests in der Verdammnisfestung und im Antlitz des Vergessens ab.', 'Unser Angriff hat die Truppen des Kerkermeisters überrumpelt. Wir werden die Verdammnisfestung überrennen und seine Champions am Altar der Herrschaft besiegen!\n\nWir brauchen Euch, $gSchlundgänger:Schlundgängerin;. Unterstützt unsere Soldaten auf dem Schlachtfeld!', '', '', '', '', '', '', 39653),
(64553, 'deDE', 'Legende der Animaquelle', 'Bringt die Legende der Animaquelle zu Taktikerin Sakaa in Sündensturz.', '<Das hier scheint ein unvollständiger Satz Notizen eines Archivars zu sein, der irgendwo tief in Korthia nach einer mythischen Animaquelle gesucht hat.\n\nTaktikerin Sakaa in Sündensturz könnte Euch helfen, ein Team für die Suche nach dieser Quelle zusammenzustellen.>', '', '', '', '', '', 'Bringt die Legende der Animaquelle zu Taktikerin Sakaa in Sündensturz.', 39653),
(64552, 'deDE', 'Legende der Animaquelle', 'Bringt die Legende der Animaquelle zu Koros in der Elysischen Feste.', '<Das hier scheint ein unvollständiger Satz Notizen eines Archivars zu sein, der irgendwo tief in Korthia nach einer mythischen Animaquelle gesucht hat.\n\nKoros in der Elysischen Feste könnte Euch helfen, ein Team für die Suche nach dieser Quelle zusammenzustellen.>', '', '', '', '', '', 'Bringt die Legende der Animaquelle zu Koros in der Elysischen Feste.', 39653),
(64551, 'deDE', 'Legende der Animaquelle', 'Bringt die Legende der Animaquelle zu Merick Feldnarb im Sitz des Primus.', '<Das hier scheint ein unvollständiger Satz Notizen eines Archivars zu sein, der irgendwo tief in Korthia nach einer mythischen Animaquelle gesucht hat.\n\nMerick Feldnarb im Sitz des Primus könnte Euch helfen, ein Team für die Suche nach dieser Quelle zusammenzustellen.>', '', '', '', '', '', 'Bringt die Legende der Animaquelle zu Merick Feldnarb im Sitz des Primus.', 39653),
(64549, 'deDE', 'Legende der Animaquelle', 'Bringt die Legende der Animaquelle zu Behüterin Vesperblüte im Herz des Waldes.', '<Das hier scheint ein unvollständiger Satz Notizen eines Archivars zu sein, der irgendwo tief in Korthia nach einer mythischen Animaquelle gesucht hat.\n\nBehüterin Vesperblüte im Herz des Waldes könnte Euch helfen, ein Team für die Suche nach dieser Quelle zusammenzustellen.>', '', '', '', '', '', 'Bringt die Legende der Animaquelle zu Behüterin Vesperblüte im Herz des Waldes.', 39653),
(64541, 'deDE', 'Der Preis des Todes', '', '', '', '', '', '', '', '', 39653),
(64532, 'deDE', 'Die letzten Relikte', 'Untersucht die fehlenden Relikte im Reliquiar der Erinnerung und kauft den Untersuchungsbericht: Uralte Schreine.', 'Ich habe großartige Neuigkeiten, $n. Ich weiß nun, wo die letzten fehlenden Relikte sind!\n\nEs könnte etwas schwierig für Euch werden, sie auch zu finden, aber ich habe genau die richtige Forschung, um Euch zu helfen.\n\nSchaut Euch bitte die letzten fehlenden Relikte an. Wir haben es fast geschafft!', '', '', '', '', '', '', 39653),
(64531, 'deDE', 'Mor\'geth', '', '', '', '', '', '', '', '', 39653),
(64530, 'deDE', 'Grabschwingenkristall', 'Bringt den Grabschwingenkristall zur Steinhauerin in der Zuflucht des Hüters.', '<Dieses große Kristallfragment ist von dem riesigen Körper des Konstrukts abgesplittert. Aus seinem Innern dringt das Knistern von Energieblitzen.\n\nDie Steinhauerin in der Zuflucht des Hüters könnte mit diesem Kristall eine Grabschwinge für Euch ermächtigen.>', '', '', '', '', '', 'Bringt den Grabschwingenkristall zur Steinhauerin in der Zuflucht des Hüters.', 39653),
(64529, 'deDE', 'Intakter Aquilonkern', 'Bringt den intakten Aquilonkern zu Deos in der Zuflucht des Hüters.', '<Der riesige Verschlinger, der bei seinem Tod diesen Energiekern fest umklammert hielt, hat ihn zweifellos aus einem der zerstörten Aquilons in seiner Umgebung gerissen. Der Energiekern selbst scheint fast vollständig intakt zu sein.\n\nDeos in der Zuflucht des Hüters kann Euch helfen, einen Aquilon zu finden, den Ihr damit antreiben könnt.>', '', '', '', '', '', 'Bringt den intakten Aquilonkern zu Deos in der Zuflucht des Hüters.', 39653),
(64528, 'deDE', 'Wildlingsattel', 'Bringt den Wildlingsattel zu Reldorn in der Zuflucht des Hüters.', '<Als Ihr Euch vom Rücken des entkommenen Wildlings gleiten lassen habt, hat dieser den Sattel zu Euren Füßen abgeschüttelt. Nur widerwillig ist er von Eurer Seite gewichen und den Nachtfae gefolgt, die ihn zur Zuflucht des Hüters zurückgebracht haben.\n\nReldorn in der Zuflucht des Hüters weiß vielleicht, was diese Geste bedeutet.>', '', '', '', '', '', 'Bringt den Wildlingsattel zu Reldorn in der Zuflucht des Hüters.', 39653),
(64527, 'deDE', 'Beobachtung der Jagd', 'Aktiviert den Kriegsmodus und tötet $1oa |4Spielercharakter:Spielercharaktere; in der Welt.', 'Bei unseren Beobachtungen der Konflikte Eurer Art ist uns eine hohe Rate an entkommener Jagdbeute aufgefallen.\n\nDies ist unseren Bemühungen um eine genaue Beobachtung eher abträglich.\n\nDer Beobachter hat ein Werkzeug beschafft, von dem wir glauben, dass es Eure Fähigkeit zur Forcierung von Konflikten steigern sollte.\n\nBevor ich es Euch gebe, bitten wir Euch, zunächst Eure Bereitschaft zur Teilnahme an solchen Konflikten unter Beweis zu stellen. Nur so können wir sicher sein, dass sich diese Investition für uns auch gebührend auszahlt.', '', '', '', '', '', '', 39653),
(64526, 'deDE', 'Geheimnisvolle Risse', 'Untersucht die fehlenden Relikte im Reliquiar der Erinnerung und kauft einen reparierten Rissschlüssel von Roh-Suir.', 'Vielen Dank für Eure Hilfe, $n. Ich habe im Kodex noch mehr Relikte gefunden, die nach wie vor unbeschädigt sind.\n\nDer Schlüssel zu diesen Relikten liegt in den seltsamen Rissen in ganz Korthia.\n\nIch sollte eine Möglichkeit finden können, mit der Ihr diese Risse betreten und noch weitere unserer fehlenden Relikte bergen könnt.\n\nWie immer habe ich einige Anschauungsobjekte für Euch, damit Ihr wisst, wonach Ihr suchen sollt. Seht sie Euch bitte gut an, bevor Ihr aufbrecht.', '', '', '', '', '', '', 39653),
(64522, 'deDE', 'Gestohlene korthianische Vorräte', 'Liefert die gestohlenen korthianischen Vorräte bei Herzogin Mynx in der Zuflucht des Hüters ab.', '<Diese Vorräte wurden unbemerkt aus dem Riss gestohlen. Allesamt sind sie mit dem Siegel des Vorstoßes des Todes versehen.\n\nHerzogin Mynx in der Zuflucht des Hüters wäre sehr dankbar, wenn sie jemand zurückbringen würde.>', '', '', '', '', '', 'Liefert die gestohlenen korthianischen Vorräte bei Herzogin Mynx in der Zuflucht des Hüters ab.', 39653),
(64521, 'deDE', 'Schlachtpläne der Helgebundenen', 'Liefert die Schlachtpläne der Helgebundenen bei Herzogin Mynx in der Zuflucht des Hüters ab.', '<Diese Schlachtpläne enthalten Szenarien für Angriffe auf Korthia sowie detaillierte Berichte über die Verteidigungskapazitäten, die der Vorstoß des Todes in dieser Region aufbringen kann.\n\nHerzogin Mynx in der Zuflucht des Hüters könnte diese Informationen schnell allen zukommen lassen, die sie benötigen.>', '', '', '', '', '', 'Liefert die Schlachtpläne der Helgebundenen bei Herzogin Mynx in der Zuflucht des Hüters ab.', 39653),
(64519, 'deDE', 'Verlorene Archive', 'Untersucht die fehlenden Relikte im Reliquiar der Erinnerung.', 'Ich habe meine Forschungen zu einigen weiteren Relikten abgeschlossen, die womöglich noch immer in Korthia existieren. Ich glaube, sie befinden sich in unseren kleineren Archiven.\n\nMit Eurer Hilfe kann ich Geräte herstellen, die den Zugang zu diesen Archiven wiederherstellen.\n\nIch habe einige Replikate der fehlenden Relikte vorbereitet. Seht sie Euch an, damit Ihr genau wisst, wonach Ihr suchen müsst.', '', '', '', '', '', '', 39653),
(64513, 'deDE', 'Ve\'rayns Kopf', 'Liefert Ve\'rayns Kopf bei Ve\'nari in Ve\'naris Zuflucht ab.', '<Ve\'rayn macht schon seit einiger Zeit Jagd auf Ve\'nari. Ve\'nari wäre sehr an einem Beweis interessiert, dass dieses Problem endgültig aus dem Weg geschafft wurde.>', '', '', '', '', '', 'Liefert Ve\'rayns Kopf bei Ve\'nari in Ve\'naris Zuflucht ab.', 39653),
(64511, 'deDE', 'Fehlende Relikte', 'Untersucht die fehlenden Relikte im Reliquiar der Erinnerung.', 'Danke Eurer Hilfe konnte ich noch weitere Forschungsdaten zu den verlorenen Relikten aus dem Archiv wiederherstellen.\n\nIch habe mich eingehend mit dem Kodex befasst und glaube, dass es in Korthia noch mehr Relikte gibt, die wir bergen könnten.\n\nSie waren in Truhen versiegelt, und diese Truhen wurden im Zuge des ersten Angriffs überall in Korthia verstreut.\n\nHier drin habe ich alle fehlenden Relikte zusammengestellt. Prägt sie Euch gut ein. Wir müssen sie finden.', '', '', '', '', '', '', 39653),
(64508, 'deDE', '[DNT] Conduit Energy', '', '', '', '', '', '', '', '', 39653),
(64506, 'deDE', 'Auf die Suche', 'Findet im Reliquiar der Erinnerung heraus, welche Relikte fehlen.', 'Der Kodex enthält sehr detaillierte Aufzeichnungen. Über Gegenstände, die für immer verloren sind... und einige, die bis heute überdauert haben.\n\nEinige dieser mächtigen Relikte sind vielleicht noch irgendwo in Korthia versteckt.\n\nGeht in das Reliquiar. Dort seht Ihr einige der Artefakte, die in Korthia noch intakt anzutreffen sind.\n\nPrägt sie Euch genau ein. Ihr müsst sie finden und zu mir zurückbringen.', '', '', '', '', '', '', 39653),
