(64458, 'deDE', 'Abenteurerin: Sulanoom', '', '', '', '', '', '', '', '', 39653),
(64441, 'deDE', 'Ein loser Faden', 'Hebt das Buch auf, um es zurückzugeben.', '<Ein Buch scheint vor Kurzem im nahe gelegenen Venthyrlager vom Tisch gestoßen worden zu sein.\n\nDie Venthyr wären wahrscheinlich dankbar, wenn Ihr es ihnen zurückgebt, bevor einer der Gromits es als Nistmaterial benutzt.>', '', '', '', '', '', '', 39653),
(64438, 'deDE', 'Ausrüstung aufbessern', 'Sprecht mit Gelehrtenassistent Kah-Vez, um ein Stück Ausrüstung aus Korthia aufzuwerten.', 'Die Forschungsarbeiten, die Ihr findet, können viele Möglichkeiten erschließen.\n\nEine Möglichkeit ist die Verbesserung von Ausrüstung, die Ihr in Korthia finden könnt.\n\nSprecht mit meinem Assistenten in der Nähe. Er kann unsere Forschung nutzen, um die Leistungsfähigkeit dieser Ausrüstung wiederherzustellen.', '', '', '', '', '', '', 39653),
(64437, 'deDE', 'Informiert den Primus', 'Kehrt zum Primus in Korthia zurück.', '$n, kehrt nach Korthia zurück und sagt dem Primus, dass das Siegel der Winterkönigin wiederhergestellt werden konnte.', '', '', '', '', '', '', 39653),
(64432, 'deDE', 'Aus Stärke wird Schwäche', 'Ladet den Blitzableiter auf und tötet dann Schlundgebundene.', '$p, das Altmetall, das wir gesichert haben, verfügt über ein paar interessante Eigenschaften. Ich bin zu der Überzeugung gelangt, dass die Schlundgebundenen ihre Rüstung durchwirken und ihre Haltbarkeit erhöhen.\n\nNehmt diesen Blitzableiter. Zuerst müsst Ihr vom Blitz getroffen werden. Macht nicht so ein Gesicht. Das wird Euch nicht schaden. Aber Ihr müsst dabei mithilfe von Schlundgebundenenmetall geerdet sein. Die großen Ketten am windgepeitschten Nistgipfel in Korthia sollten sich gut dafür eignen.\n\nUnd wenn Ihr dann so richtig... äh... energiegeladen seid, schicke ich Euch einen Tauralus, Borrhas, um Euch in die Schlacht zu tragen.', '', '', '', '', '', '', 39653),
(64376, 'deDE', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64368, 'deDE', 'Relikteffizienz', '', '', '', '', '', '', '', '', 39653),
(64325, 'deDE', 'Veteran von Sündensturz', 'Trefft Euch mit Zo\'Sorg in der Enklave in Oribos.', 'Der Einfluss von Sündensturz wächst dank Eurer Siege, $n!\n\nEure Leistungen sind nicht unbemerkt geblieben, selbst über die Grenzen Revendreths hinaus.\n\nDie Erzählungen über Eure Siege klingen in den Hallen Oribos\' wider. Zo\'Sorg, der Meister des Konflikts, wünscht Euch in der Enklave zu treffen.\n\nEr ist außerordentlich interessiert an der Kunst des Krieges. Ich empfehle, dass Ihr ihn nicht warten lasst.', '', '', '', '', '', '', 39653),
(64324, 'deDE', 'Veteran der Nekrolords', 'Trefft Euch mit Zo\'Sorg in der Enklave in Oribos.', 'Der Einfluss der Nekrolords wächst dank Euch, $n!\n\nEure Leistungen sind nicht unbemerkt geblieben, selbst über die Grenzen Maldraxxus\' hinaus.\n\nDie Erzählungen über Eure Siege klingen in den Hallen Oribos\' wider. Zo\'Sorg, der Meister des Konflikts, wünscht Euch in der Enklave zu treffen.\n\nEr ist außerordentlich interessiert an der Kunst des Krieges. Ich empfehle, dass Ihr ihn nicht warten lasst.', '', '', '', '', '', '', 39653),
(64323, 'deDE', 'Veteran der Kyrianer', 'Trefft Euch mit Zo\'Sorg in der Enklave in Oribos.', 'Die Bastion heilt dank Euch, $n. Der Weg ist frei.\n\nEure Leistungen sind nicht unbemerkt geblieben, selbst über die Grenzen der Bastion hinaus.\n\nDie Erzählungen über Eure Siege klingen in den Hallen Oribos\' wider. Zo\'Sorg, der Meister des Konflikts, wünscht Euch in der Enklave zu treffen.\n\nEr ist außerordentlich interessiert an der Kunst des Krieges. Ich empfehle, dass Ihr ihn nicht warten lasst.', '', '', '', '', '', '', 39653),
(64322, 'deDE', 'Veteran der Nachtfae', 'Trefft Euch mit Zo\'Sorg in der Enklave in Oribos.', 'Der Ardenwald ist so sicher wie schon seit Langem nicht mehr, dank Euch.\n\nEure Leistungen sind nicht unbemerkt geblieben, selbst über die Grenzen des Ardenwalds hinaus.\n\nDie Erzählungen über Eure Siege klingen in den Hallen von Oribos wider. Zo\'Sorg, der Meister des Konflikts, wünscht, Euch in der Enklave zu treffen.\n\nEr ist außerordentlich interessiert an der Kunst des Krieges. Ich empfehle, dass Ihr ihn nicht warten lasst.', '', '', '', '', '', '', 39653),
(64314, 'deDE', 'Erneuerte Pakte', 'Sprecht mit dem Primus und holt Euch dann die Siegel von den Pakten.', 'Wir haben uns darauf konzentriert, dass der Kerkermeister nicht die Barriere um den Schlund durchbrechen und in die restlichen Schattenlande einfallen kann.\n\nStattdessen hat er den Schlund selbst erweitert, um Oribos zu verschlingen und das Siegel der Richterin an sich zu reißen.\n\nIch verstehe noch immer nicht ganz, was wir an der Spitze von Torghast gesehen haben. Aber der Primus tut das ganz sicher.\n\nEs wird Zeit für seinen Notfallplan. Die Pakte werden in Kürze mit ihren Siegeln eintreffen.\n\nInformiert den Primus, dass wir bereit sind.', '', '', '', '', '', '', 39653),
(64306, 'deDE', 'Bedingung zum Questabschluss', '', '', '', '', '', '', '', '', 39653),
(64304, 'deDE', 'Neue Möglichkeiten warten', 'Besiegt $1oa Spielercharaktere in Korthia.', 'Habt Ihr es eilig? Ah, ja. $gSchlundgänger:Schlundgängerin;, Ihr seid nicht zufällig dabei, die neue geheimnisvolle Landmasse innerhalb des Schlunds zu erkunden, oder?\n\nIch frage mich, was für Geheimnisse dort verborgen liegen.\n\nVielleicht können wir einander irgendwie behilflich sein.\n\nWenn Ihr interessiert seid, sollten wir unser Gespräch fortsetzen. Ansonsten zieht nur weiter. Ich finde schon jemand anderen, der mir weiterhilft.', '', '', '', '', '', '', 39653),
(64292, 'deDE', 'Maelie die Wanderin', 'Nehmt die Verantwortung für Maelie an.', 'Ich kann Euch gar nicht genug danken, dass Ihr Maelie gefunden habt! Ich glaube, sie ist einfach ein bisschen zu viel für mich, wisst Ihr?\n\nWürdet Ihr vielleicht auf sie aufpassen? Sie scheint Euch wirklich zu mögen!', '', '', '', '', '', '', 39653),
(64290, 'deDE', 'Forschung sammeln', 'Sprecht mit Archivar Roh-Suir, um korthianische Relikte für die katalogisierte Forschung bei ihm abzugeben.', 'Ihr habt gute Arbeit geleistet. All diese Fragmente werden uns sehr dabei helfen, unser Archiv wiederaufzubauen.\n\nMit dem, was Ihr gefunden habt, kann ich noch weitere Forschungsdaten zu dem entschlüsseln, was in Korthia verloren ging.\n\nDanach ist es an Euch, innerhalb Korthias noch weitere Fragmente und Relikte für unser Archiv zu suchen.', '', '', '', '', '', '', 39653),
(64289, 'deDE', 'So viele Kleinteile', 'Bergt 50 Reliktfragmente von seltenen Kreaturen und aus Schätzen in ganz Korthia.', 'So viel ging verloren, als Korthia in den Schlund gezogen wurde.\n\nUnbezahlbare Relikte wurden einfach in Stücke gerissen. Ich habe einige Kreaturen gesehen, die mit den Überresten dieser Objekte herumliefen.\n\nWir müssen sie zurückholen.\n\nStellt Euch den Streitkräften des Kerkermeisters und durchsucht die Überreste Korthias nach allem, was von unserem einst so glorreichen Archiv noch übrig ist.', '', '', '', '', '', '', 39653),
(64288, 'deDE', 'Paragon von Ve\'nari', 'Sprecht mit Ve\'nari in Ve\'naris Zuflucht im Schlund.', 'Kommt, $gSchlundgänger:Schlundgängerin;. Trefft mich an meiner Zuflucht.\n\nWir müssen noch eine letzte Sache bereden.\n\n...und passt auf, dass Euch niemand folgt.', '', '', '', '', '', '', 39653),
(64286, 'deDE', 'Paragon des Vorstoßes des Todes', 'Sprecht mit Herzogin Mynx in der Zuflucht des Hüters in Korthia.', 'Und wieder wurde mein Aufruf erhört. Eure Mühen sollen nicht unbemerkt bleiben.\n\nSchauen wir mal, ob wir nicht eine passende Belohnung für Eure Taten finden können.', '', '', '', '', '', '', 39653),
(64282, 'deDE', 'Voller Überraschungen', 'Findet Zovaals Tresor.', 'Ihr überrascht mich immer wieder, $gSchlundgänger:Schlundgängerin;. Eure Anwesenheit hier ist höchst unerwartet!\n\nDa wir beide hier sind, sollten wir wohl zusammenarbeiten.\n\nDer Kerkermeister hat einen Tresor voller wertvoller Dinge irgendwo in diesem Riss. Findet ihn für mich und bringt ihn her, damit wir ihn öffnen können. Dann werden wir den Reichtum zwischen uns aufteilen!', '', '', '', '', '', 'Kehrt mit oder ohne Zovaals Tresor zu Ve\'nari zurück.', 39653),
(64274, 'deDE', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64273, 'deDE', 'Eindämmung der Helgebundenen', '', '', '', '', '', '', '', '', 39653),
(64267, 'deDE', 'Geheimnisvolle Geschenke von Ve\'nari', 'Sprecht mit Ve\'nari in Ve\'naris Zuflucht im Schlund.', 'Ich bin beeindruckt von Eurer schieren Hartnäckigkeit, weiter am Leben und dennoch nützlich zu bleiben, $gSchlundgänger:Schlundgängerin;. Ihr erinnert mich an mich selbst, als ich noch jung und naiv war.\n\nNehmt dies und setzt Eure Arbeit fort... an einem weniger auffälligen Ort.', '', '', '', '', '', '', 39653),
(64266, 'deDE', 'Vorräte vom Archivarskodex', 'Sprecht mit Archivar Roh-Suir im Reliquiar der Erinnerung in Korthia.', 'Worte können gar nicht zum Ausdruck bringen, wie sehr mich der Gedanke an Eure Hingabe, Korthias Geschichte aufrechtzuerhalten, mit Wärme erfüllt.\n\nBitte, lasst mich Euch meine Dankbarkeit zeigen.', '', '', '', '', '', '', 39653),
(64255, 'deDE', 'Zeit zum Feiern', '', '', '', '', '', '', '', '', 39653),
(64216, 'deDE', 'Turmwissen', 'Stellt die Kiste der Zahllosen Dinge in Torghast auf.', 'Die verwobene Macht dieser Kiste kann nur freigesetzt werden, wenn man ihr Stolz und Erinnerungen zuführt. In sie sind Beschwörungsformeln eingewebt, die ich in den anderen Reichen gesehen habe. Sie werden verwendet, um eine Seele zu schröpfen oder zu konditionieren. Diese... Monstrosität... hat diese Werkzeuge der Erlösung und Ehre benutzt, um ein Schloss zu erschaffen.\n\nWährend Ihr die Stockwerke von Torghast in Angriff nehmt, werden Euer Können, Eure Geschwindigkeit und Eure Effizienz das Turmwissen vermehren. Die Kiste kann damit genährt werden.\n\nFührt ihr diese Dinge zu, um die ihr innewohnenden Kräfte zu erhalten.', '', '', '', '', '', 'Stellt die Kiste der Zahllosen Dinge in Torghast auf.', 39653),
(64214, 'deDE', 'Ein Symbol der Hoffnung', 'Helft bei der Untersuchung von Anduins Kompass.', 'Bevor Anduin dem Kerkermeister durch das Portal gefolgt ist, ließ er etwas fallen.\n\nIch weiß nicht, was es war, aber Jaina hat es aufgehoben. Vielleicht war es ein Zeichen, dass sich Anduin noch immer dem Kerkermeister widersetzt!\n\nWir müssen herausfinden, was das für ein Objekt war und warum der junge König es für uns zurückließ.', '', '', '', '', '', '', 39653),
(64213, 'deDE', 'Ein Symbol der Hoffnung', 'Unterstützt Jaina bei der Untersuchung von Anduins Kompass.', 'Bevor Anduin dem Kerkermeister durch das Portal gefolgt ist, ließ er etwas fallen.\n\nIch glaube nicht, dass das zum Plan des Kerkermeisters gehört hat. Es muss ein Zeichen sein, dass Anduin immer noch Herr seiner eigenen Seele ist!\n\n<Jaina öffnet ihre Hand, um Euch einen goldenen Kompass zu zeigen.>\n\nDer hier war Anduin sehr wichtig. Ich fühle darin seine Anwesenheit.\n\nWir müssen herausfinden, warum er ihn für uns zurückgelassen hat.', '', '', '', '', '', '', 39653),
(64212, 'deDE', 'Durchgang im Dunkel', 'Sprecht mit Thrall und erlebt das Ende der Schlacht in Torghast mit.', 'Ich fürchte, unsere Pläne, Zovaal aufzuhalten, wurden vereitelt, $gSterblicher:Sterbliche;.\n\nJemand hat ein Portal in ein verbotenes Reich geöffnet... und der Verbannte hat eine Macht wiedererlangt, die ihm vor langer Zeit genommen wurde.\n\nIch spüre, dass Eure Verbündeten aus dem Sanktum der Herrschaft zurückkehren. Ich muss ganz genau wissen, was dort geschehen ist.', '', '', '', '', '', '', 39653),
(64211, 'deDE', 'Durchgang im Dunkel', 'Sprecht mit Jaina und erlebt das Ende der Schlacht in Torghast mit.', 'Ich fürchte, unsere Pläne, Zovaal aufzuhalten, wurden vereitelt, $gSterblicher:Sterbliche;.\n\nJemand hat ein Portal in ein verbotenes Reich geöffnet... und der Verbannte hat eine Macht wiedererlangt, die ihm vor langer Zeit genommen wurde.\n\nIch spüre, dass Eure Verbündeten aus dem Sanktum der Herrschaft zurückkehren. Ich muss ganz genau wissen, was dort geschehen ist.', '', '', '', '', '', '', 39653),
(64210, 'deDE', 'Kiste der Zahllosen Dinge', 'Bringt die Kiste der Zahllosen Dinge zum Runenmetz.', 'Ah, $gSchlundgänger:Schlundgängerin;, natürlich. Bald werde ich fort sein, für immer verloren an diesen Ort, doch Ihr werdet seine Hallen weiter beschreiten, ungebrochen!\n\nEs war immer mein größtes Ziel, mithilfe dieser Kiste die Oberhand zu gewinnen. Doch leider habe ich meine eigenen Fähigkeiten überschätzt.\n\nSicher überschätze ich die Euren nicht. Nehmt die Kiste. Erweist Euch ihr als würdig.', '', '', '', '', '', '', 39653),
(64194, 'deDE', 'Kriegsprototyp', 'Benutzt den Atleosprototyp am Windgepeitschten Nistgipfel, um Kraxis zu besiegen.', 'Als Oberster Schmied versuche ich immer, was besser zu machen!\n\nAber die größten Zenturionen sind viel zu groß. Lassen sich nicht einfach nach Korthia bringen. Hab das Problem aber gelöst. Hier ist Atleos, Feldkolossprototyp, Frontkämpfer der Kyrianer! \n\nEr muss noch getestet werden. Solange, bis er perfekt auf mächtige Gegner vorbereitet ist.\n\nGeht und nehmt Atleos, um eine große Schlundbestie zu besiegen! Drückt auf alle Knöpfe!', '', '', '', '', '', '', 39653),
(64191, 'deDE', 'Lassiks Ausrüstung', '', '', '', '', '', '', '', '', 39653),
(64190, 'deDE', 'Schankgriffels Tablett', '', '', '', '', '', '', '', '', 39653),
(64187, 'deDE', 'Kiaranykas Suche', '', '', '', '', '', '', '', '', 39653),
(64186, 'deDE', 'ELGU - 007s vermisster Energiekern', '', '', '', '', '', '', '', '', 39653),
(64185, 'deDE', 'Ella wobei helfen?', '', '', '', '', '', '', '', '', 39653),
(64175, 'deDE', 'Champion: Lassik Gratkrümmer', '', '', '', '', '', '', '', '', 39653),
(64174, 'deDE', 'Champion: Schankgriffel', '', '', '', '', '', '', '', '', 39653),
(64173, 'deDE', 'Champion: Kinessa die Aufnahmefähige', '', '', '', '', '', '', '', '', 39653),
(64172, 'deDE', 'Champion: Ryuja Schockfaust', '', '', '', '', '', '', '', '', 39653),
(64171, 'deDE', 'Champion: Kiaranyka', '', '', '', '', '', '', '', '', 39653),
(64170, 'deDE', 'Champion: ELGU - 007', '', '', '', '', '', '', '', '', 39653),
