(64168, 'deDE', 'Champion: Spore von Marasmius', '', '', '', '', '', '', '', '', 39653),
(64166, 'deDE', 'In memoriam', 'Sammelt korthianische Erinnerungen mithilfe der vergänglichen Schwingen.', 'Als der Kerkermeister sich Korthia gegriffen und in den Schlund gezerrt hat, hat er so viel Zerstörung angerichtet. Nicht nur an Gebäuden und Bergen, auch an den Leuten dort.\n\nSie hatten Leben, Hoffnungen, Erinnerungen.\n\nIch kann nicht glauben, dass sie alle fort sind. Vielleicht verweilt noch etwas dort, das wir retten können.\n\nNehmt einen Teil meiner Macht. Versucht, damit die Erinnerungen zu sammeln. Bringt sie mir zurück, und ich werde sie bewahren.\n\nNiemand sollte vergessen werden.', '', '', '', '', '', '', 39653),
(64138, 'deDE', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64131, 'deDE', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64129, 'deDE', 'Angriff der Wilden Jagd', 'Steigt auf Aldermeigh auf und tötet Schlundgebundene in Korthia.', 'Seit ich der Wilden Jagd beigetreten bin, habe ich so viel darüber gelernt, wie man kämpft und die Reiche verteidigt.\n\nIch gebe zu, ich lerne immer noch, aber es freut mich sehr, dies an Eurer Seite und der meines Runenhirschfreundes Aldermeigh zu tun.\n\nAldermeigh wird darauf trainiert, mit der Tapferkeit der Vorkai in die Schlacht zu stürmen, doch er braucht noch mehr Übung. Würdet Ihr mit ihm ausreiten und all die Schlundgebundenen niedertrampeln, die sich Euch in den Weg stellen?', '', '', '', '', '', '', 39653),
(64106, 'deDE', 'Vereinte Bemühungen', 'Helft den Pakten beim Angriff auf die Streitkräfte des Kerkermeisters im Schlund.', 'Ihr habt in Eurem Pakt und auch anderenorts in den Schattenlanden starke Verbündete gefunden. Wegen dieser Verbindung haben sie sich entschlossen, unser Ziel unterstützen.\n\nSie sind bereit, an unserer Seite zu kämpfen, während wir unseren Marsch in den Schlund beginnen.\n\nJeder Pakt wird sich aus einem anderen Bereich auf den Kerkermeister stürzen. Helft ihnen, dieses bedrohliche Land nach jenen zu durchsuchen, die Zovaal dienen, damit wir seinen anwachsenden Einfluss beenden können.', '', '', '', '', '', '', 39653),
(64103, 'deDE', 'Bewährte Methoden', 'Tötet Moros, Oizys und Apate, Kommandanten der Schlundgebundenen.', '$p. Da wären wir mal wieder, gemeinsam im Kampf, um die Schattenlande zu beschützen.\n\nUnser Krieg ist auf dem Weg zur Niederlage, doch vielleicht können wir noch das Blatt wenden. Ihr müsst ein paar besondere Kommandanten der Schlundgebundenen finden. In jeder Armee gibt es gute und schlechte Kommandanten. Wenn wir die guten beseitigen, werden die schlechten aufsteigen, zum Leid der gesamten Streitmacht.\n\nUnsere Augen haben uns ihre Namen gebracht, Ihr müsst ihnen nur noch ein Ende setzen.', '', '', '', '', '', '', 39653),
(64101, 'deDE', 'Der richtige Umgang', 'Sammelt $1oa verlorene Animagefäße.', 'Ich bin hierhergekommen, um die Handlungen jener aus Revendreth zu beobachten. Doch ich habe etwas gehört, dass mir Sorgen bereitet.\n\n$p, die Bediensteten sagen, sie würden Anima in Gefäßen aufbewahren und dass diese Anima von unseren eigenen Leuten gestohlen wird. So darf das nicht ablaufen.\n\nKann ich mich darauf verlassen, dass Ihr die Anima zurückholt, damit sie an den richtigen Ort zurückgebracht werden kann?', '', '', '', '', '', '', 39653),
(64092, 'deDE', 'Die Jagd auf Huln', 'Legt eine Verkleidung an und durchsucht die Herrschaftsburg nach Huln Hochberg. Geht dabei den Wachen aus dem Weg.', 'Huln ist irgendwo hier, aber die Steinhauerin lässt wegen der, äh, kürzlichen Ärgernisse mit den Schreckenslords niemanden in ihr Gebiet. Die Wächter lassen niemanden rein, und wer fehl am Platze aussieht, wird rausgeworfen.\n\nZum Glück für Huln haben Knüppelfratze und ich uns einen unfehlbaren Plan einfallen lassen!\n\nWir müssen nur so aussehen, als gehörten wir da hin. Dann können wir uns umhören und Huln finden. Ein Kinderspiel!', '', '', '', '', '', '', 39653),
(64091, 'deDE', 'Ein fragwürdiges Angebot', 'Beschafft die Zeichen der Bindung.', '<Der Schreckenslord blickt Euch an und möchte reden. Ihr seht zu Euren Begleitern hinüber. Mondbeere schickt Euch mit einem schelmischen Grinsen voraus. Ihr tretet so nahe heran, wie Ihr es wagt.>\n\nBefreit mich aus diesem Gefängnis, $gSterblicher:Sterbliche;, und ich werde Euch wohlgesonnen sein. Ich stehe mit Mächten in Verbindung, die größer sind als diese ärmlichen Puppen und ihre Meister. Sie verstehen nichts von den wahren Kräften, die hier am Werk sind.\n\nIch brauche nur die Zeichen der Bindung, die mich hier festhalten. Um den Rest... kann ich mich kümmern.\n\nBefreit mich und Ihr werdet unvorstellbare Macht erlangen.', '', '', '', '', '', '', 39653),
(64090, 'deDE', 'Ausgequetscht', 'Begebt Euch an den Ort, an dem Knüppelfratze Huln vermutet, und passt Euch an.', 'Unser vermisster Kollege hat sich wegschleppen lassen und wird sicher gerade mächtig ausgequetscht. Glücklicherweise hab ich alles aufm Schirm.\n\nWir schleichen uns leise rein, als würden wir da arbeiten, finden Euren Elch, gucken keinem Fangzahn in die Augen und meißeln uns raus, als wären wir ein paar Steinmetze. Klaro?', '', '', '', '', '', '', 39653),
(64086, 'deDE', 'Taktiker der Kyrianer', 'Trefft Euch mit Zo\'Sorg in der Enklave in Oribos.', 'Seht Euch um, $n. Die Elysische Feste zeigt in aller Deutlichkeit, wie weit wir gekommen sind, dank Euch.\n\nZo\'Sorg wünscht ein weiteres Mal Eure Anwesenheit in Oribos. Geht sofort.\n\nWir möchten nicht die Gunst von Kartell Zo riskieren. Das Vertrauen eines Mittlerklans ist nicht leicht verdient.\n\nVielleicht hat er noch mehr Belohnungen, die er Euch zuteilwerden lassen möchte.', '', '', '', '', '', '', 39653),
(64085, 'deDE', 'Taktiker der Nachtfae', 'Trefft Euch mit Zo\'Sorg in der Enklave in Oribos.', 'Eure Tapferkeit hat es dem Ardenwald ermöglicht, wieder zu wachsen. Das hat auch erneut die Aufmerksamkeit von Mittlern auf sich gezogen.\n\nZo\'Sorg wünscht ein weiteres Mal Eure Anwesenheit in Oribos. Geht sofort.\n\nWir möchten nicht die Gunst des Kartells Zo riskieren. Das Vertrauen eines Mittlerklans ist nicht leicht verdient.\n\nVielleicht haben sie noch mehr Belohnungen, die sie Euch zuteilwerden lassen möchten.', '', '', '', '', '', '', 39653),
(64084, 'deDE', 'Taktiker der Nekrolords', 'Trefft Euch mit Zo\'Sorg in der Enklave in Oribos.', 'Ihr habt den Nekrolords große Ehre erwiesen. Solche Ehrerweisung erregt wiederum die Aufmerksamkeit anderer.\n\nZo\'Sorg wünscht ein weiteres Mal Eure Anwesenheit in Oribos. Geht sofort.\n\nWir möchten nicht die Gunst von Kartell Zo riskieren! Das Vertrauen eines Mittlerklans ist nicht leicht verdient.\n\nVielleicht hat er noch mehr Belohnungen, die er Euch zuteilwerden lassen möchte.', '', '', '', '', '', '', 39653),
(64083, 'deDE', 'Taktiker von Sündensturz', 'Trefft Euch mit Zo\'Sorg in der Enklave in Oribos.', 'Sündensturz erhält mehr Respekt, als es sich Denathrius je hätte erhoffen können! Das ist alles Eurem Einsatz zu verdanken, $n.\n\nZo\'Sorg wünscht ein weiteres Mal Eure Anwesenheit in Oribos. Geht sofort.\n\nWir möchten nicht die Gunst des Kartells Zo riskieren! Das Vertrauen eines Mittlerklans ist nicht leicht verdient.\n\nVielleicht haben sie noch mehr Belohnungen, die sie Euch zuteilkommen lassen möchten.', '', '', '', '', '', '', 39653),
(64080, 'deDE', 'Geerdet', 'Benutzt Korayns Wurfspeer, um $1oa schlundgebundene Herolde aufzuspießen.', 'Ich höre die Flügel der Schlundgebundenen im Himmel über uns, wie sie uns verspotten.\n\nDoch am Boden kann man Vögeln die Flügel stutzen.\n\nNehmt meinen Speer und zeigt mir, wie gut Ihr zielen könnt. Zerrt ein paar von ihnen aus den Lüften und streckt sie nieder.\n\nAber benutzt auch wirklich den Speer und watschelt nicht einfach herum, bis sie Euch auf den Boden folgen. Darum geht es nicht.\n\nIch will sehen, wie Ihr sie aus dem Himmel holt.', '', '', '', '', '', '', 39653),
(64070, 'deDE', 'Schrott wird wieder flott', 'Sammelt $1oa Altmetall der Schlundgebundenen.', 'Unsere Armee benötigt stets weitere Waffen, Rüstungen und Truppen. Immer.\n\nSicher, wir erhalten Verstärkung, aber so wie es läuft, kann ich nicht alle ordentlich ausrüsten. Vor allem nicht ohne richtige Schmiede und Helfer.\n\nAlso müssen wir uns mit der nächstbesten Sache abfinden. Bringt mir bitte jegliches Altmetall, das ihr bei den Schlundgebundenen findet. Ich werde schon einen Weg finden, es zu Waffen zu machen.', '', '', '', '', '', '', 39653),
(64065, 'deDE', 'Lokale Reagenzien', 'Sammelt $1oa Splitterfellkrallen, $2oa Gromitfüße und $3oa Klingenschwingennadeln.', 'Korthia ist ein merkwürdiger Ort. Die Tiere hier sind anders, was vermutlich mit der Ausstrahlung des Archivs und dessen Inhalten zu tun hat.\n\nSeid Ihr bereit, ein wenig zu experimentieren? Erst brauchen wir allerdings einen Vorrat an Reagenzien.\n\nIn der Nähe des Quorums des Suchers solltet Ihr Splitterfelle, Gromits und Klingenschwingen finden. Passt auf ihre Nadeln auf!', '', '', '', '', '', '', 39653),
(64043, 'deDE', 'Heiler gesucht', 'Heilt $1oa verwundete Paktverbündete im Quorum des Suchers.', 'Es gibt zu viele Verwundete auf dem Schlachtfeld!\n\nNicht jeder lässt sich durch Draufklopfen wieder hinbiegen. Wir brauchen mehr Heiler.\n\nNehmt mein Gerät und sorgt dafür, dass die Verwundeten wieder auf die Beine kommen!', '', '', '', '', '', '', 39653),
(64042, 'deDE', 'Rituale der Nacht', 'Helft bei den Vorbereitungen und bei dem Ritual.', 'Tyrande bleibt nicht mehr viel Zeit. Wir müssen schnell handeln.\n\n<Ysera runzelt besorgt die Stirn.>\n\nWir hatten gehofft, noch mehr Nachtkrieger zu versammeln, aber jetzt müssen wir einfach mit denen weitermachen, die wir schon haben, und hoffen, dass es ausreicht.\n\n<Ysera schüttelt den Kopf und blickt fest entschlossen wieder auf.>\n\nBevor wir beginnen, müssen wir noch die Vorbereitungen für das Ritual abschließen. Bringt bitte diese letzten Sachen mit und trefft uns dann am Hain.', '', '', '', '', '', '', 39653),
(64018, 'deDE', 'Das Gewicht des Steins', 'Unterstützt die Steinlegion bei den Vorrats- und Animalieferungen.', 'Die Kampagne geht weiter, $p. Die Steinlegion ist hier, um das Blatt auf dem Schlachtfeld zu wenden.\n\nAls Erstes müssen wir unseren Verbündeten Vorräte bringen. Korthia liegt in Trümmern, und wir sind die Einzigen, die unsere Truppen mit Nachschub versorgen können.\n\nDann müssen wir uns um die Schlundgebundenen und die Verschlinger kümmern. Meine Strategie ist recht einfach. Wir werfen Anima über den Schlundgebundenen ab. Das wird die Verschlinger herbeirufen und zum Angriff provozieren. Entweder töten sie die Schlundgebundenen oder die Schlundgebundenen töten sie. Was auch immer geschieht, wir können dabei nur gewinnen.', '', '', '', '', '', '', 39653),
(64014, 'deDE', 'Schlundforschung', 'Bittet Ve\'nari, Euch dabei zu helfen, das Ilskahorn an den Schlund zu binden.', 'Es bleibt nun noch eine Aufgabe, bevor die glorreiche Schlacht beginnen kann. Das Horn muss im Schlund verankert werden, damit sein Klang die Barriere, die dieses verderbte Reich umgibt, durchdringen kann.\n\nIch selbst weiß nicht, wie das zu bewerkstelligen ist. Sucht nach jemandem, der die Geheimnisse des Ortes versteht und Eure Hand sicher führen kann.\n\nDanica und ihre Schwestern werden auf den Ruf des Ilskahorns hören und geeilt kommen, wenn Ihr sie braucht, $n.', '', '', '', '', '', '', 39653),
(64012, 'deDE', 'Vorräte vom Vorstoß des Todes', 'Sprecht mit Herzogin Mynx in der Zuflucht des Hüters in Korthia.', 'Eure Bemühungen, den Fortschritt des Kerkermeisters zu stoppen, sind nicht unbemerkt geblieben. Wenn Ihr nach weiterer Macht für den nächsten Schritt sucht, kann ich Euch sicher dabei behilflich sein.', '', '', '', '', '', '', 39653),
(64007, 'deDE', 'Angriff der Pakte', 'Ruft die Truppen der Pakte zusammen, um in den Schlund zu ziehen!', 'Dank all der Mühen, die Ihr und die anderen Helden von Azeroth aufgebracht habt, sind die Pakte gestärkt worden. Doch wir können nicht mehr abwarten, bis der Kerkermeister seinen nächsten Schritt unternimmt.\n\nDer Weg in den Schlund steht offen und unsere Streitkräfte sind bereit.\n\nDie Pakte warten auf Euer Signal, $n.', '', '', '', '', '', 'Sprecht mit Bolvar Fordragon in Korthia.', 39653),
(63994, 'deDE', 'Wer ist der Schlundgänger?', 'Nehmt an Tal-Galans Schlundgängerprüfung teil.', 'Es gibt in Korthia Prophezeiungen über $geinen Schlundgänger:eine Schlundgängerin;, $gder:die; uns alle vor dem Untergang bewahren kann.\n\nVielleicht ist dieser Tag jetzt gekommen. Vielleicht auch nicht. Ich muss Eure Anima überprüfen. Erst dann weiß ich, ob Ihr die Wahrheit sprecht.\n\nSollte es so sein, ist es meine Pflicht, Eure Anima mit großer Macht zu erfüllen, bevor wir fortfahren.', '', '', '', '', '', '', 39653),
(63990, 'deDE', 'Die Klinge in der Nacht', 'Sucht im Grabmal des Wissens nach Hinweisen.', 'Obwohl meine Suche mühsam war, habe ich zwei vielversprechende Hinweise auf weitere Nachtkrieger finden können. Der erste befindet sich hier in Maldraxxus.\n\nDieser Turm enthält Aufzeichnungen über diejenigen, die in Maldraxxus ankamen. Darunter ist auch jemand, der als \"Die Klinge in der Nacht\" bezeichnet wird. Das sollte also unser nächster Nachtkrieger sein.\n\nAuf dem Weg hierher habe ich eine Menge Fallen entdeckt. Zweifellos werden wir innerhalb des Turms noch mehr davon finden. Jemand versucht, uns aufzuhalten.\n\nWir werden sicherstellen, dass es diesem Jemand nicht gelingt.', '', '', '', '', '', '', 39653),
(63989, 'deDE', 'Charakterschleime', 'Helft Seuchi, seine Infektionsfähigkeit am Zerfleischerausguck zu erproben.', 'Lehrling! Ich habe nach Euch gesucht.\n\nKevin war ein wundervoller Gehilfe bei unseren Experimenten, daher möchte ich auch meinen anderen Schleimen Assistenzarbeiten antrainieren.\n\nKönnt Ihr Seuchi mitnehmen und testen, inwieweit er organische Lebensformen infizieren kann?', '', '', '', '', '', '', 39653),
(63987, 'deDE', 'Ve\'lors verlorenes Paket', '', '', '', '', '', '', '', '', 39653),
(63986, 'deDE', 'Tazavesh: Jäger des verlorenen Artefakts', 'Betretet Tazavesh und besiegt So\'leah.', 'Es sieht so aus, als ob Ihr noch einmal zeigen müsst, über welche Kräfte Ihr verfügt, $gmein Lieber:meine Liebe;. Die Sicherheitstruppen von Tazavesh werden uns nicht einfach so reinmarschieren lassen.\n\nAber So\'leah muss aufgehalten werden. Und wenn es dazu ein wenig körperlicher... Überredungskunst bedarf... dann ist das ein notwendiges Übel.\n\nNehmt ein paar Freunde mit. Ich habe das Gefühl, dass die Sicherheitstruppen hier einige Tricks im Ärmel haben.', '', '', '', '', '', '', 39653),
(63985, 'deDE', 'Der Verhüllte Markt', 'Nehmt den Kahn nach Tazavesh.', 'Lasst mich raten... Ta\'oku hat Euch zu mir geschickt, nicht wahr?\n\n<Ta\'meri betrachtet die Münze in Eurer Hand.>\n\nIhr wollt also nach Tazavesh. Nicht gerade das, was wir Fremden üblicherweise anbieten, aber da die Bezahlung bereits erfolgt ist, wäre es mir eine Freude, Euch weiterzuhelfen.\n\nKommt an Bord und vergesst nicht: Während der Fahrt bitte alle Gliedmaßen schön an Bord behalten. Die Strömungen im Zwischenraum sind unberechenbar.', '', '', '', '', '', '', 39653),
(63984, 'deDE', 'Münzen für den Fährmann', 'Sprecht mit Ta\'meri in Oribos.', 'Euer Teil der Abmachung ist erledigt, $gSchlundgänger:Schlundgängerin;. Kommen wir nun also zu Eurer Bezahlung.\n\nMein Kartell betreibt eine Fähre zwischen Oribos und Tazavesh. Normalerweise wird sie nur zum Frachttransport verwendet, aber wie bei allen Dingen gibt es natürlich auch hier... Ausnahmen.\n\nBringt Ta\'meri diese Münze, dann erhaltet Ihr sicheren Zugang zum Markt.\n\nWas dann passiert, obliegt Eurer Verantwortung.\n\n<Ta\'oku verbeugt sich und Ihr glaubt, so etwas wie ein leises Lachen zu hören.>', '', '', '', '', '', 'Sprecht mit Ta\'meri in Oribos.', 39653),
(63983, 'deDE', 'Akquise', 'Besorgt den Aquilonprototyp.', 'Ta\'nla hat eine sehr... spezielle... Anfrage im Namen eines Klienten.\n\nDie Kyrianer haben an einem neuen Zenturio gearbeitet, den sie \"Aquilon\" nennen. Ich habe einige unserer Handelsspezialisten losgeschickt, um den fraglichen Prototyp zu beschaffen, aber sie sind noch nicht zurück.\n\nSolange ich das Objekt nicht habe, kann ich es natürlich Ta\'nla auch nicht liefern. Vielleicht können wir einander helfen.\n\nFindet diesen Aquilon und bringt ihn hierher. Im Gegenzug helfe ich Euch, nach Tazavesh zu kommen.', '', '', '', '', '', '', 39653),
(63982, 'deDE', 'Außerhalb meiner Befugnis', 'Nehmt das Portal zum Nachtmarkt und sprecht mit Ta\'oku.', 'Nun, ich kenne zwar die Lage des Verhüllten Marktes, kann aber in Bezug auf den Transport dorthin wenig für Euch tun.\n\nAls Gegenleistung für Eure Unterstützung bei einer Aufgabe kann ich Euch zu jemandem schicken, der uns beiden helfen könnte. Es gibt da einen Kopfgeldjäger in der Übertragungsstation Ta, einer Enklave der Mittler in der Bastion. Er wird Euch eher weiterhelfen können... und er schuldet mir noch eine Lieferung.\n\nTrefft Euch mit Ta\'oku und sagt ihm, dass Ta\'nla Euch geschickt hat.\n\nWürdet Ihr gern ein Portal benutzen? Das kann ich arrangieren. Wir sind ja schließlich Geschäftspartner, nicht wahr?', '', '', '', '', '', 'Sprecht mit Kopfgeldjäger Ta\'oku an der Übertragungsstation Ta.', 39653),
(63980, 'deDE', 'Schmugglersuche', 'Sprecht mit Ta\'nla dem Identifikator auf dem Nachtmarkt.', 'Wir Mittler haben erkannt, dass es in unserem besten Interesse ist, wenn wir mobil bleiben. Und diskret.\n\nEine Reihe unserer Städte und Außenposten liegen gut versteckt im Zwischenraum und können einfach von Ort zu Ort reisen.\n\nZu meiner Schande muss ich gestehen, dass ich Tazavesh aus den Augen verloren habe.\n\nUnsere beste Chance ist wohl, das Kartell Ta um Zugang zu bitten. Es rühmt sich, solche Dinge stets im Blick zu haben.\n\nVersuchen wir unser Glück bei den Kartellmitgliedern auf dem Nachtmarkt in Revendreth. Sie sind womöglich etwas kooperativer als ihre Kollegen in Oribos.', '', '', '', '', '', 'Sprecht mit Ta\'nla dem Identifikator auf dem Nachtmarkt in Revendreth.', 39653),
(63979, 'deDE', 'Manches bleibt besser verborgen', 'Findet eine Frachtliste von Kartell So.', 'Das Oberhaupt des Kartells So stellt eine große Bedrohung für die Schattenlande dar, $gSchlundgänger:Schlundgängerin;.\n\nIhr Name ist So\'leah. Sie will hier ein Artefakt der Ersten wieder zusammensetzen und seine Macht für ihre selbstsüchtigen Zwecke missbrauchen.\n\nTeile des Relikts liegen angeblich auf Eurer Heimatwelt versteckt. Wir Mittler haben bisher noch niemals einen Weg dorthin gefunden. Aber wenn es So\'leah gelingt, schwebt Azeroth ebenfalls in großer Gefahr.\n\nWir müssen sie abfangen.\n\nNicht weit von hier findet Ihr für das Kartell So markierte Fracht. Vielleicht finden wir in der Frachtliste einen Hinweis darauf, wo sich das Oberhaupt des Kartells aufhält.', '', '', '', '', '', '', 39653),
(63977, 'deDE', 'Insidergeschäfte', 'Sprecht mit den verschiedenen Mittlerkartellen in Oribos.', 'Ich bin der führende Experte, wenn es um die Kultur der Mittler geht. Doch die Beziehungen zwischen den Kartellen sind kompliziert und instabil.\n\nKartell So ist hier in Oribos nicht sehr stark vertreten, weshalb die anderen Kartelle vermutlich mehr wissen als ich. Hört Euch einfach mal um: Bei Eurem Ruhm werden sie Euch sicher alle Informationen geben, die uns fehlen.', '', '', '', '', '', '', 39653),
(63976, 'deDE', 'Al\'ter Gauner von Oribos', 'Trefft Euch mit der mysteriösen Kontaktperson in Oribos.', 'Ah, $gSchlundgänger:Schlundgängerin;. Ich habe eine Nachricht.\n\nEine Person möchte Euch einen besonderen Vorschlag unterbreiten. Ich kenne keine Details, aber Ihr sollt sie im hinteren Bereich der Idyllia treffen.', '', '', '', '', '', 'Trefft Euch mit der mysteriösen Kontaktperson in Oribos.', 39653),
(63964, 'deDE', 'Mittlerkopfgeld: Grimmklaue', 'Besorgt einen verknöcherten ausgewachsenen Schnabel von Grimmklaue.', 'Neue Länder bieten neue Möglichkeiten. Wer uns den intakten verknöcherten Schnabel der als Grimmklaue bekannten Bestie bringt, erhält von uns im Gegenzug eine Anzahl wertvoller Gegenstände.\n\nZaghafte Sammler brauchen sich nicht zu bewerben.\n\nBringt bitte diese Probe zu Ta\'nasi in der Zuflucht des Hüters.', '', '', 'Grimmklaue', '', '', '', 39653),
(63963, 'deDE', 'Mittlerkopfgeld: Reißmalm', 'Besorgt einen schweren Stachelbalg von Reißmalm.', 'Neue Länder bieten neue Möglichkeiten. Wer uns ein Stück des schweren Stachelbalgs von der als Reißmalm bekannten Bestie bringt, erhält von uns im Gegenzug eine Anzahl wertvoller Gegenstände.\n\nZaghafte Sammler brauchen sich nicht zu bewerben.\n\nBringt bitte diese Probe zu Ta\'nasi in der Zuflucht des Hüters.', '', '', 'Reißmalm', '', '', '', 39653),
(63962, 'deDE', 'Beobachtungsdaten', 'Sammelt $1oa Beobachtungsdaten am Zerfleischerausguck in Korthia.', 'Ich grüße Euch, $gSchlundgänger:Schlundgängerin;. Habt Ihr einen Moment Zeit?\n\nWie Ihr sicher wisst, hat mein Kartell insgeheim Beobachtungsgeräte über ganz Korthia verteilt. Aber diese Daten nützen uns nichts, wenn sie nicht abgerufen werden. Und genau da kommt Ihr ins Spiel.\n\nDie Aufzeichnungen am Zerfleischerausguck sollten zur Abholung bereit sein. Die Geräte selbst werdet Ihr nicht sehen können, aber die Daten erscheinen Euch als hell leuchtende Kugel.\n\nWenn Ihr mir diese Daten bringt, werde ich Euch großzügig belohnen.', '', '', '', '', '', '', 39653),
(63961, 'deDE', 'Versiegelte Geheimnisse', 'Beschafft $1oa versiegelte Behälter vom Zerfleischerausguck in Korthia.', 'Ah, Korthia. Was für Geheimnisse werden wir offenlegen?\n\nMeine Partner haben hart daran gearbeitet, in diesem verheerten Land verschiedene kleinere Gegenstände von Interesse aufzuspüren und sicherzustellen. Nichts von großer Bedeutung, kann ich Euch versichern.\n\nSie haben diese Gegenstände in dafür vorgesehenen Behältern gesichert, die nun am Zerfleischerausguck zur Abholung bereitstehen. Aber keine Sorge, sie sind mit einem undurchdringlichen Siegel verschlossen, um sowohl den Inhalt als auch den Zusteller zu schützen.\n\nWenn Ihr mir diese versiegelten Behälter bringt, werde ich Euch großzügig belohnen.', '', '', '', '', '', '', 39653),
(63960, 'deDE', 'Beobachtungsdaten', 'Sammelt $1oa Beobachtungsdaten am Windgepeitschten Nistgipfel und am Ästuarium des Erwachens in Korthia ein.', 'Ich grüße Euch, $gSchlundgänger:Schlundgängerin;. Habt Ihr einen Moment Zeit?\n\nWie Ihr sicher wisst, hat mein Kartell insgeheim Beobachtungsgeräte über ganz Korthia verteilt. Aber diese Daten nützen uns nichts, wenn sie nicht abgerufen werden. Und genau da kommt Ihr ins Spiel.\n\nDie Aufzeichnungen am Windgepeitschten Nistgipfel und am Ästuarium des Erwachens sollten zur Abholung bereit sein. Die Geräte selbst werdet Ihr nicht sehen können, aber die Daten erscheinen Euch als hell leuchtende Kugel.\n\nUnd vergesst nicht, auch unter der Erde nachzusehen!\n\nWenn Ihr mir diese Daten bringt, werde ich Euch großzügig belohnen.', '', '', '', '', '', '', 39653),
(63959, 'deDE', 'Beobachtungsdaten', 'Beschafft $1oa Beobachtungsdaten aus dem Refugium der Weisung in Korthia.', 'Ich grüße Euch, $gSchlundgänger:Schlundgängerin;. Habt Ihr einen Moment Zeit?\n\nWie Ihr sicher wisst, hat mein Kartell insgeheim Beobachtungsgeräte über ganz Korthia verteilt. Aber diese Daten nützen uns nichts, wenn sie nicht abgerufen werden. Und genau da kommt Ihr ins Spiel.\n\nDie Aufzeichnungen im Refugium der Weisung sollten zur Abholung bereit sein. Die Geräte selbst werdet Ihr nicht sehen können, aber die Daten erscheinen Euch als hell leuchtende Kugel.\n\nWenn Ihr mir diese Daten bringt, werde ich Euch großzügig belohnen.', '', '', '', '', '', '', 39653),
