(63955, 'deDE', 'Versiegelte Geheimnisse', 'Beschafft $1oa versiegelte Behälter aus dem Archiv in Korthia.', 'Ah, Korthia. Was für Geheimnisse werden wir offenlegen?\n\nMeine Partner haben hart daran gearbeitet, in diesem verheerten Land verschiedene kleinere Gegenstände von Interesse aufzuspüren und sicherzustellen. Nichts von großer Bedeutung, kann ich Euch versichern.\n\nSie haben diese Gegenstände in dafür vorgesehenen Behältern gesichert, die nun vor dem Archiv zur Abholung bereitstehen. Aber keine Sorge, sie sind mit einem undurchdringlichen Siegel verschlossen, um sowohl den Inhalt als auch den Zusteller zu schützen.\n\nWenn Ihr mir diese versiegelten Behälter bringt, werde ich Euch großzügig belohnen.', '', '', '', '', '', '', 39653),
(63954, 'deDE', 'Versiegelte Geheimnisse', 'Beschafft $1oa versiegelte Behälter aus dem Quorum des Suchers.', 'Ah, Korthia. Was für Geheimnisse werden wir offenlegen?\n\nMeine Partner haben hart daran gearbeitet, in diesem verheerten Land verschiedene kleinere Gegenstände von Interesse aufzuspüren und sicherzustellen. Nichts von großer Bedeutung, kann ich Euch versichern.\n\nSie haben diese Gegenstände in dafür vorgesehenen Behältern gesichert, die nun im Quorum des Suchers zur Abholung bereitstehen. Aber keine Sorge, sie sind mit einem undurchdringlichen Siegel verschlossen, um sowohl den Inhalt als auch den Zusteller zu schützen.\n\nWenn Ihr mir diese versiegelten Behälter bringt, werde ich Euch großzügig belohnen.', '', '', '', '', '', '', 39653),
(63950, 'deDE', 'Klingenschwingenkrallen', 'Sammelt $1oa Klingenschwingenkrallen.', 'Meine Jäger sind noch nicht sonderlich mit diesem Land vertraut, aber wir haben furchterregende Bestien entdeckt, die es bewohnen.\n\nDazu zählen auch die Klingenschwingen, bösartige Raubtiere mit schrecklichen Krallen... und der Reizbarkeit der Vorkai.\n\n<Herne grinst grimmig.>\n\nBringt mir ein paar ihrer Krallen, um unseren Nachwuchsjägern zu zeigen, mit welchen Bestien sie es zu tun bekommen werden.', '', '', '', '', '', '', 39653),
(63949, 'deDE', 'Das Schicksal gestalten', 'Vereitelt die Pläne des Kerkermeisters in Korthia und im Schlund, indem Ihr Paktangriffe und tägliche Quests abschließt, Schätze plündert sowie seltene Kreaturen und die Peiniger von Torghast besiegt.', 'Macht und Bösartigkeit des Kerkermeisters nehmen immer weiter zu. Für unsere Widerstandskraft muss das gleiche gelten.\n\nSammelt Eure Verbündeten, $n. Treibt die Finsternis, die uns alle zu verschlingen droht, zurück.\n\nZusammen werden wir obsiegen.\n\nMöge die Vorsehung Eure Hand führen.', '', '', '', '', '', '', 39653),
(63944, 'deDE', 'Korthia erwartet Euch', 'Meldet Euch bei Tal-Galan in der Zuflucht des Hüters in Korthia.', 'Macht Euch bereit, $n.Unsere Verbündeten erwarten Euch in Korthia.', '', '', '', '', '', '', 39653),
(63936, 'deDE', 'Verschlungene Anima', 'Gewinnt $1oa verschlungene Anima von den Verschlingern im Ästuarium des Erwachens zurück.', 'Sika hat Idee!\n\nVerschlinger... verschlingen. Fressen alles! Auch Anima.\n\nWenn wir Verschlingern Anima abnehmen, gehört sie uns!', '', '', '', '', '', '', 39653),
(63935, 'deDE', 'Geliebte Wurzeln', 'Sammelt $1oa Restanima am Archiv in Korthia.', 'Korthia. Ein gepeinigter Schwesterwald.\n\nDoch inmitten der Zerstörung gedeiht noch Hoffnung.\n\nSammelt die Anima und beginnt mit dem Wiederaufbau.', '', '', '', '', '', '', 39653),
(63934, 'deDE', 'Postraub', 'Beschafft $1oa gestohlene Nachrichten aus der Höhle des Gelehrten.', 'Seid gegrüßt, $gSterblicher:Sterbliche;!\n\nIch bin auf einer Mission, Nachrichten an unsere Verbündeten hier im aufregenden Korthia zu überbringen. Allerdings war ich nicht in der Lage, meine Aufgabe zu erfüllen.\n\nDie Botschaften, für deren Transport ich programmiert wurde, wurden von Schlundgebundenen gestohlen und dann überall inkorrekt auf dem Boden abgelegt.\n\nKönntet Ihr diese Nachrichten einsammeln und zu mir bringen? Ich sorge dann dafür, dass sie den vorgesehenen Empfängern zugestellt werden.\n\nIch danke Euch!', '', '', '', '', '', '', 39653),
(63924, 'deDE', 'Gorakklauenfetisch', 'Bringt den Gorakklauenfetisch zu Archivar Roh-Suir im Reliquiar der Erinnerung.', '<Dank Eurer Vertrautheit mit dem Archivarskodex wisst Ihr, dass es sich um eines der verschollenen Relikte handelt.\n\nArchivar Roh-Suir hat einen Platz für diesen Fetisch im Reliquiar der Erinnerung.>', '', '', '', '', '', '', 39653),
