(63919, 'deDE', 'Buch der Bindung: Der gepeinigte Zauberer', 'Sammelt $1oa azurblaue Seiten und bringt sie zu Archivar Roh-Suir im Reliquiar der Erinnerung.', '<Ihr hört eine dumpfe Stimme aus dem Buch, die immer wieder von einem Knacken und Rauschen unterbrochen wird. Die Worte der Stimme sind kaum vernehmbar, aber Ihr erkennt, dass sie unablässig darum bittet, irgendwelche azurblauen Seiten zu sammeln.\n\nBeim Durchblättern des Buchs bemerkt Ihr, dass viele der Seiten fehlen.\n\nWenn jemand die Seiten finden würde, könnte das Buch zum Archivar zurückgebracht und repariert werden.>', '', '', '', '', '', '', 39653),
(63918, 'deDE', 'Obelisk düsterer Kunde', 'Bringt den Obelisken düsterer Kunde zu Archivar Roh-Suir im Reliquiar der Erinnerung.', '<Dank Eurer Vertrautheit mit dem Archivarskodex wisst Ihr, dass es sich um eines der verschollenen Relikte handelt.\n\nArchivar Roh-Suir hat einen Platz für diesen Obelisken im Reliquiar der Erinnerung.>', '', '', '', '', '', '', 39653),
