(63912, 'deDE', 'Himmelskarte der Schattenlande', 'Sammelt $1oa Schriftrollen zur Erforschung der Jenseitsnavigation und bringt sie zu Archivar Roh-Suir im Reliquiar der Erinnerung.', '<Ihr kennt das Relikt aus dem Archivarskodex.\n\nDie Schlundgebundenen haben die Karte weggeworfen, vermutlich weil sie sie für nutzlos erachtet haben.\n\nUnd ohne die zugehörigen Kartendaten zur Bestimmung der relativen Standorte von jenseitigen Leben in den Schattenlanden ist die Karte in der Tat nutzlos. Wenn man die Forschungsergebnisse von verstorbenen Gelehrten erhalten könnte, wäre es möglich, die Karte dem Archivar voll funktionsfähig zurückzubringen.>', '', '', '', '', '', '', 39653),
(63911, 'deDE', 'Singstahlbarren', 'Besiegt die Eindringlinge der Schlundgebundenen und bringt dann den Singstahlbarren zu Archivar Roh-Suir im Reliquiar der Erinnerung.', '<Der Barren jault ein trällerndes Vibrato.>\n\nOh weh! Diese Grobiane hämmern gnadenlos auf mich ein und formen meinen Körper, damit er ihren bösen Absichten dienen kann.\n\nSchande! Schande über sie.\n\n<Der Barren stößt einen schrillen Kampfschrei aus.>\n\nLasst die Schlundgebundenen den Hammer spüren!', '', '', '', '', '', '', 39653),
(63910, 'deDE', 'Der Netherstern', 'Ladet den Netherstern wieder auf und bringt ihn zu Archivar Roh-Suir im Reliquiar der Erinnerung.', '<Ihr kennt das Relikt aus dem Archivarskodex.\n\nDie Energiequelle ist fast erschöpft, könnte aber durch den Kontakt mit roher, ungefilterter Anima wieder aufgeladen werden. Die nahe gelegenen Risse sollten sich dafür eignen.>', '', '', '', '', '', '', 39653),
(63909, 'deDE', 'Tarnung des Wechselbalgs', 'Bringt die Tarnung des Wechselbalgs zu Archivar Roh-Suir im Reliquiar der Erinnerung.', '<Dank Eurer Vertrautheit mit dem Archivarskodex wisst Ihr, dass es sich um eines der verschollenen Relikte handelt.\n\nArchivar Roh-Suir hat einen Platz für diese Maske im Reliquiar der Erinnerung.>', '', '', '', '', '', '', 39653),
(63908, 'deDE', 'Bollwerk der göttlichen Absicht', 'Bringt das Bollwerk der göttlichen Absicht zu Archivar Roh-Suir im Reliquiar der Erinnerung.', '<Dank Eurer Vertrautheit mit dem Archivarskodex wisst Ihr, dass es sich um eines der verschollenen Relikte handelt.\n\nArchivar Roh-Suir hat einen Platz für diesen Schild im Reliquiar der Erinnerung.>', '', '', '', '', '', '', 39653),
(63904, 'deDE', 'Das Herz des Ardenwalds', 'Untersucht das Herz des Waldes.', 'Ich habe mein Siegel im Herz des Waldes verborgen, um es vor den Streitkräften des Schlundes zu bewahren.\n\nDoch das Horn hat nach Hilfe gerufen.\n\nGeht mit Euren Verbündeten und ergründet den Grund des Rufes.', '', '', '', '', '', 'Kehrt zur Winterkönigin außerhalb des Herzens des Waldes zurück.', 39653),
(63903, 'deDE', 'Sturm auf das Sanktum', 'Besiegt Sylvanas Windläufer im Sanktum der Herrschaft.', 'Der Kerkermeister hat die Siegel aller vier Pakte an sich gebracht. Er hat eindeutig vor, aus dem Schlund zu entkommen und das Siegel der Richterin in Oribos zu stehlen.\n\nDas dürfen wir nicht zulassen.\n\nAn der Spitze von Torghast liegt das Sanktum der Herrschaft, der Machtsitz des Kerkermeisters. Die Zeit ist gekommen, dieses dunkle Reich zu betreten.\n\nMit Sicherheit wird Sylvanas Windläufer die Streitkräfte befehligen, die versuchen werden, uns aufzuhalten. Wir müssen sie besiegen... und Anduin Wrynn aus ihrem Griff befreien.\n\nSammelt Eure Truppen, $n. Die Schwarze Klinge wird Euch zur Seite stehen.', '', 'Die Bansheekönigin ist ein zentrales Element in den Plänen des Kerkermeisters. Findet sie... und haltet sie auf.', 'Sylvanas Windläufer', '', '', '', 39653),
(63902, 'deDE', 'Eine gute Nachricht, Freunde!', 'Fliegt mit Danica nach Korthia, um Bolvar die Neuigkeiten zu überbringen.', 'Kommt, $gmein Freund:meine Liebe;. Verlassen wir diesen schrecklichen Ort.\n\nEure Kameraden brennen bestimmt schon darauf, von der Niederlage des Auges zu erfahren. Ich werde Euch zu ihnen bringen.\n\nGebt mir Bescheid, wenn Ihr bereit zum Aufbruch seid, $n.', '', '', '', '', '', '', 39653),
(63901, 'deDE', 'Fokussieren des Auges', 'Geht zur Terminusplattform und benutzt das Ilskahorn, um Odyns Zorn zu beschwören.', 'Die Kombination aus Trauer und Wut, die Ihr zusammengetragen habt, reicht für Eure Zwecke aus. Vermutlich.\n\nWenn Ihr darauf besteht, dieses unvernünftige Unterfangen zum Abschluss zu bringen, benutzt das Horn an der Terminusplattform, wo der Fluss der Seelen nach oben gen Torghast fließt. Die Energien dort sind wahrhaftig sehr stark.\n\nDie Anwesenheit Eurer goldenen Verbündeten sollte das Auge des Kerkermeisters auf Euch lenken. Ich hoffe nur, dass dies nicht Euer Ende sein wird. Ich hasse es, eine Investition verschwendet zu sehen.', '', 'Das Auge des Kerkermeisters sucht im Schlund nach den Feinden des Kerkermeisters.', 'Auge des Kerkermeisters', '', '', '', 39653),
(63899, 'deDE', 'Buch der Bindung: Die wahnsinnige Hexe', 'Sammelt $1oa blutrote Seiten und bringt sie zu Archivar Roh-Suir im Reliquiar der Erinnerung.', '<Ihr hört eine dumpfe Stimme aus dem Buch, die immer wieder von einem Knacken und Rauschen unterbrochen wird. Die Worte der Stimme sind kaum vernehmbar, aber Ihr erkennt, dass sie unablässig darum bittet, irgendwelche blutroten Seiten zu sammeln.\n\nBeim Durchblättern des Buchs bemerkt Ihr, dass viele der Seiten fehlen.\n\nWenn jemand die Seiten finden würde, könnte das Buch zum Archivar zurückgebracht und repariert werden.>', '', '', '', '', '', '', 39653),
(63896, 'deDE', 'Tränen der Verdammten', 'Sammelt $1oa Tränen der Verdammten aus dem Gorgoa, Fluss der Seelen.', 'Um das Instrument im Schlund zu verankern und den von Euch gewünschten Effekt nutzbar zu machen, muss es mit dem rohen, ungefilterten Leid der in diesem verfluchten Gefängnis eingesperrten Seelen durchtränkt werden.\n\nTrauer ist hier im Überfluss vorhanden und damit einfach zu beschaffen. Ihr müsst nur zum Gorgoa reisen. Die Verdammten vergießen reichlich Tränen, die als kristallisierter Kummer in den Fluss der Seelen fallen und von ihm mitgeschwemmt werden.\n\nSeid vorsichtig, dass ihre Traurigkeit Euch nicht überwältigt.', '', '', '', '', '', 'Bringt die Tränen der Verdammten zu Ve\'naris Projektion am Ufer des Gorgoa.', 39653),
(63895, 'deDE', 'Wundertüte', 'Testet das Transportgerät aus Ve\'naris Tasche.', 'Interessant... Auralsequenzierer und eine ätherische Verschleierung. Behaltet sie vorerst, $n. Ich habe da so einen Verdacht, dass sie Euch noch nützen könnten.\n\nAch, und hier ist auch für mich etwas Besonderes. Wenn ich mich nicht irre, und das tue ich so gut wie nie, dann ist das ein Projektionsmechanismus. Sehr praktisch!\n\nUnd was ist das? Wohl irgendeine Art Transportgerät. Wir sollten es umgehend testen.\n\nUnd mit \"wir\" meine ich natürlich Euch.', '', '', '', '', '', '', 39653),
(63892, 'deDE', 'Runenmarken des Wahrsagers', 'Sammelt $1oa Runenmarken und bringt sie zu Archivar Roh-Suir im Reliquiar der Erinnerung.', '<Im Innern des Beutels befindet sich eine einzelne Runenmarke. Sie dreht und wendet sich, als ob eine unsichtbare Hand sie führen würde.\n\nIn den Stein sind filigrane Runen geritzt, die vage an die Vrykulsprache erinnern. Auf der Rückseite der Marke ist ein Hinweis, dass sie Teil eines Sets ist.>', '', '', '', '', '', '', 39653),
(63867, 'deDE', 'Aggressionsmanagement', 'Nutzt das Entziehungsgerät, um die Wut der wütenden Schemen im Fluss der Seelen in Euer Instrument zu leiten.', 'Ich selbst bin keine Musikerin, obschon ich die Unterhaltungsangebote in Tazavesh immer sehr genossen habe.\n\nUm diesem Horn eine Stimme zu verleihen, benötigt Ihr ein paar starke Emotionen.\n\nIn einigen der im Fluss der Seelen gefangenen Verdammten brodelt eine ungezügelte Wut. Verwendet dieses Entziehungsgerät, um die Wut aus den wütenden Schemen in Euer Instrument zu ziehen.\n\nMit den Zornesschreien, die Ihr erntet, könnt Ihr den Schleier des Schlunds durchdringen und Eure Verbündeten erreichen.\n\nIch vermute aber, dass Ihr keine sonderlich liebliche Ode fabrizieren werdet.', '', '', '', '', '', 'Findet Ve\'naris Projektion am Ufer des Flusses der Seelen.', 39653),
(63863, 'deDE', 'Vereintes Rudel', 'Besiegt Malfestus, Domonus und Furus.', 'Obwohl wir meist wetteifern und unsere Unterschiede haben, arbeiten Nemea und ich bei größeren Bedrohungen zusammen. Das Rudel und die Phalynx sind erbitterte Kämpfer auf dem Schlachtfeld.\n\nEs wäre uns beiden eine Ehre, Euch in der bevorstehenden Schlacht zu unterstützen.\n\nBitte erlaubt Andira oder Gatamatos, Euch dabei zu helfen, die Champions des Kerkermeisters zu besiegen, die unsere Streitkräfte bedrohen.', '', '', '', '', '', '', 39653),
(63861, 'deDE', 'Beginn der Sammlung', 'Beschafft den Kodex der Erinnerungen für Archivar Roh-Suir im Reliquiar der Erinnerung.', 'Setzen wir unsere Arbeit fort, indem wir den wichtigsten Gegenstand für jede Gelehrtenforschung beschaffen: den verlorenen Kodex.\n\nEs wird eine Weile dauern, doch während wir unsere Arbeit fortsetzen, werden die Seiten dieses Werkes weiter anwachsen und gedeihen, wie Korthia es schon seit Äonen getan hat.\n\nDoch wo finden wir den Kodex? Zuvor lag er tief in Korthia verborgen, in der Grotte des Nachsinnens im Süden.\n\nWir können nur hoffen, dass die Truppen des Kerkermeisters ihn noch nicht entdeckt haben.', '', '', '', '', '', '', 39653),
(63860, 'deDE', 'Talisman des ewigen Gelehrten', 'Bringt den beschädigten Talisman zu Archivar Roh-Suir im Reliquiar der Erinnerung.', '<Der Talisman ist verbeult und dreckig. Wer auch immer ihn hier versteckt hat, ist nicht gerade sanft damit umgegangen.\n\nArchivar Roh-Suir hat im Reliquiar der Erinnerung einen Platz für diesen Talisman reserviert.>', '', '', '', '', '', '', 39653),
(63859, 'deDE', 'Das Läuten des Erfolgs', 'Verteidigt die westliche, die östliche und die südliche Verstärkungsglocke und läutet sie.', 'Unsere Provosten bereiten Verstärkungsglocken vor, um zusätzliche Kyrianer zur Unterstützung unseres Angriffs herbeizurufen. Allerdings haben die Schlundgebundenen die Provosten angegriffen, um ihre Pläne zu durchkreuzen.\n\nIhr müsst unsere Provosten verteidigen, während sie ihre Arbeit erledigen, und dann jede Glocke läuten, um Verstärkung zu rufen.', '', '', '', '', '', '', 39653),
(63857, 'deDE', 'Stimmen der Ewigen', 'Hört Euch den Plan an.', '<Bolvar blickt zu den großen Figuren vor ihm, zu den unzähligen Toren, die sich in den Äther erstrecken.>\n\nDiese Kammer ist... wahrlich wundersam.\n\nDoch dies ist keine Zeit für Ehrfurcht. Die Geehrte Stimme muss sofort das Treffen eröffnen.', '', '', '', '', '', 'Kehrt zur Enklave in Oribos zurück.', 39653),
(63856, 'deDE', 'Ein Zusammentreffen der Pakte', 'Sprecht mit Tal-Inara und betretet die Kammer der Richterin.', 'Auch wenn der Kerkermeister den Schlund nicht verlassen kann, reicht seine Grausamkeit weit über die Grenzen seines Gefängnisses hinaus.\n\nGlücklicherweise erholt die Archon sich von dem Angriff. Ihre Wunde soll jedoch... verstörende Eigenschaften haben.\n\nDie Ewigen und ihre Verbündeten erwarten Euch und Hochlord Fordragon in der Kammer der Richterin. Ich werde den Weg für Euch öffnen.\n\nMit ihrer Stimme habe ich gesprochen.', '', '', '', '', '', '', 39653),
(63855, 'deDE', 'Erleichterter Übergang', 'Erschafft eine Verbindung zwischen Korthia und Ve\'naris Zuflucht.', 'Korthia ist voller Gelegenheiten. Schaut Euch doch nur all diese interessanten Objekte an.\n\nIn Erwartung derartiger Wunder bin ich natürlich gut vorbereitet hergekommen. Suchen wir uns einen geeigneten Ort, um eine dauerhaftere Verbindung zwischen hier und meiner Zuflucht aufzubauen.\n\nUnsere gemeinsame Arbeit ist noch nicht zu Ende.', '', '', '', '', '', '', 39653),
(63853, 'deDE', 'Die Flamme auslöschen', 'Tötet Infernus den Unendlichen für Theotar.', 'Könnt Ihr ihn sehen? \n\nAus dem Augenwinkel, die ganze Zeit... hell glühend!\n\nWie soll man sich denn entspannen und eine Tasse Tee genießen, wenn man diese Erinnerung an Flammen und Asche um sich hat.\n\nBitte, $gSchlundgänger:Schlundgängerin;, tut mir einen Gefallen... beseitigt ihn, damit wir uns alle eine Tasse meiner Lieblingsmischung gönnen können!', '', 'Genau wie die Schmieden von Zovaals Kessel verlöschen seine Flammen niemals.', 'Infernus der Unendliche', '', '', '', 39653),
(63849, 'deDE', 'Hörhilfe', 'Platziert die Auralsequenzierer in Desmotaeron, um Ve\'nari dabei zu helfen, die Einwohner zu belauschen.', 'Was für ein Glück! Ihr wurdet an einen Ort teleportiert, an dem ich ein gewisses... Interesse habe. Platziert die Auralsequenzierer, die ich Euch gegeben habe, dann werde ich versuchen, ein brauchbares Signal aufzubauen.\n\nEin dermaßen gefährlicher Ort wird oberste Diskretion erfordern. Ihr solltet Eure ätherische Verschleierung benutzen, um nicht entdeckt zu werden.', '', '', '', '', '', '', 39653),
(63848, 'deDE', 'Ein Zeichen der Dankbarkeit', 'Sprecht mit Ve\'nari in der Zuflucht des Hüters in Korthia.', 'Eure Anwesenheit hier erfüllt eine alte Prophezeiung, $gSchlundgänger:Schlundgängerin;. Ich bin mir sicher, dass Ihr und Eure Verbündeten uns retten werdet.\n\nVielleicht fiel mein Urteil über Eure Mittlerfreundin zu hart aus. Immerhin hat sie Euch nach Korthia begleitet.\n\nBitte richtet Ve\'nari unseren Dank aus und lasst sie wissen, dass wir gerne ihre Fragen beantworten werden.\n\nSie... scheint eine ganze Reihe davon zu haben.', '', '', '', '', '', '', 39653),
(63845, 'deDE', 'Odyns Zorn', 'Wohnt der Ermächtigung der auserwählten Val\'kyr und der Bindung des Ilskahorns bei.', 'Das Horn wurde geschmiedet und die Würdigen sind ausgewählt.\n\nUnd jetzt, $n, müssen wir nur noch die von mir auserwählten Val\'kyr an das Horn binden und sie mit meinen Kräften verstärken, damit sie mit der Macht meines Zorns zuschlagen können.\n\nKommt und seht.', '', '', '', '', '', '', 39653),
(63844, 'deDE', 'Die wenigen Auserwählten', 'Geht zum Zirkel des Ruhms und kämpft gegen die Val\'kyr, um die Würdigsten unter ihnen zu finden.', 'Ich brauche noch mehr Val\'kyr, die Danica in der kommenden Schlacht unterstützen. $n, Euch wird die Ehre zuteil, die Würdigsten auszuwählen.\n\nDie stärksten werden sich der Herausforderung im Zirkel des Ruhms stellen. Kämpft hart, $C, und gereicht Euren Waffen zur Ehre.', '', '', '', '', '', '', 39653),
(63842, 'deDE', 'Das ist \'n guter Trick', 'Schrumpft im Tremaculum 15 Gegner und vergrößert $2oa Schlundratten, damit diese sie fressen!', 'Diese grausamen Peiniger machen mich so wütend...\n\nWeil niemand sie in die Schranken weist, quälen die Fieslinge des Kerkermeisters gute Seelen, die grundlos hierhergeschickt wurden!\n\nAber jetzt bin ich da, und ich habe den perfekten Plan, um sie dafür zu bestrafen.\n\nWas meint Ihr? Wollt Ihr mir helfen, den Spieß umzudrehen?', '', '', '', '', '', 'Trefft Prinz Renathal in seinem Versteck unter der Treppe im Tremaculum.', 39653),
(63839, 'deDE', 'Schon eine einzige würdige Seele', 'Untersucht unwürdige Seelen im Tremaculum, bis Ihr eine wahrhaft würdige Seele findet.', 'Ich habe mit eigenen Augen gesehen, wie würdige Seelen zu Unrecht in den Schlund gestoßen wurden.\n\nDer Diener des Obersten Kämmerers hätte fast auch den armen Gresit hier hineingeworfen. Unter meiner Obhut hat er sich mehr als bewährt.\n\nSeht Euch unter den Seelen um, die der Abschaum des Kerkermeisters für \"unwürdig\" hält. Untersucht bei jeder Einzelnen ganz genau, ob sie ihr Schicksal hier auch verdient hat.\n\nAuch wenn wir alle Seelen im Tremaculum untersuchen müssen und nur eine einzige würdige Seele finden, die wir mit zurück nach Revendreth nehmen können, war es die ganze Mühe wert.', '', '', '', '', '', 'Trefft Prinz Renathal in seinem Versteck unter der Treppe im Tremaculum.', 39653),
(63836, 'deDE', 'Zahnbrechers Fanclub', 'Tötet $1oa Gegner aus Torghast, die Zahnbrecher aus dem Portal gezogen hat.', 'Zahnbrecher ist der stärkste Gräber aller Zeiten! Er ist unglaublich!\n\nEr ist da unten am großen Torghastportal und zerrt die Bösewichte einfach aus ihrer Heimat raus!\n\nMeist haben die nicht mal \'ne Ahnung, was überhaupt passiert, ha ha!\n\nIch und Knüppelfratze sind seit unserer Ankunft hier in seinem Fanclub.\n\nWollt Ihr auch beitreten? Das Beitrittsritual ist ganz einfach: Geht da runter und verprügelt, was auch immer er aus dem Portal holt!', '', '', '', '', '', 'Trefft Prinz Renathal in seinem Versteck unter der Treppe im Tremaculum.', 39653),
(63834, 'deDE', 'Waffen des Tremaculums', 'Sammelt $1oa schlundgebundene Waffen, $2oa grausige Kronen und $3oa Schemenaugen.', 'Die Venthyr von Sündensturz verschwenden keine Seelen, und ihre Steingeborenen verschwenden keine Waffen.\n\nHolt Euch die Werkzeuge unseres Feindes, auf dass sie unsere Armeen stärken.', '', '', '', '', '', 'Trefft Prinz Renathal in seinem Versteck unter der Treppe im Tremaculum.', 39653),
(63833, 'deDE', 'Terror im Tremaculum', 'Tötet $1oa Feinde im Tremaculum.', 'Ich bin sicher, meine Verbündeten und die Generäle haben spezifischere Aufgaben für Euch.\n\nMeine Bitte dagegen ist recht simpel. Derzeit sind wir auf allen Seiten von Feinden umzingelt.\n\nDrängt sie zurück und verschafft uns etwas Freiraum.', '', '', '', '', '', 'Trefft Prinz Renathal in seinem Versteck unter der Treppe im Tremaculum.', 39653),
(63831, 'deDE', 'Das Instrument des Zorns', 'Helft Meisterschmied Helgar an der Schmiede von Odyn.', 'Ich werde diesen Angriff auf meine Val\'kyr vergelten, und zwar mit unerbittlichem Zorn!\n\nEuch kommt dabei eine wichtige Rolle zu, $C. Ihr müsst den Mut aufbringen, den Ihr heute bewiesen habt, um mein Auge in die Schlacht zu locken.\n\nAber zunächst wartet eine einfachere Aufgabe auf Euch... die Erschaffung des Horns, das meinen Zorn heraufbeschwören wird. Meisterschmied Helgar wird Euch anleiten.', '', '', '', '', '', '', 39653),
(63829, 'deDE', 'Hier unten schwebt niemand', 'Rettet $1oa gefangene Aspiranten.', 'Nun kommt unsere Chance, jene zu befreien, die wir bereits verloren geglaubt hatten!\n\nViele unserer Aspiranten wurden vom Kerkermeister ergriffen, um sie in seine Armee zu zwingen. Jene, die sich ihm widersetzt haben, wurden in die über uns schwebenden Käfige gesperrt, wo sie bleiben sollen, bis ihre Seelen gebrochen sind.\n\nZerschmettert die Ketten der Herrschaft und befreit die gefangenen Aspiranten aus den Käfigen.', '', '', '', '', '', '', 39653),
(63828, 'deDE', 'Meiner ist größer', 'Nutzt den Zenturioverwüster, um die Konstrukte des Kerkermeisters auszuschalten.', 'Der Kerkermeister setzt eine große Zahl neu geschmiedeter Konstrukte ein, um unsere Truppen aufzuhalten. Glücklicherweise bin ich auf diese Möglichkeit bestens eingestellt.\n\nIch habe unseren größten Zenturio bereit gemacht, um diese Bedrohung abzuwehren.\n\n$gSchlundgänger:Schlundgängerin;, bitte steuert unseren Zenturio in die Schlacht.', '', '', '', '', '', '', 39653),
(63827, 'deDE', 'Ermutigende Worte', 'Rezitiert die Worte des Kodex vor $1oa erschöpften Beschützern.', 'Schon seit Stunden kämpfen unsere Streitkräfte unerbittlich. Zweifelsohne sind sie erschöpft und entmutigt.\n\nNehmt diesen Kodex und tragt den Truppen Texte daraus vor. Lasst Euch nicht täuschen: Die Worte mögen Euch bedeutungslos erscheinen, doch in ihnen steckt große Macht.\n\nWenn unsere erschöpften Beschützer sie hören, werden sie daraus Kraft und neue Hoffnung schöpfen.', '', '', '', '', '', '', 39653),
(63824, 'deDE', 'Kyrianerangriff', 'Schließt $1oa Quests in der Verdammnisfestung und im Antlitz des Vergessens ab.', 'Unser Angriff hat die Truppen des Kerkermeisters überrumpelt. Wir werden die Verdammnisfestung überrennen und seine Champions am Altar der Herrschaft besiegen!\n\nWir brauchen Euch, $gSchlundgänger:Schlundgängerin;. Unterstützt unsere Soldaten auf dem Schlachtfeld!', '', '', '', '', '', '', 39653),
(63823, 'deDE', 'Nachtfaeangriff', 'Schließt $1oa Quests in der Verdammnisfestung und im Antlitz des Vergessens ab.', 'Unser Angriff hat die Truppen des Kerkermeisters überrumpelt. Wir werden die Verdammnisfestung überrennen und seine Champions am Altar der Herrschaft besiegen!\n\nWir brauchen Eure Hilfe, $gSchlundgänger:Schlundgängerin;. Unterstützt unsere Soldaten auf dem Schlachtfeld!', '', '', '', '', '', '', 39653),
(63822, 'deDE', 'Venthyrangriff', '', '', '', '', '', '', '', '', 39653),
(63811, 'deDE', 'Eine reine Hassbeziehung', 'Begleitet Danica zur Großen Methalle und berichtet Odyn, was Helya getan hat.', 'Als die erste meiner Schwestern verschwand, waren wir besorgt. Die, die wir ausgesandt haben, um sie zu finden, kehrten nicht zurück. Und der nächste Suchtrupp auch nicht.\n\nWas wir hier aufgedeckt haben, ist ein furchtbarer Verrat von jemanden, dem wir einst vertrauten.\n\nKommt, wir müssen Odyn berichten, was wir im Schlund gesehen haben.\n\nSein Zorn wird fürchterlich sein.', '', '', '', '', '', '', 39653),
(63810, 'deDE', 'Kommt ein Vogel geflogen', 'Folgt der Spur der goldenen Federn, um herauszufinden, wer sie verloren hat.', 'Ich habe im Schlund viele schwarze Schwingen gesehen, aber niemals welche mit goldenem Glanz.\n\nDa die Auralsequenzierer jetzt die Informationen verlässlich übertragen, sollten wir die Quelle dieser Federn ausfindig machen können.\n\nFolgt der Spur, $gSchlundgänger:Schlundgängerin;. Hier wartet ein Geheimnis auf uns. Und vielleicht auch Profit.\n\nGold genießt doch dort, von wo Ihr herkommt, einen gewissen Wert, nicht wahr?', '', '', '', '', '', '', 39653),
(63793, 'deDE', 'Mittlerkopfgeld: Ensydius der Schänder', 'Besiegt Ensydius den Schänder.', 'Ein geflügelter Schlundgebundener namens Ensydius der Schänder ist dem Kartell in Korthia ein großer Dorn im Auge.\n\nWer auch immer dieses Übel beseitigt, erhält eine fürstliche Belohnung.\n\nSeid vorsichtig. Ensydius ist sehr mächtig. Ihr benötigt vielleicht mehrere Verbündete, um ihn zu besiegen.', '', '', 'Ensydius der Schänder', '', '', '', 39653),
(63791, 'deDE', 'Mittlerkopfgeld: Valdinar der Fluchgeborene', 'Besiegt Valdinar den Fluchgeborenen.', 'Ein mit Stacheln bewehrter Schlundgebundener namens Valdinar der Fluchgeborene ist dem Kartell in Korthia ein großer Dorn im Auge.\n\nWer auch immer dieses Übel beseitigt, erhält eine fürstliche Belohnung.\n\nSeid vorsichtig. Valdinar ist sehr mächtig. Ihr benötigt vielleicht mehrere Verbündete, um ihn zu besiegen.', '', '', 'Valdinar der Fluchgeborene', '', '', '', 39653),
(63790, 'deDE', 'Mittlerkopfgeld: Lord Azzorak', 'Besiegt Lord Azzorak.', 'Ein mächtiger Schreckenslord namens Lord Azzorak ist dem Kartell in Korthia ein großer Dorn im Auge.\n\nWer auch immer dieses Übel beseitigt, erhält eine fürstliche Belohnung.\n\nSeid vorsichtig. Azzorak ist sehr mächtig. Ihr benötigt vielleicht mehrere Verbündete, um ihn zu besiegen.', '', '', 'Lord Azzorak', '', '', '', 39653),
(63789, 'deDE', 'Weitere Anstrengungen: Höhle des Gelehrten', 'Befreit die Höhle des Gelehrten von Schlundgebundenen.', 'Wir können nicht zulassen, dass die Schlundgebundenen so nahe an unserem eigenen Lager Stellung beziehen. Die Bediensteten sagen, sie würden unseren Unterschlupf gut verborgen halten, aber ich finde keine Ruhe, solange ich den Feind mit eigenen Augen sehen kann.\n\nBegebt Euch in die Höhle des Gelehrten und vertreibt die Schlundgebundenen von dort.', '', '', '', '', '', '', 39653),
(63788, 'deDE', 'Weitere Anstrengungen: Refugium der Weisung', 'Befreit das Refugium der Weisung von den Verschlingern.', 'Der Kerkermeister hat das Zuhause der Bediensteten zerstört, aber wir können sie in diesen schwierigen Zeiten unterstützen.\n\nGanz in der Nähe befindet sich das Refugium der Weisung. Sie verehren diesen Ort und sind sehr traurig über den gegenwärtigen Zustand. Normalerweise begeben sie sich dorthin, um zu beten und nach der Wahrheit zu suchen, aber jetzt haben die Verschlinger das Refugium übernommen.\n\nErledigt die Verschlinger dort, damit das Refugium der Weisung wieder ein Ort der Rituale und Gebete sein kann.', '', '', '', '', '', '', 39653),
(63787, 'deDE', 'Weitere Anstrengungen: Zerfleischerausguck', 'Befreit den Zerfleischerausguck von den Splitterfellen.', 'Meine Augen haben mir verraten, dass sich nahe der neuen Straße vom Schlund nach Korthia ein Ort namens Zerfleischerausguck befindet. Diese Position würde uns einen strategischen Vorteil verschaffen.\n\nLeider wurde das Gebiet von Splitterfellen überrannt.\n\nWenn es uns gelingt, dieses Gebiet zu sichern, haben wir nicht nur freie Bahn nach Westen, sondern auch einen Beobachtungspunkt, um die Truppen des Kerkermeisters zu überwachen.', '', '', '', '', '', '', 39653),
(63786, 'deDE', 'Sturm auf den Windgepeitschten Nistgipfel', 'Reist zum Windgepeitschten Nistgipfel und befreit das Gebiet von feindlichen Kreaturen.', 'Der Himmel über Korthia ist ein gefährlicher Ort.\n\nNicht nur die Schlundgebundenen bedrohen unsere Streitkräfte, sondern auch die einheimischen Geschöpfe, die unglaublich feindselig sind. Wir müssen den Luftraum für unsere eigenen geflügelten Verbündeten und Tiere sichern.\n\nDie einheimischen flugfähigen Geschöpfe stammen vom Windgepeitschten Nistgipfel. Begebt Euch dorthin und beseitigt alle aggressiven Lebewesen in der Luft.\n\nDas wird uns die Luftüberlegenheit sichern.', '', '', '', '', '', '', 39653),
(63785, 'deDE', 'Weitere Anstrengungen: Quorum des Suchers', 'Schlagt die Truppen des Kerkermeister beim Quorum des Suchers in Korthia zurück.', 'Die Angriffe von Zovaals Truppen fügen dem Land weiterhin verheerenden Schaden zu.\n\nWir müssen ihnen eine Lektion erteilen. Zeigt ihnen, dass wir nicht zurückweichen, $n.\n\nDie Macht des Ardenwalds wird Euch beistehen.', '', '', '', '', '', '', 39653),
(63784, 'deDE', 'Gold spielt keine Rolle', 'Beschafft $1oa graubraune Gromits.', '$p! Wie geht\'s denn?\n\nWir haben gehört, dass da draußen jede Menge interessantes Zeug ist.\n\nHabt Ihr die Hüpfer bemerkt? Sind schwer zu sehen, die kleinen Dinger, oder? Die haben so \'nen schimmrigen Pelz, den ich und meine Leute auch brauchen könnten, um uns zu tarnen. Also, um den Bossen nicht in die Quere zu kommen und so.\n\nIch will ein paar von denen. Gold spielt keine Rolle, aber ich will die kleinen Viecher lebendig!', '', '', '', '', '', '', 39653),
(63783, 'deDE', 'Animarücknahme', 'Gewinnt $1oa verschlungene Anima von den Verschlingern im Refugium der Weisung zurück.', 'Für unseren Einsatz hier brauchen wir konstanten Nachschub an Truppen, Vorräten und Anima. Letztere zu besorgen, gestaltet sich augenscheinlich am schwierigsten, aber ich habe einen gewissen Einfallsreichtum entwickelt.\n\nIn der Nähe gibt es eine üppige Quelle an Anima: die Verschlinger, die gerade das Refugium der Weisung überrennen. Das ist nicht so leicht, wie sie einer Seele zu entreißen, aber genauso effektiv. Zumindest wenn man stark genug ist. Seid Ihr das?', '', '', '', '', '', '', 39653),
(63782, 'deDE', 'Schlundgebundene Rituale', 'Beschafft $1oa Zauberfolianten der Schlundgebundenen.', 'Die Schlundgebundenen verfügen über zahllose Anwender von Magie in ihren Reihen. Wir wissen nichts über diese Magie und genau das macht sie so tödlich.\n\nUm unsere Verteidigung gewissenhaft vorzubereiten, müssen wir mehr über sie erfahren. Meine persönliche Neugier bezüglich ihrer Methoden und Rituale ist dabei sekundär.\n\nMacht Jagd auf diese gefährlichen Zauberwirker und bringt mir ihre Zauberfolianten.', '', '', '', '', '', '', 39653),
(63780, 'deDE', 'Mal sehen, wie ihnen DAS gefällt!', 'Sammelt $1oa Embleme der Schlundgebundenen.', 'Allein der Gedanke daran, wie die Truppen des Kerkermeisters in den Ardenwald eingedrungen sind, macht mich zornig!\n\nUnd wenn ich zornig bin, benötige ich einen Ausgleich.\n\nUnd am besten wäre es, wenn Ihr mir helft, diesen Ausgleich zu erlangen! Tötet die Schlundgebundenen und bringt mir ihre Embleme, um mir zu zeigen, wie viele ihr getötet habt.\n\nEs ist mir vollkommen egal, woher Ihr sie bekommt, solange sie von diesen schlundgebundenen Würmern stammen!', '', '', '', '', '', '', 39653),
(63779, 'deDE', 'Anschein von Normalität', 'Sammelt $1oa Schreinopfergaben.', '$p, wir müssen den Bediensteten von Korthia helfen. Sie haben so plötzlich so viel verloren.\n\nGanz in der Nähe befindet sich das Refugium der Weisung, wo sie früher an den Schreinen Opfergaben hinterlassen haben. Da die Schlundgebundenen diesen Ort eingenommen haben, können sie das Refugium nicht mehr betreten, um die kostbaren Opfergaben zurückzuholen.\n\nWenn es Euch gelingt, die Opfergaben einzusammeln und sie zurückzubringen, könnte dies den Bediensteten einen Anschein normalen Lebens ermöglichen.', '', '', '', '', '', '', 39653),
(63778, 'deDE', 'Es geht voran', 'Sammelt $1oa geplünderte Anima in der Höhle des Gelehrten in Korthia.', 'Es bricht mir das Herz, ein weiteres Land völlig ausgelöscht zu sehen. Ich kann mir gut vorstellen, wie schön Korthia einmal gewesen sein muss.\n\nAber wir dürfen nicht dem hinterhertrauern, was wir verloren haben. Ara\'lon hat mich gelehrt, dass wir nicht untätig verharren müssen.\n\nWir können uns für den Kampf entscheiden.\n\nIhr könnt uns helfen, indem Ihr Anima von den Schlundgebundenen zurückholt. Dadurch wären wir in der Lage, unsere eigenen Streitkräfte und Verteidigungen aufzubauen.', '', '', '', '', '', '', 39653),
(63777, 'deDE', 'Versiegelte Geheimnisse', 'Beschafft $1oa versiegelte Behälter aus der Höhle des Gelehrten.', 'Ah, Korthia. Was für Geheimnisse werden wir offenlegen?\n\nMeine Partner haben hart daran gearbeitet, in diesem verheerten Land verschiedene kleinere Gegenstände von Interesse aufzuspüren und sicherzustellen. Nichts von großer Bedeutung, kann ich Euch versichern.\n\nSie haben diese Gegenstände in dafür vorgesehenen Behältern gesichert, die nun in der Höhle des Gelehrten zur Abholung bereitstehen. Aber keine Sorge: Sie sind mit einem undurchdringlichen Siegel verschlossen, um sowohl den Inhalt als auch den Zusteller zu schützen.\n\nWenn Ihr mir diese versiegelten Behälter bringt, werde ich Euch großzügig belohnen.', '', '', '', '', '', '', 39653),
(63776, 'deDE', 'Beobachtungsdaten', 'Beschafft $1oa Beobachtungsdaten aus der Höhle des Gelehrten.', 'Ich grüße Euch, $gSchlundgänger:Schlundgängerin;. Habt Ihr einen Moment Zeit?\n\nWie Ihr sicher wisst, hat mein Kartell insgeheim Beobachtungsgeräte über ganz Korthia verteilt. Aber diese Daten nützen uns nichts, wenn sie nicht abgerufen werden. Und genau da kommt Ihr ins Spiel.\n\nDie Aufzeichnungen in der Höhle des Gelehrten sollten zur Abholung bereit sein. Die Geräte selbst werdet Ihr nicht sehen können, aber die Daten erscheinen Euch als hell leuchtende Kugel.\n\nUnd schaut unbedingt auch in den unterirdischen Höhlen nach!\n\nWenn Ihr mir diese Daten bringt, werde ich Euch großzügig belohnen.', '', '', '', '', '', '', 39653),
(63775, 'deDE', 'Kryptogramme und Schlüssel', 'Bringt $1oa gestohlene Kryptografen aus der Umgebung des Archivs und vom Quorum des Suchers zurück.', 'Die Kammern des Wissens in Korthia sind durch vielschichtige Sicherheitsmaßnahmen geschützt, aus gutem Grund.\n\nFür jedes Archiv benötigt man verschiedene Kryptografen, um die Barrieren zu entschlüsseln und auszuschalten. Sie sind, in Ermangelung eines besseren Ausdrucks, die Schlüssel zu allen Geheimnissen.\n\nSucht außerhalb des Archivs nach Kryptografen, die von den Schlundgebundenen gestohlen wurden, und bringt sie mir zurück. Ich werde dafür sorgen, dass sie, und damit auch die Geheimnisse, die sie schützen, nicht in falsche Hände fallen.', '', '', '', '', '', '', 39653),
(63774, 'deDE', 'Der Seelenfänger von Maldraxxus', 'Bringt $1oa körperlose Seelen zu Frontlinienflickern, damit sie ihnen neue Körper anfertigen können.', 'Seht Euch nur um, $p. Überall türmen sich Berge von Leichen auf. Diese körperlose Seelen brennen darauf, sich wieder in den Kampf stürzen zu können.\n\nWir werden uns ihre Inbrunst zunutze machen, um das Blatt zu wenden.\n\nTrommelt die körperlosen Seelen auf dem Schlachtfeld zusammen und bringt sie zu meinen Flickern bei den Leichenhaufen, damit sie ihnen neue Körper anfertigen können!', '', '', '', '', '', 'Kehrt zu Baronin Draka zurück.', 39653),
(63773, 'deDE', 'Ihr und welche Armee?', 'Wählt einen Champion aus und eliminiert $7oa schlundgefesselte Amokläufer und $8oa schlundgefesselte Verwüster.', 'Der Kerkermeister hat eine Streitkraft aus Elitesoldaten entsandt, um unseren Truppen in den Rücken zu fallen. Dieser Angriff bringt unsere gesamte Operation in Gefahr!\n\nIhr müsst den Feind zusammen mit einem weiteren Soldaten eliminieren. Aus jedem der fünf Häuser von Maldraxxus hat ein Freiwilliger darum gebeten, Euch unterstützen zu dürfen, $n.\n\nWählt einen dieser Freiwilligen aus und lasst ihm die Ehre zuteilwerden, an Eurer Seite zu dienen.', '', '', '', '', '', 'Berichtet Baronin Draka von Eurem Erfolg.', 39653),
(63772, 'deDE', 'Beflügelte Belagerung', 'Unterstützt Artemede und die kyrianischen Streitkräfte außerhalb des Südtors der Verdammnisfestung.', 'Truppen der Kyrianer sind eingetroffen, um den Angriff zu unterstützen. Sie haben unsere Flanke gesichert und werden das Südtor der Verdammnisfestung belagern.\n\nMeldet Euch bei Artemede und helft den Kyrianern nach besten Kräften!', '', '', '', '', '', '', 39653),
(63764, 'deDE', 'Der Griff nach dem Himmel', 'Fliegt mit Danica zu Odyns Hallen in der Himmelsfeste.', 'Ich betrauere den Verlust meiner Schwestern und will nichts so sehr, wie ihren entsetzlichen Tod zu rächen. Aber ich weiß, dass ich der Magie der Hexe und ihrer Armee aus Schlundgebundenen nicht gewachsen bin.\n\nWir müssen uns von der Weisheit lenken lassen und von hier fliehen.\n\nIch bin zwar noch von der Gefangenschaft geschwächt, aber ich kann Euch von hier forttragen.\n\nVerschwinden wir, $gmein Freund:meine Liebe;.', '', '', '', '', '', '', 39653),
(63763, 'deDE', 'Es könnte jeder sein', 'Bringt den Kopf von Azodius zu Bolvar Fordragon in der Zuflucht des Hüters.', '<Die Fratze des immer noch warmen Kopfes des Schreckenslords Azodius starrt Euch an.\n\nDie Bediensteten in der Zuflucht des Hüters müssen über die Entführung des Schicksalsschreibers informiert werden.\n\nHochlord Fordragon wird zweifelsohne von dieser unerwarteten Bedrohung erfahren wollen.>', '', '', '', '', '', 'Bringt den Kopf zu Bolvar Fordragon in der Zuflucht des Hüters.', 39653),
(63762, 'deDE', 'Im Bann der Illusion', 'Benutzt das Utensil des Schicksalsschreibers, um die Illusion zu bannen.', 'Der Schicksalsschreiber hat die nötigen Gegenstände gesammelt, um in dieser Kammer eine Illusion zu erzeugen. Glücklicherweise können wir sein eigenes Utensil nutzen, um sie zu bannen und ihn zu enthüllen.\n\nEr wird ganz sicher dankbar sein, ein freundliches Gesicht zu sehen.\n\nIhr habt Euch bei dieser Aufgabe als unglaublich hilfreich erwiesen. Ohne Euch hätte ich es wirklich nicht geschafft.', '', '', '', '', '', '', 39653),
(63761, 'deDE', 'Verzögerte Rache', 'Tötet $1oa Verschlinger im Refugium der Weisung.', '<Der korthianische Beschützer ist schwer verletzt und kann kaum sprechen.>\n\nVerschlinger... haben sich im Refugium ausgebreitet. Wir... waren zu wenige.\n\nMeine Pflicht... bleibt unerfüllt.\n\nDie Vorsehung... Ich...\n\n<Die Stimme des Beschützers wird immer schwächer.>', '', '', '', '', '', '', 39653),
(63760, 'deDE', 'Echos des Schicksals', 'Lasst das Utensil des Schicksalsschreibers an den Schreinen im Refugium der Weisung resonieren.', 'Die Verschlinger haben sich hier ausgebreitet, doch wir müssen uns darauf konzentrieren, den Schicksalsschreiber zu finden.\n\nBedienstete, die hier gebetet haben, haben an den Schreinen Animaopfer hinterlassen.\n\nDas Utensil, das Ihr gefunden habt, wird resonieren, wenn der Schicksalsschreiber in der Nähe war. Mit ein wenig Glück sollte uns das eine Vorstellung davon geben, wohin er gegangen sein könnte.', '', '', '', '', '', '', 39653),
(63759, 'deDE', 'Neuausrichtung der Suche', 'Trefft Verwalterin Kah-Than am Eingang zum Refugium der Weisung in Korthia.', 'Ich glaube, der Schicksalsschreiber war auf dem Weg zum Refugium der Weisung, einem heiligen Ort für die Bediensteten von Korthia.\n\nGlücklicherweise haben wir dank Eurer Gewohnheit, jedes Stück Unrat einzusammeln, das Ihr am Boden findet, das Utensil des Schicksalsschreibers gefunden!\n\nDas wird uns ganz sicher helfen, ihn zu finden. Aber zunächst müssen wir zum Refugium.', '', '', '', '', '', 'Trefft Verwalterin Kah-Than am Eingang zum Refugium der Weisung in Korthia.', 39653),
(63758, 'deDE', 'Wo man zuletzt nachsieht', 'Durchsucht das Quorum des Suchers nach dem vermissten Schicksalsschreiber.', 'Ich kam in der Hoffnung hierher, den Schicksalsschreiber zu finden, oder zumindest etwas, das mir helfen könnte, ihn zu finden.\n\nDen Anzeichen nach war er hier und hat den Angriff der Schlundgebundenen überlebt. Der einzige Ort, an dem ich noch nicht gesucht habe, ist eine Meditationskammer auf der gegenüberliegenden Seite der Ruinen.\n\nIch kann mich nicht allein in das Quorum des Suchers wagen, das wäre zu gefährlich. Könntet Ihr mir nicht helfen?\n\nIch muss den Schicksalsschreiber finden. Es ist wirklich enorm wichtig.', '', '', '', '', '', '', 39653),
(63757, 'deDE', 'Plündert die Plünderer', 'Holt $1oa korthianische Artefakte von den Schlundgebundenen zurück.', '<Der Schlundgebundene hatte ein korthianisches Artefakt bei sich.\n\nEs ist nicht ersichtlich, was der Feind mit solchen Relikten zu tun gedenkt. Aber Ihr vermutet, die Bediensteten in der Zuflucht des Hüters hätten sie bestimmt gern zurück.>', '', '', '', '', '', '', 39653),
(63756, 'deDE', 'Rettung aus der Qual', 'Rettet $1oa gepeinigte Bedienstete im Quorum des Suchers.', 'Die Schlundgebundenen töten jene, die sie im Quorum des Suchers finden, nicht einfach nur. Sie verhören die Überlebenden auch.\n\nWir sollten diejenigen retten, die noch zu retten sind. Womöglich hat einer von ihnen ja den Schicksalsschreiber gesehen.', '', '', '', '', '', '', 39653),
(63755, 'deDE', 'Eine dringliche Angelegenheit', 'Sucht nach dem Schicksalsschreiber von Korthia.', '$gSchlundgänger:Schlundgängerin;, es gibt eine dringliche Angelegenheit, der sich jemand annehmen muss.\n\nUnser Schicksalsschreiber wird vermisst. Er hat es noch nicht hierher geschafft. Eigentlich hätte er schon im Quorum des Suchers sein sollen, bevor...\n\n<Pfadschreiber Roh-Vess hält inne.>\n\nKönnt Ihr den Schicksalsschreiber suchen gehen? Viele Bediensteten nutzten die Höhlen in den Ruinen, um sich vor den Schlundgebundenen zu verstecken.', '', '', '', '', '', '', 39653),
(63754, 'deDE', 'Der Vogel im Käfig', 'Beschafft das helgeschmiedete Siegel von Kjellrun und befreit Danica aus der Gefangenschaft.', 'Seid still, niemand darf uns bemerken.\n\nViele meiner Schwestern sind schon verloren. Schon bald wird die Reihe an mir sein, für das grausige Ritual dieser Hexe zu sterben.\n\nBefreit mich aus diesem Käfig, dann kann ich uns beide in Sicherheit bringen. Hüter Odyn muss vor diesem schändlichen Verrat gewarnt werden!\n\nDie Schlundgebundene Kjellrun besitzt das Siegel, das mich befreien kann. Ihr findet diese schadenfrohe Schurkin gleich in der nächsten Halle.', '', '', 'Kjellrun die Plagerin', '', '', '', 39653),
(63753, 'deDE', 'Zenturionen, marsch!', 'Sammelt $1oa Animapartikel, um die Zenturionen zu ermächtigen und im Kampf zu unterstützen.', 'Drei unserer Zenturionen haben das Seitentor durchbrochen. Sie brauchen zusätzliche Anima, um ihren Angriff fortzusetzen.\n\nMehrere meiner Assistenten haben versucht,sie ihnen zu bringen, leider erfolglos. Bitte bergt die Anima und unterstützt die Zenturionen bei ihrem Angriff.', '', '', '', '', '', '', 39653),
(63740, 'deDE', 'Expertenrat einholen', 'Haltet Zwiesprache an den Gedenkstätten der Archivare.', 'Wir können den Leitstab wiederherstellen, aber nicht ohne die Weisheit der Archivare.\n\nIch spreche nicht nur von mir, sondern auch von den vergangenen Archivaren. Sie wurden hier in der Nähe zur letzten Ruhe gebettet. Angesichts der gewaltigen Zerstörung in Korthia und auch der Tatsache, dass dies wohl noch längst nicht alles war, könnte dies unsere letzte Chance sein, ihre Gedenkstätten zu besuchen, bevor sie unrettbar ruiniert werden.\n\nSucht die Gedenkstätten der Archivare auf. Nehmt Roh-Suir mit, damit er ihre Nachrichten aufzeichnen kann, bevor sie auf ewig verloren sind.', '', '', '', '', '', '', 39653),
(63739, 'deDE', 'Aufsteigende Hoffnung', 'Trefft Euch mit Archivarin Roh-Senara und dem Gelehrten Roh-Suir oben auf dem Aufstieg der Hoffnung.', 'Es gibt noch eins, das wir erledigen müssen.\n\nTrefft uns oben auf dem Aufstieg der Hoffnung.', '', '', '', '', '', '', 39653),
(63738, 'deDE', 'Aufbau des Archivs', 'Trefft Euch mit dem Gelehrten Roh-Suir in der Zuflucht des Hüters.', 'Ich begebe mich zur Zuflucht des Hüters, wo es zumindest einen kleinen Anschein von Sicherheit gibt.\n\nDort werden wir ein neues Archiv aufbauen.\n\nTrefft mich dort, wenn Ihr bereit seid.\n\nIch hoffe, ich kann weiterhin auf Eure Hilfe zählen. Denn auch dort werden wir Euch bald benötigen.', '', '', '', '', '', '', 39653),
(63737, 'deDE', 'Die wahre Vorsehung finden', 'Nehmt am Ritual der Einstimmung für den Leitstab teil.', 'All Eure Bemühungen haben uns an diesen Punkt geführt.\n\nMit der geballten Weisheit der Archivare und ein wenig Hilfe von Euch als $C werden wir den Leitstab auf die Relikte einstimmen, die wir benötigen.\n\nWenn uns das gelingt, wird das Archiv wiederauferstehen.\n\nUnd unsere heilige Pflicht kann fortgeführt werden.', '', '', '', '', '', '', 39653),
(63736, 'deDE', 'Eine Animainfusion', 'Erfüllt den Leitstab mit Anima.', 'Normalerweise würden wir den Leitstab mit der Energie aus dem Netherstern speisen, einem weiteren mächtigen Relikt.\n\nLeider ist das gerade unmöglich. Aber zur Not ist Anima ein recht brauchbarer Ersatz.\n\nNehmt den Leitstab. Haltet ihn über kürzlich gefallene Verschlinger dort unten im Ästuarium.\n\nDer Stab sollte ihnen dann die Anima entziehen und sie absorbieren.', '', '', '', '', '', '', 39653),
(63734, 'deDE', 'Der gesplitterte Stab', 'Beschafft die drei Segmente des Leitstabs wieder.', 'Mir bleibt keine Wahl. Ich muss Euch die Geheimnisse des Leitstabes anvertrauen.\n\nIn den richtigen Händen, wie zum Beispiel den Händen einer ausgebildeten Archivarin, kann der Stab mächtige Relikte aus den jenseitigen Leben der Schattenlande aufspüren.\n\nEr wurde in drei Teile zerschlagen, damit er niemals in falsche Hände gerät. Die Eindringlinge haben bereits die Teile gefunden haben, aber sie wissen noch nicht um ihre wahre Bedeutung.\n\nHolt die Teile des Stabes zurück. Jedes einzelne Segment befindet sich im Besitz eines unterschiedlichen Schlundgebundenen.', '', '', '', '', '', '', 39653),
(63733, 'deDE', 'Auf Biegen und Breschen', 'Besiegt $1oa Eindringlinge der Schlundgebundenen.', 'Obwohl ich Gewalt verabscheue und Konflikte bevorzugt mit Vernunft löse, gibt es in diesem Fall keine Alternative.\n\nDamit Roh-Suir und ich sicher entkommen können, müsst Ihr mit aller Macht die Schlundgebundenen angreifen, die in das Quorum des Suchers eingedrungen sind.\n\nSchlagt eine Bresche in ihre Reihen und bahnt uns einen Fluchtweg.', '', '', '', '', '', '', 39653),
(63732, 'deDE', 'Verhören stören', 'Rettet Archivarin Roh-Senara.', 'Pssst... Leise!\n\nDie Eindringlinge werden mich töten, wenn sie mich hier finden. Wie schon so viele andere!\n\n<Roh-Suir gestikuliert wild in die Richtung der Schlundgebundenen.>\n\nSie foltern die Archivarin!\n\nIhr müsst einen Weg finden, sie zu retten. Wir können nicht zulassen, dass ihr großes Wissen in die Hände der Schlundgebundenen fällt!', '', 'Dieser Verhörer ist ebenso gnadenlos wie abscheulich.', 'Verhörer Tzench', '', '', '', 39653),
(63731, 'deDE', 'Korthianische Relikte erforschen', 'Findet den Gelehrten Roh-Suir, um mehr über die Relikte zu erfahren.', '<Ihr findet ein zerfleddertes Buch über die Relikte, die in Korthia verwahrt wurden.\n\nEin Name auf den Seiten des Buchs beginnt zu leuchten: \"Roh-Suir\".\n\nDas Buch dreht sich in Eurer Hand und weist in eine Richtung, während Roh-Suirs Name pulsiert.\n\nVielleicht könnt Ihr mithilfe von Roh-Suir mehr über die Relikte erfahren, die Ihr gefunden habt.>', '', '', '', '', '', '', 39653),
(63728, 'deDE', 'Jagd zwischen den Häusern', 'Sprecht mit Ysera, um mehr zu erfahren, und sucht dann nach Huln Hochberg im Grabmal des Wissens.', 'Ich habe geträumt, dass Tyrande Wisperwind für das Überleben des Ardenwalds entscheidend ist.\n\nDie Nachtfae suchen schon lange nach anderen wie ihr, nach anderen ehemaligen Nachtkriegern. Wir haben einen uralten Verbündeten von Azeroth beauftragt, nach ihnen zu suchen: Huln Hochberg.\n\nElunes Macht ist zu überwältigend für ein sterbliches Wesen, selbst für Tyrande. Ich weiß nicht, wie lange sie das noch aushält.\n\nLasst mich das noch etwas weiter ausführen. Dann müsst Ihr Euch so schnell wie möglich mit Huln in Maldraxxus treffen.', '', '', '', '', '', '', 39653),
(63727, 'deDE', 'Die Rückkehr des Primus', 'Trefft Euch mit dem Primus in der Zuflucht des Hüters, um einen neuen Angriffsplan zu schmieden.', 'Der Kerkermeister besitzt nun vier der fünf Siegel für seinen Plan.\n\nAber es war töricht von ihm, uns am Leben zu lassen. Sein Verlangen, uns zu brechen, wird ihm zum Verhängnis werden.\n\nNoch ist nicht alles verloren. Vertraut auf Eure Stärke. Es gibt noch etwas, das wir tun können.\n\nKommt. Treffen wir uns mit dem Rest Eurer Streitkräfte und bereiten den nächsten Angriff vor.', '', '', '', '', '', 'Sprecht mit dem Primus in Korthia.', 39653),
(63726, 'deDE', 'Entwirrung des Siegels', 'Beratet Euch mit Bolvar, was mit dem Siegel zu tun ist.', 'Das Siegel des Primus ist durch die Magie der Erinnerung gebunden. Es erinnert mich an etwas, das Euch schon einmal begegnet ist.\n\nIhr habt den Runenmetz, diese arme Seele, gefangen in den Eingeweiden von Torghast, zu einem Verbündeten gemacht. Er nahm die Erinnerungen, die Ihr gefunden hattet, und half Euch, sie zu Waffen und Rüstungen zu schmieden.\n\nVielleicht kann er das Siegel aus diesem Gewirr von Erinnerungen herauslösen.\n\nDas ist unsere beste Chance, das Siegel zu sichern. Aber der Weg ist gefährlich.', '', '', '', '', '', 'Sprecht mit dem Primus in Torghast.', 39653),
(63725, 'deDE', 'Auf in das Archiv', 'Findet das Siegel des Primus im Archiv von Korthia.', 'Die Zerstörung hier ist... erschütternd.\n\n<Tal-Galan spricht leise ein Gebet.>\n\nDie Anima fließt jetzt in die Überreste des Archivs. Wir müssten jetzt hineingehen können.\n\nSobald wir drinnen sind, werde ich versuchen, das Siegel des Primus zu sichern.\n\nBitte erweist dem Archiv Eure Ehrerbietung. Es ist ein heiliger Ort, den zu sehen nur wenigen gestattet ist.\n\nSelbst die Prophezeiungen haben nicht vorausgesagt, dass ein $gein lebender Sterblicher:eine lebende Sterbliche; die Geheimnisse im Inneren erblicken würde.', '', '', '', '', '', 'Bringt das Siegel des Primus zu Bolvar Fordragon in Korthia.', 39653),
(63722, 'deDE', 'Die Hüter von Korthia', 'Rettet 3 Aufzeichnungshüter im Archiv der Geheimnisse.', 'Wir konnten den Truppen des Kerkermeisters nur knapp standhalten. Aber mit Euch wird sich das Blatt bald wenden.\n\nIch weiß, dass Ihr unbedingt in das Archiv wollt, aber es gilt auch, unsere Aufzeichnungshüter zu retten.\n\nSie sind die Experten für alles, was sich im Archiv befindet. Wir dürfen nicht zulassen, dass der Kerkermeister herausfindet, was sie wissen.', '', '', '', '', '', 'Trefft Euch mit Secutor Mevix im Archiv der Geheimnisse.', 39653),
(63717, 'deDE', 'Die Verteidigung des Archivs', 'Helft Beschützerin Kah-Rev, die Invasion der Schlundgebundenen zurückzuschlagen.', 'Um das Archiv zu erreichen, müssen wir uns einen Weg durch die angreifenden Schlundgebundenen bahnen.\n\nDie Pakte tun ihr Bestes, um diese Monstrositäten zu vertreiben, aber unsere Verbündeten werden nicht ewig durchhalten. Die Schlundgebundenen sind entschlossen, die Beute vor Euch zu erreichen.\n\nWir könnten Eure Hilfe im Kampf gegen die Truppen des Kerkermeisters brauchen, $gSchlundgänger:Schlundgängerin;.\n\nMöge die Vorsehung uns alle leiten.', '', '', '', '', '', 'Trefft Euch mit Secutor Mevix im Archiv der Geheimnisse.', 39653),
(63714, 'deDE', 'Auf zum Archiv', 'Nehmt einen Fledderflügeltransporter zum Archiv der Geheimnisse.', 'Nachdem die Knochenschmiedin nun beide Leitungen repariert hat, sollte die Anima zum Archiv fließen. Dadurch haben wir die Chance, dort reinzukommen... wenn wir es denn erreichen.\n\nUnsere Verbündeten aus Maldraxxus haben den Transport zum und vom Archiv vorbereitet. Wir sollten uns beeilen.\n\nWenn die Diener des Kerkermeisters das Siegel des Primus vor uns in die Finger bekommen, wird nicht nur Korthia darunter leiden. Die gesamten Schattenlande könnten für immer verloren sein.\n\nGehen wir, $gSchlundgänger:Schlundgängerin;. Unsere Truppen warten auf uns.', '', '', '', '', '', 'Sprecht mit Beschützerin Kah-Rev beim Archiv der Geheimnisse.', 39653),
(63713, 'deDE', 'Ganz schön hakelig', 'Reist per Wurfhaken zu der schwebenden Insel und repariert dann die Animaleitung.', 'Ich habe ein paar solide Wurfhaken und Ankerpunkte gebaut. Keine Sorge, wenn sie mein Gewicht halten, werden sie auch Eures halten!\n\nDamit kommen wir über den Abgrund zur nächsten Animaleitung.\n\nIch gehe voraus und warte auf Euch. Wer weiß, was da drüben auf uns lauert.\n\nJe schneller die Animaleitung wieder funktioniert, desto schneller kommen wir in das Archiv, um uns das Siegel des Primus zu holen.', '', '', '', '', '', '', 39653),
(63712, 'deDE', 'Verlorene Aufzeichnungen', 'Verwendet das Matrixsignal, um $2oa verlorene Aufzeichnungen zu bergen.', 'Einige Aufzeichnungshüter sind zu diesem Berg geflohen, als Korthia in den Schlund gezogen wurde.\n\nIch finde keine Spur von ihnen, doch vielleicht haben sie Aufzeichnungen zurückgelassen.\n\nNehmt dieses Signal. Ich habe es mithilfe der Informationen der zuvor von Euch geretteten Aufzeichnungshüter angefertigt.\n\nEs wird Euch zu etwaigen noch intakten Aufzeichnungen an diesem Berg führen.', '', '', '', '', '', '', 39653),
(63711, 'deDE', 'Knochenwerkzeug', 'Sammelt $1oa animaerfüllte Knochen von Wildtieren.', 'Dann befindet sich das Gerät, mit dem wir dieses Archiv öffnen können, also auf einer schwebenden Insel?\n\nKein Problem.\n\nHier gibt es eine Menge äußerst zähe Wesen. Und wie ich immer sage: Bloß keine Knochen verkommen lassen!\n\nGeht und bringt mir einen Haufen Knochen. Ich fertige uns damit ein paar Ankerpunkte, mit denen wir per Wurfhaken auf die andere Seite kommen.', '', '', '', '', '', '', 39653),
(63710, 'deDE', 'Die Animaspur', 'Folgt der Animaspur bis zur nächsten Leitung.', 'Der Kerkermeister sucht also das Siegel des Primus. Wir müssen vor den Schlundgebundenen dort sein. Um das Archiv zu öffnen, benötigen wir Anima.\n\nIhr habt der Knochenschmiedin dabei geholfen, die erste Leitung zu reparieren. Diese Animaspur führt uns zur nächsten Leitung.\n\nWenn wir sie aktivieren können, sollte genug Anima nach Korthia fließen, um den Weg in das Archiv zu öffnen.\n\nKommt, wir müssen uns beeilen!', '', '', '', '', '', 'Trefft Euch mit Tal-Galan und Knochenschmiedin Heirmir am Ende der Animaspur.', 39653),
(63709, 'deDE', 'Geheimnisse des Archivs', 'Untersucht die wiedergewonnenen Aufzeichnungen mit Tal-Galan.', 'Was für ein Segen! Ihr habt die Aufzeichnungshüter gerettet, bevor die Schlundgebundenen ihnen das Wissen über die Relikte im Archiv stehlen konnten.\n\nAber die Aufzeichnungen sind fragmentiert. Unvollständig. Ich hoffe, dass genug übrig ist, um die Wahrheit zu erfahren.\n\nIch werde versuchen, das verbliebene Wissen in einer Mitteilung zusammenzufassen. Wenn die Vorsehung es so will, werden wir erfahren, was der Kerkermeister vorhat und wem dieser Gegenstand ursprünglich gehörte.\n\nIch muss mich für einen Moment konzentrieren. Lasst mich wissen, wenn Ihr bereit seid, anzufangen.', '', '', '', '', '', '', 39653),
(63708, 'deDE', 'Phantasmagorie', 'Bringt das verformte Phantasma zu Ve\'nari in Ve\'naris Zuflucht.', '<Das seltsame fremde Energiepartikel pulsiert in einem ungleichmäßigen Rhythmus.\n\nVe\'nari könnte das sehr interessieren.>', '', '', '', '', '', '', 39653);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(63706, 'deDE', 'Lasst die Anima fließen', 'Helft Knochenschmiedin Heirmir, die Animaleitung zu reparieren.', 'Tal-Galan hat mir die Situation und die Funktionsweise des Archivs erklärt. So gut, wie es diesen Gelehrten nun mal möglich ist.\n\nZuerst müssen wir die Energieversorgung des Archivs sicherstellen. Sie verwenden unterirdische Leitungen, um es mit Anima zu versorgen.\n\nDer Bedienstete sagt, dass eine dieser Leitungen in der Höhle des Gelehrten untergebracht ist.\n\nWenn Ihr mich dort hinbringt, kann ich sie vielleicht reparieren. Passt einfach auf mich auf, während ich herausfinde, wie diese korthianischen Geräte funktionieren.', '', '', '', '', '', '', 39653),
(63705, 'deDE', 'Die Hüter des Wissens', 'Rettet $1oa Aufzeichnungshüter aus der Höhle des Gelehrten.', 'Unser Archiv wurde gebaut, um unzählige Geheimnisse und Artefakte zu verwahren. Selbst wenn wir Zutritt erhalten, können wir nicht sicher sein, wonach der Kerkermeister sucht.\n\nBestimmte Bedienstete fungieren als Aufzeichnungshüter. Sie verfolgen die im Archiv gelagerten Gegenstände und sind für äußerste Diskretion bekannt.\n\nEin paar der Hüter wurden von den Schlundgebundenen gefangen genommen. Man foltert sie, um Informationen aus ihnen herauszupressen.\n\nBitte rettet die Aufzeichnungshüter, $n. Mit ihrer Hilfe können wir herausfinden, wonach der Verbannte sucht!', '', '', '', '', '', '', 39653),
(63704, 'deDE', 'Rache für Korthia', 'Tötet $1oa Schlundgebundene in der Höhle des Gelehrten.', 'Das Öffnen des Archivs hat zwar Priorität, aber ich muss Euch um einen Gefallen bitten.\n\nAls Korthia in den Schlund gezogen wurde, wurde mein Volk von Entsetzen ergriffen. Wir sind in das Gebiet geflüchtet, das Ihr vor Euch seht. Ein friedlicher Ort, den man die Höhle des Gelehrten nennt.\n\nDoch schon bald sind die Schlundgebundenen über uns hergefallen. Die meisten wurden niedergemetzelt. Andere wurden gefangen genommen.\n\nIch würde selbst Rache nehmen, wenn ich könnte. Aber ich... ich bin nicht für den Kampf gerüstet, anders als Ihr.\n\nBitte zeigt diesen Ungeheuern, dass wir die Entweihung Korthias nicht hinnehmen!', '', '', '', '', '', '', 39653),
(63703, 'deDE', 'Archiv der Geheimnisse', 'Trefft Euch mit Tal-Galan an der Höhle des Gelehrten.', 'Ihr habt uns geholfen, zumindest den Anschein von Ordnung wiederherzustellen, $gSchlundgänger:Schlundgängerin;. Aber die Aussichten gestalten sich finster.\n\nDie Truppen des Kerkermeisters haben einen Großangriff auf die Ruinen unseres Archivs in den abgelegeneren Bereichen von Korthia gestartet. Offensichtlich sucht der Verbannte darin etwas Wertvolles.\n\nDie Verteidigung des Archivs wird aktiviert, wenn es bedroht wird. Es wird also nicht einfach sein, hineinzukommen. Aber wir müssen bergen, was der Kerkermeister sucht, bevor seine Schlundgebundenen es tun.\n\nIch konnte einen Nekrolord überzeugen, uns bei der Öffnung des Archivs zu helfen.', '', '', '', '', '', 'Sprecht mit Tal-Galan an der Höhle des Gelehrten.', 39653),
(63683, 'deDE', 'Siegel des Winters', 'Bringt die Träne der Schwestern zu Ysera im Herz des Waldes.', 'Meine Schwester... Nach all dieser Zeit... Sie hat mich nicht aufgegeben...\n\n<Ein kaum wahrnehmbares Lächeln schmückt das Gesicht der Winterkönigin und verschwindet dann wieder. Sie sieht Euch mit der Last der Äonen in ihren Augen an.>\n\nBegleitet mich, $n. Nehmt die Träne meiner Schwester und kommt mit zum Herz des Waldes.', '', '', '', '', '', '', 39653),
(63682, 'deDE', 'Die Macht von Elune', 'Helft bei der Durchführung des Rituals.', 'Wir haben in der uns zur Verfügung stehenden Zeit so viel getan, wie wir konnten.\n\nJetzt müssen wir Thiernax und den anderen unsere Kraft verleihen und hoffen, dass Tyrande überleben wird.', '', '', '', '', '', '', 39653),
(63681, 'deDE', 'Zurück zum Herz', 'Kehrt zu Ysera vor dem Herz des Waldes im Ardenwald zurück.', 'Wir sollten so schnell wie möglich zurück zum Ardenwald!\n\nGeht Ihr schon vor und sucht nach Ysera. Ich begleite die Steinhauerin dorthin und sorge dafür, dass Huln sicher zurückfindet.', '', '', '', '', '', 'Kehrt zu Ysera vor dem Herz des Waldes im Ardenwald zurück.', 39653),
(63680, 'deDE', 'Am Abgrund', 'Spürt Huln Hochberg auf.', 'Es klingt, als wäre Huln woanders hingebracht worden, und zwar von der Steinhauerin selbst!\n\nWir sollten nach Hinweisen suchen, die sie hinterlassen haben könnte, als sie durch diese Gegend kam. Das wird uns hoffentlich zu Huln führen!', '', '', '', '', '', '', 39653),
(63679, 'deDE', 'Magische Mysterien!', 'Findet Lady Mondbeere in Revendreth.', '<Lady Mondbeere Stimme erklingt aus der Schriftrolle.>\n\n$n! Anscheinend hat sich Huln einigen Ärger eingehandelt. Und... nun ja... es ist kompliziert. Wir könnten wirklich Eure Hilfe in Revendreth brauchen! Ich erwarte Euch in der Herrschaftsburg.\n\nBis bald!', '', '', '', '', '', 'Findet Lady Mondbeere in Revendreth.', 39653),
(63678, 'deDE', 'Rache für Akarek', 'Trefft Euch mit Markgräfin Sin\'dane auf der Exoramas im Haus der Rituale.', 'Die letzten Verräter an Markgraf Akarek sind tot.\n\nDas bringt unseren Markgrafen zwar nicht zurück, aber ich bin trotzdem zufrieden.\n\nMeine Baronin wünscht, dass wir Markgräfin Sin\'dane von diesem Erfolg berichten, bevor wir zum Ardenwald aufbrechen.', '', '', '', '', '', 'Trefft Euch mit Markgräfin Sin\'dane auf der Exoramas im Haus der Rituale.', 39653),
(63677, 'deDE', 'Ihr könnt nur sterben', 'Tötet Fal\'zinge auf der Exoramas.', 'Der letzte Name auf meiner Liste ist ein Lich namens Fal\'zinge.\n\nSin\'dane hat ihn genau im Auge behalten, um mehr über Kel\'Thuzads Pläne zu erfahren.\n\nFal\'zinges Ende soll so schmerzhaft wie möglich sein.\n\nWir sollten ihn auf der Exoramas im Haus der Rituale finden.', '', 'Tötet Fal\'zinge.', 'Fal\'zinge', '', '', '', 39653),
(63676, 'deDE', 'Verstecken ist zwecklos', 'Findet Zeichen von Kel\'Thuzads Gunst und tötet Drava\'ora.', 'Es gibt noch einige, die ihre Unterstützung für Kel\'Thuzad niemals öffentlich gezeigt haben. Auch nicht nach seinem Coup. Aber auch sie waren am Sturz meines Markgrafen beteiligt und auch sie werden dafür sterben.\n\nIch habe erst einen Namen, Drava\'ora, aber da sind noch mehr. Sin\'dane glaubt, diese Verräter tragen alle ein Zeichen der Gunst. Sie weiß nicht, wer solch ein Zeichen hat, also töten wir einfach so lange, bis wir sie finden.\n\nDieses Exempel wird dem Rest von ihnen nicht lange verborgen bleiben.', '', '', '', '', '', '', 39653),
(63675, 'deDE', 'Es gibt kein Entkommen', 'Sammelt Hinweise und tötet anschließend Zelmany.', 'Zelmany war dafür verantwortlich, dass mein Markgraf gefallen ist.\n\nSin\'dane glaubt, dass er Kel\'Thuzads loyale Truppen um sich zu versammeln versucht, damit sie ihn bei seinen nächsten Plänen unterstützen.\n\nWir sollten nach Hinweisen auf seinen Aufenthaltsort suchen und ihn dann töten.', '', '', '', '', '', '', 39653),
(63674, 'deDE', 'Wenn Ihr gestattet', 'Trefft Euch mit Lady Vashj beim Sitz des Primus und bittet um Khaliiqs Hilfe.', 'Meine Baronin, Lady Vashj, hat mir eine Aufgabe übertragen. Mit etwas Unterstützung wäre meine Rache geschwind. Doch sie muss Eurer Hilfe erst zustimmen und mir erlauben, Euch bei Eurer Aufgabe zu begleiten.\n\nGeht zum Sitz des Primus. Dort werden wir mit ihr sprechen.', '', '', '', '', '', '', 39653),
(63673, 'deDE', 'Jagd zwischen den Häusern', 'Findet Huln Hochberg in Maldraxxus.', 'Ich habe gute Nachrichten, $n. Da die Pakte jetzt enger zusammenarbeiten, ist auch Hulns Jagd von mehr Erfolg gekrönt. Er hat gute Hinweise auf zwei weitere Nachtkrieger hier in den Schattenlanden.\n\nFür den Ersten erwartet er Euch in Maldraxxus am Grabmal des Wissens.\n\nBeeilt Euch, $n. Elunes Macht droht, Tyrande zu zerreißen. Ich weiß nicht, wie lange sie noch durchhält.', '', '', '', '', '', '', 39653),
(63672, 'deDE', 'Ein Ruf aus tiefstem Herzen', 'Trefft Euch mit Ysera im Herz des Waldes.', '<Die Stimme von Ysera erklingt aus der Schriftrolle, während Ihr die Worte lest.>\n\n$n,\n\nich benötige Eure Hilfe bei einer äußerst wichtigen Angelegenheit. Ich erwarte Euch im Herz des Waldes. Kommt bitte, so schnell Ihr könnt.', '', '', '', '', '', '', 39653),
(63665, 'deDE', 'Der Weg nach Oribos', 'Aktiviert den Portalstein und reist nach Oribos.', 'Die Prophezeiungen haben uns gesagt, dass dieser inaktive Portalstein eines Tages von einem Schlundgänger gebraucht werden würde. Und dass er sich als entscheidend für das Schicksal der Schattenlande erweisen würde.\n\nEs scheint, dass dieser Tag nun gekommen ist.\n\nMithilfe der Anima in Euch könnt Ihr diesen Portalstein aktivieren. Er wird dann von all jenen benutzt werden können, die Euch unterstützen.\n\nWenn Tal-Inara, wie Ihr behauptet, tatsächlich einen Anker in Oribos geschaffen hat, wird Euch dieser zu uns zurückbringen.\n\nUnd nun geht, $n. Teilt Euren Verbündeten mit, dass der Schlund sie erwartet... und dass Korthia ihre Hilfe braucht.', '', '', '', '', '', 'Sprecht mit Bolvar Fordragon innerhalb des Rings der Übertragung.', 39653),
(63664, 'deDE', 'Kommt zum Punkt', 'Verteidigt den Brückenkopf in der Verdammnisfestung.', 'Unsere Stellung bei der Brücke zum Altar der Herrschaft wird angegriffen! Wir dürfen unsere Balliste dort auf keinen Fall verlieren.\n\n$gSchlundgänger:Schlundgängerin;, Ihr müsst diese Stellung verteidigen, bis unsere Truppen für ihren Vorstoß bereit sind!', '', '', '', '', '', 'Kehrt zu Baronin Draka zurück.', 39653),
(63663, 'deDE', 'Korthia, die Stadt der Geheimnisse', 'Wartet, bis Ve\'nari das Gebiet untersucht hat, und seht Euch dann genauer an, was immer sie findet.', 'Wir stehen kurz davor, unsere Wünsche zu verwirklichen, $gSchlundgänger:Schlundgängerin;.\n\nEs ist bestimmt nicht mehr weit bis zu Eurem großen Portalstein. Meine Ansprüche sind natürlich weitaus bescheidener. Ein paar nützliche Informationen hier, ein unbezahlbares Relikt dort...\n\nIch werde das Gebiet erkunden, um zu sehen, ob es in der Nähe etwas Nützliches oder gar Gefährliches gibt. Dann können wir fortfahren.', '', '', '', '', '', 'Sprecht mit Tal-Galan in der Nähe des inaktiven Portalsteins.', 39653),
(63662, 'deDE', 'Geheimnisse des Schlunds', 'Reist mit Ve\'nari zu der neuen Landmasse im Schlund.', 'Der Schlund verändert sich, $gSterblicher:Sterbliche;. Und mit Veränderungen tun sich neue Möglichkeiten auf.\n\nDer Kerkermeister hat ein Reich, das tief in den Schattenlanden verborgen lag, in den Schlund gezogen. Ich habe ein gewisses Interesse daran, möchte dort aber nicht allein hingehen.\n\nDas gesamte Gebiet wimmelt nur so von Schlundgebundenen. Es muss dort etwas Wertvolles geben, nach dem sie suchen.\n\nIch habe ein sicheres Versteck in der Nähe. Begleitet mich dorthin, dann kann ich Euch womöglich helfen, diesen Portalstein zu finden.\n\nHaben wir also eine Abmachung?', '', '', '', '', '', 'Sprecht mit Ve\'nari außerhalb des neuen Gebiets.', 39653),
(63661, 'deDE', 'Die Verbindung zum Schlund', 'Befragt Ve\'nari zum Standort des zweiten Portalsteins.', 'Der Schicksalsschreiber ist sich sicher, dass ein zweiter Portalstein im Schlund aufgetaucht ist. Es obliegt Euch, ihn zu finden.\n\nIch werde einen Anker hier in Oribos erschaffen, der mit Eurer Anima verbunden ist. Sobald Ihr Euch auf den Portalstein einstimmt, wird mein Anker an ihn gebunden.\n\nWenn Ihr erfolgreich seid, können die Truppen der Pakte den Schlund sicher betreten und wieder verlassen.\n\nNutzt, was auch immer Euch im Schlund an Ressourcen zur Verfügung steht, um diesen Portalstein zu finden.\n\nViel Glück, $gSterblicher:Sterbliche;. Möge die Vorsehung uns alle leiten.', '', '', '', '', '', 'Sprecht mit Ve\'nari in Ve\'naris Zuflucht.', 39653),
(63660, 'deDE', 'Der Weg in den Schlund', 'Erlaubt Tal-Inara, Eure Anima zu untersuchen.', 'Der Kerkermeister hat ein weiteres Siegel errungen und seine Streitkräfte stürzen sich auf Oribos.\n\nBolvar Fordragon und Draka aus Maldraxxus wollen den Kerkermeister direkt angreifen.\n\nDazu brauchen wir erst einen Weg, über den ihre Streitkräfte den Schlund sicher betreten und wieder verlassen können.\n\nVor Eurer Ankunft hatten wir so etwas für unmöglich gehalten... doch nun glaube ich, dass es eine Möglichkeit geben könnte.\n\nIch muss Eure Anima untersuchen, um festzustellen, ob dies wahrlich der Wille der Vorsehung ist.', '', '', '', '', '', 'Sprecht mit Tal-Inara im Ring der Übertragung.', 39653),
(63659, 'deDE', 'Schreckenslords!', 'Sprecht mit dem Primus in Korthia.', 'Das ist diese Woche schon der fünfte Schreckenslord, den wir in unseren Reihen gefunden haben. Wenn wir sie nicht alle finden, könnten sie in unserem Stützpunkt hier großen Schaden anrichten.\n\nZu meinen Lebzeiten habe ich von einem Dämonenjäger gelernt, wie man diese Kreaturen identifiziert. Aber auch, wenn ich sie so leichter aufspüren kann, kann ich nicht überall gleichzeitig sein.\n\nWir müssen dem Primus berichten, was wir herausgefunden haben.', '', '', '', '', '', 'Sprecht mit dem Primus in Korthia.', 39653),
(63656, 'deDE', 'Die Bedeutung des Zorns', 'Erstattet dem Primus Bericht.', 'Ich werde meine Streitkräfte sammeln und sofort einen Teil davon nach Korthia entsenden. Und ich werde dafür sorgen, dass ihnen die Werkzeuge zur Verfügung gestellt werden, die Baronin Vashj und Kael\'thas herbeizaubern konnten, um uns weiter gegen die Übergriffe der Nathrezim zu verteidigen.\n\nAndere Aufgaben erfordern meine Aufmerksamkeit, bevor ich nach Korthia reisen kann. Ich muss die Herrschaftsburg gegen weitere Eindringlinge sichern.\n\nIch vermute, dass der Primus eine Meldung erwartet. Ihr könnt ihm sagen, dass Ihr erfolgreich wart.', '', '', '', '', '', 'Erstattet dem Primus Bericht.', 39653),
(63655, 'deDE', 'Medaillon des Zorns', 'Bringt das Medaillon des Zorns zum Podium in Sündensturz.', '$gSchlundgänger:Schlundgängerin;, ich werde mit meinen Steingeborenen in die Tiefen des Schlunds marschieren und jedem Nathrezim, den ich dort finde, den Kopf abreißen.\n\nAllerdings ist Revendreth in diesem Krieg strategisch immer noch viel zu wichtig, um rein aus fehlgeleiteter Eitelkeit seinen Verlust zu riskieren.\n\nAus diesem Grund biete ich, die Ernterin des Zorns, Zweite dieses Titels, Euch an, mein Medaillon gut zu verwahren und zu verwenden, während ich in diesen Krieg ziehe.\n\nVerwendet es zur Stärkung der Ernter, damit sie Denathrius daran hindern können, einfach zurückzukehren und im Handumdrehen die Kontrolle wiederzuerlangen.', '', '', '', '', '', 'Bringt das Medaillon des Zorns zum Podium in Sündensturz.', 39653),
(63654, 'deDE', 'Die Nathrezim', 'Holt das Medaillon des Zorns von den Nathrezim zurück.', 'Das Medaillon des Zorns ist nicht nur ein mächtiges Artefakt. In den Fängen der Nathrezim ist es eine Gefahr für das gesamte Reich. Und solange sie darüber verfügen, sind wir nicht in der Lage, ein neues Siegel zu erschaffen.\n\nMit ihren Machenschaften hätten sie schon fast den Glutdistrikt zerstört. Ich lasse nicht zu, dass sie mein Medaillon für ihre Zwecke missbrauchen.\n\nKommt, holen wir es uns zurück.', '', '', '', '', '', 'Sprecht mit Prinz Renathal in Morgenfels.', 39653),
(63653, 'deDE', 'Die Macht einer Krone', 'Findet den Pfad zum Medaillon des Zorns.', 'Wir sind bereit.\n\nDer Hof der Ernter wird uns mit der Macht der Medaillons, die wir bereits gefunden haben, zum Medaillon des Zorns führen. Wenn es sich noch immer in diesem Reich befindet, dann sollten wir es eigentlich orten können.\n\nDieses Ritual ist nicht einfach. Die Nathrezim sind wahre Meister der Tarnung. Wenn sich Euch der Pfad offenbart, dann beeilt Euch.\n\nWenn Ihr sie dann findet, wartet auf uns, bevor Ihr angreift.', '', '', '', '', '', 'Sprecht mit der Steinhauerin in Morgenfels.', 39653),
(63652, 'deDE', 'Die \"ungebetenen\" Gäste', 'Beseitigt $1oa Nathrezim in Sündensturz.', 'Chelra, ich meine Nal\'ragas, hat bestimmt nicht allein gearbeitet. Wir müssen das Schlimmste annehmen: dass nicht all unsere Freunde und Verbündeten das sind, was sie zu sein vorgeben.\n\nEs wird eine Weile dauern, bis der Hof der Ernter unser Aufdeckungsritual abgeschlossen hat. In der Zwischenzeit sind wir angreifbar. Daher bitte ich Euch: Setzt dieselben Taktiken ein wie am Tor der Dominanz in Sündensturz und befreit unsere Reihen von den Nathrezim.\n\nErfolgreiche Jagd.', '', '', '', '', '', '', 39653),
(63651, 'deDE', 'Kryptogramme', 'Übertragt $1oa infernale Kryptogramme.', 'Sollten die Nathrezim wirklich Sündensturz unterwandert haben, dann müssen sie kommunizieren. Und das nicht nur mit Handzeichen und Worten. Sie verlassen sich mit Vorliebe auf magische schriftliche Nachrichten, die durch einen simplen Trick vor den Blicken Unbedarfter verborgen bleiben.\n\nAber ich habe eine Beschwörungsformel entworfen, mit deren Hilfe Ihr diese Nachrichten sehen könnt.\n\nFindet die Kryptogramme und bringt mir ihren Inhalt. Ich kann sie für Euch übersetzen, falls Ihr sie nicht versteht.', '', '', '', '', '', '', 39653),
(63650, 'deDE', 'De-Infiltration', 'Trefft Euch mit Prinz Renathal in Sündensturz.', 'Mal\'Ganis.\n\nDieser Name ist mir seit Jahrhunderten nicht mehr über die Lippen gekommen. Und nun machen wir Jagd auf ihn.\n\nWenn er wirklich das Medaillon des Zorns bei sich trägt, kann er sich nirgends verstecken. Die anderen Medaillons, die wir bereits gefunden haben, werden uns zu ihm führen.\n\nWir treffen uns in Sündensturz. Und bringt Euren Schreckenslordjagdtrupp mit. Ich vermute, wir werden ihn brauchen.', '', '', '', '', '', '', 39653),
(63649, 'deDE', 'Spion gegen Spion', 'Findet und besiegt $1oa Schreckenslordinfiltratoren.', 'Nathrezim. Schreckenslords. Die Ungesehenen Gäste.\n\nNennt sie, wie Ihr wollt. Vor langer Zeit wurde dieses Volk nur aus dem einem Grund erschaffen, um als die wohl besten Spione und Infiltratoren zu dienen.\n\nDiese Eindringlinge haben drei Faktoren schwer unterschätzt: Kael\'thas Sonnenwanderer, Baronin Vashj und $n!\n\nIch habe ein Werkzeug mitgebracht, mit dessen Hilfe Kael\'thas und ich Nathrezim aufgespürt und vernichtet haben, als wir unter Illidan dienten. Und ich bin die Herrin der Spione!\n\nKommt, lasst uns diese Eindringlinge jagen.', '', '', '', '', '', '', 39653),
(63648, 'deDE', 'Nal\'ragas', 'Findet und besiegt Nal\'ragas.', 'Das Medaillon der Steinhauerin darf nicht in den Händen der Nathrezim verbleiben.\n\nNach dem, was die Anklägerin zu unserer Mission erläutert hat, brauchen wir das Medaillon, um ein neues Siegel für die Venthyr zu schmieden. Zweifellos haben Nal\'ragas und ihre Schergen auch genau deswegen gerade jetzt aus dem Hinterhalt zugeschlagen.\n\nDie Magie dieser Medaillons ist nicht gerade subtil und sie lassen sich in diesem Reich sehr leicht aufspüren. Wir sollten diese Nal\'ragas verfolgen und beseitigen, bevor sie Verstärkung erhält.', '', 'Eine geschickte Agentin der Nathrezim.', 'Nal\'ragas', '', '', 'Sprecht mit Prinz Renathal.', 39653),
(63647, 'deDE', 'Die Ungesehenen Gäste', 'Unterstützt die Steinhauerin bei ihren Nachforschungen zur Gesandten.', 'Schreckenslords.\n\nNatürlich. Natürlich kommen sie ausgerechnet jetzt zurück. Ich hatte schon fast geahnt, dass sie während der Dürre zurückkehren würden.\n\nAls ich Euch das erste Mal sah, war ich nicht ganz sicher, ob Ihr nicht zu ihnen gehört. Sie sind in den Zeitaltern, seit sie aus Revendreth geflohen sind, immer gerissener geworden.\n\nAber nicht gerissen genug... sollte ich meinen.\n\nKommt, $gSchlundgänger:Schlundgängerin;. Folgt mir und macht kein Aufhebens. Haltet Eure Waffe bereit. Die Abgesandte, die Ihr mitgebracht habt, ist nicht ganz so loyal, wie Ihr vielleicht gedacht habt.', '', '', '', '', '', '', 39653),
(63646, 'deDE', 'Konvoi der Pakte', 'Versammelt die Gesandten und reitet zum Tor der Dominanz.', 'Ein neues Siegel der Venthyr ließe sich nur mit allen sieben Medaillons schmieden.\n\nDer Primus hatte recht. Die Person, die wir brauchen, ist die Steinhauerin. Mit ihren Anschuldigungen gegen die Ungesehenen ließe sich eine ganze Bibliothek füllen, und sie besitzt das letzte Medaillon, das wir benötigen. Ich glaube, es ist längst überfällig, dass wir beide sie für unsere Sache gewinnen.\n\nIch werde die Vorbereitungen treffen. Wir werden es dieses Mal richtig machen, mit Geschenken und Diplomatie.\n\nIhr solltet Chelra vorwarnen, sie wird eine Eskorte aufstellen wollen.', '', '', '', '', '', 'Übergebt die Nachricht des Primus der Steinhauerin.', 39653),
(63645, 'deDE', 'Gefangener von Morgenfels', 'Erfahrt von Prinz Renathal mehr über das Schicksal von Graf Denathrius.', 'Oh, Ihr habt es offensichtlich noch nicht gehört.\n\nWir haben ihn. Graf Denathrius, Meister von Revendreth, Gefangener seiner eigenen Klinge.\n\nWir haben ihn im Zuge eines unserer letzten Schlachtzüge gegen Schloss Nathria überwältigen können.\n\nEs bedurfte einer Armee von unvergleichlicher Tapferkeit und Vorbereitung. Es bedurfte Geschick und Vermögen. Es bedurfte eines Wunders.\n\nUnd so wird der Erlöser erlöst werden. Möchtet Ihr mehr darüber erfahren?', '', '', '', '', '', '', 39653),
(63644, 'deDE', 'Finstere Nachrichten', 'Sprecht mit Prinz Renathal bei Morgenfels in Revendreth.', 'Die Bedrohung, die die Nathrezim für unsere Streitkräfte darstellen, darf nicht unterschätzt werden. Sie sind gerissen, selbst im Vergleich mit den besten Veteranen des Hauses der Augen, und wir kennen ihren ganzen Plan nicht.\n\nUnter den Venthyr gibt es eine, die die Nathrezim mit ihrem Zorn viele Jahrtausende lang aus den Schattenlanden vertrieben hat.\n\nIch bitte Euch, nach Sündensturz zu reisen, um Prinz Renathal aufzusuchen und ihm dieses Schreiben zu überbringen. Ich werde einen meiner eigenen Spione, die Baronin Vashj, schicken, um Euch dort zu treffen. Macht Euch ihre Erfahrung mit den Nathrezim zunutze.', '', '', '', '', '', 'Sprecht mit Prinz Renathal bei Morgenfels.', 39653),
(63639, 'deDE', 'Bericht in Oribos', 'Kehrt zu Tal-Inara in Oribos zurück.', 'Der Ardenwald hat der gnadenlosen Kraft des Schlunds widerstanden.\n\nAber das hat dennoch nicht gereicht.\n\nKehrt zu unseren Verbündeten in Oribos zurück. Dieser Verlust muss vergolten und Maßnahmen müssen ergriffen werden.', '', '', '', '', '', 'Kehrt zu Tal-Inara in Oribos zurück.', 39653),
(63638, 'deDE', 'Nicht den Rücken zuwenden', 'Seht nach der Winterkönigin.', 'Damit wären wir Sylvanas und ihre Schlundgebundenen los... zumindest vorerst.\n\nAber wir müssen uns beeilen und dafür sorgen, dass die Königin und ihr Siegel in Sicherheit sind!\n\nDie Winterkönigin war gleich außerhalb des Herzens des Waldes, um die gestohlenen Wildsamen vor dem Schlund zu schützen.', '', '', '', '', '', '', 39653),
(63625, 'deDE', 'Hier ist eine Axt. An die Arbeit!', 'Eliminiert $1oa Truppen der Schlundgebundenen und Kommandant Mallamort.', 'Unsere Truppen stoßen auf heftigen Widerstand! $gSchlundgänger:Schlundgängerin;, greift Euch eine Waffe und zieht in den Kampf!\n\nBeseitigt die Verteidigung dieser Tore: die Truppen der Schlundgebundenen und ihren Kommandanten.', '', '', 'Kommandant Mallamort', '', '', 'Berichtet Baronin Draka von Eurem Erfolg.', 39653),
(63624, 'deDE', 'Die Wege, die wir beschreiten', 'Wohnt Drakas Aufstiegszeremonie bei.', 'Die Armeen von Maldraxxus sind stark. Sie werden sich von Vyraz\' Missetat erholen.\n\nAls Erstes müssen wir alles wieder aufbauen. $gSchlundgänger:Schlundgängerin;, werdet $gZeuge:Zeugin; einer neuen Ära von Maldraxxus!', '', '', '', '', '', '', 39653),
(63623, 'deDE', 'Einen leeren Thron ausfüllen', 'Kehrt zum Sitz des Primus zurück.', '$gSchlundgänger:Schlundgängerin;.\n\nIn meiner langen Abwesenheit habt Ihr dem Pakt der Nekrolords Ordnung und Stärke zurückgegeben. Als Anerkennung lade ich Euch ein, einer Zeremonie beizuwohnen.\n\nKehrt mit mir zu meinem Machtsitz in Maldraxxus zurück. Es ist an der Zeit, dass ich ein Individuum belohne, das unserer Sache äußerst treu gedient hat.', '', '', '', '', '', 'Sprecht mit dem Primus beim Sitz des Primus.', 39653),
(63622, 'deDE', 'Sieg in unserem Namen', 'Kehrt zum Primus in Korthia zurück.', 'Helya und Vyraz sind erledigt. Damit haben wir heute einen entscheidenden Sieg gegen die Schlundgebundenen erzielt. Wir haben auch gezeigt, wozu die verbündeten Kräfte der Schattenlande imstande sind.\n\nWir sollten nach Korthia zurückkehren, bevor noch etwas geschieht.', '', '', '', '', '', '', 39653),
(63621, 'deDE', 'Kettenrasseln', 'Eliminiert den Hüter der Ketten.', 'Sie nennen ihn den Hüter der Ketten. Unterschätzt seine Macht nicht. Er hat Seelen in der Nähe gebunden, um einen Angriff auf unsere Stellung vorzubereiten.\n\nIch will, dass Ihr diese Bedrohung beseitigt, $gSchlundgänger:Schlundgängerin;, bevor sie unsere Truppen in Gefahr bringt.', '', 'In seinen Ketten bricht der Wille jeder Seele.', 'Hüter der Ketten', '', '', '', 39653),
(63620, 'deDE', 'Die Schuld eines Verräters', 'Tötet Vyraz.', 'Seit er uns verraten hat, ist Vyraz eine konstante Bedrohung für Maldraxxus. Als Baronin des Hauses der Auserwählten ist es meine Pflicht, diese Bedrohung zu beseitigen und den Mord an Markgraf Krexus zu rächen.\n\nWie der Primus sagte: Wir müssen dieser Schlange den Kopf abschlagen.\n\nJetzt ist die Zeit gekommen, um genau das zu tun!', '', 'Für Baron Vyraz, den Verräter von Maldraxxus, läuft die Zeit ab.', 'Baron Vyraz', '', '', '', 39653),
(63619, 'deDE', 'Verschmäht und vergessen', 'Befreit $1oa Gefangene der Verschmähten.', 'Wartet... Ich kenne Euch! $gDer Schlundgänger:Die Schlundgängerin;!\n\nMeine Brüder und Schwestern wurden beeinflusst... verdorben. Einige haben bereitwillig die Macht von Helya entgegengenommen, aber andere konnten ihr widerstehen. Wir alle sind jetzt ihrer Macht unterworfen.\n\nIch bin geflohen, als die Kämpfe begannen, aber die meisten der verbliebenen Verschmähten werden schrecklichen Ritualen unterzogen.\n\nIch bitte Euch, sie zu befreien. Wir kehren dann zur Bastion zurück und unterwerfen uns dem Urteil der Archon.', '', '', '', '', '', '', 39653),
(63618, 'deDE', 'Was Maldraxxus am besten kann', 'Tötet $1oa Schlundgebundene in der Festung Desmotaeron.', 'Jeder Feind, den wir hier besiegen, ist einer, mit dem sich unsere Armee nicht weiter auseinandersetzen muss. Wir werden dafür sorgen, dass sie die wahre Bestimmung von Maldraxxus nicht so schnell vergessen werden. Zeigt ihnen, was mit jenen passiert, die wir als Bedrohung für die Schattenlande ansehen.\n\nTötet jeden Schlundgebundenen in Sichtweite.', '', '', '', '', '', '', 39653),
(63617, 'deDE', 'Eisenbiegen', 'Tötet Eisenhüter Salryx.', 'In all dem Chaos hat jemand die Tore des oberen Festungsbereichs offen gelassen. Wenn wir durchschlüpfen, bemerken sie uns vielleicht erst, wenn es zu spät ist.\n\nEiner von Helyas Leutnants steht zwischen uns und Burg Helgarde. Macht kurzen Prozess mit ihm.', '', 'Der schlundgebundene Unterjocher führt die Truppen in Desmotaeron gegen die vereinten Kräfte der Jenseitigen an.', 'Eisenhüter Salryx', '', '', '', 39653),
(63616, 'deDE', 'Korrekt ausgeführte Aufgabe', 'Gebt der Zerekriss das Signal und startet den Angriff.', 'Wir sind bereit, den Angriff zu starten.\n\nGebt der Zerekriss das Signal. Zeigen wir ihnen die Macht einer maldraxxischen Nekropole und der vereinten Armeen der Schattenlande!', '', '', '', '', '', '', 39653),
(63615, 'deDE', 'Die Flügel stutzen', 'Benutzt Ketten der Schlundgebundenen, um $1oa helgebundene Seelenbrecher zu töten.', 'Der Himmel wird von Helyas kyrianischen Anhängern geradezu verdunkelt. Wenn wir ihre Zahl nicht ausdünnen, könnten die Zerekriss und unsere Verbündeten in der Luft Schwierigkeiten bei ihrem Vorstoß bekommen.\n\nIch habe bemerkt, dass die Schlundgebundenen oftmals magische Ketten benutzen. Wir könnten ihre Ausrüstung gegen sie wenden und sie vom Himmel herunterzerren.', '', '', '', '', '', '', 39653),
(63614, 'deDE', 'Mit der Waffe in der Hand', 'Findet Dra\'gora, Thralls Axt.', 'Einen Augenblick bitte, $n.\n\nIch habe meine Axt Dra\'gora verloren, als ich sie bei unserem ersten Treffen im Schlund nach Helya warf, und ich habe sie seitdem nicht mehr gesehen. Wenn Helya wirklich an diesem Ort ihre Truppen befehligt, dann wird meine Axt vielleicht dort aufbewahrt.\n\nIch habe diese Axt in Nagrand gefertigt und sie erinnert mich an gute Zeiten an der Seite meiner Familie. Ich möchte ihr Gewicht wieder in meinen Händen spüren.', '', '', '', '', '', '', 39653),
(63613, 'deDE', 'Tore der Verdammten', 'Beschwört $1oa Schwarze Tore.', 'Wir müssen uns auf den Angriff vorbereiten, bevor wir der Zerekriss ein Signal geben. Sobald sie in Position ist, werden unsere Verbündeten Schwarze Tore benutzen, um das Gebiet anzugreifen.\n\nWir müssen die Schwarzen Tore auf dieser Seite beschwören. Findet strategisch geeignete Orte für sie.', '', '', '', '', '', '', 39653),
(63612, 'deDE', 'Die Befehlsketten', 'Trefft Draka in der Nähe von Desmotaeron.', 'Wenn wir schon eine Stellung so nahe an den Gebieten des Kerkermeisters halten müssen, dann nicht ohne eine Absicherung.\n\nVyraz und Helya haben sich hinter die Mauern von Desmotaeron zurückgezogen. Sie sind in ihrer vermeintlichen Sicherheit nachlässig geworden, was uns eine Gelegenheit verschafft.\n\nWir werden sie überrumpeln. Schlagt schnell und gnadenlos zu, vielleicht können wir diesen Schlangen dann die Köpfe abschlagen.', '', '', '', '', '', 'Sprecht mit Draka in der Nähe von Desmotaeron.', 39653),
(63593, 'deDE', 'Neues Siegel der Kyrianer', 'Erstattet dem Primus in Korthia Bericht.', 'Nun, da eine Zukunft der Gemeinschaft und Hingabe für die Bastion gesichert ist, ist ein neues Siegel geboren, das unseren weiteren Pfad repräsentiert.\n\nBitte berichtet dem Primus von all Euren Taten. Wenn er bereit ist, werdet wir ihm das Siegel bringen.\n\nHoffen wir, dass er damit den Plan des Kerkermeisters vereiteln und die Schattenlande retten kann.', '', '', '', '', '', 'Erstattet dem Primus in Korthia Bericht.', 39653),
(63592, 'deDE', 'Der Neue Pfad', 'Sprecht mit Kalisthene, um an der Zeremonie am Sitz der Archon teilzunehmen.', 'Heute wird ein neues Paragon ernannt. Und zum ersten Mal seit den Anfängen unseres Reiches wird ein Tempel umgewidmet, um unsere Hingabe zueinander zu repräsentieren.\n\nEin neues Paragon, ein neues Siegel und ein neuer Pfad für alle Kyrianer.\n\nDas wird eine prachtvolle Zeremonie!', '', '', '', '', '', 'Sprecht mit Adrestes, dem Paragon der Hingabe.', 39653),
(63591, 'deDE', 'Der große Empfang', 'Sprecht mit Kalisthene, um an dem Treffen teilzunehmen. Mischt Euch dann unter Eure Seelenbande und die anderen Kyrianer.', '$n, Ihr habt den Kyrianern in diesen äußerst schwierigen Zeiten beigestanden. Eure hingebungsvolle Unterstützung hat uns allen zu einem Neuanfang verholfen.\n\nWir würden uns freuen, wenn Ihr vor der Zeremonie an einer Versammlung mit uns teilnehmen würdet. Viele Mitglieder unseres Paktes möchten ihre Wertschätzung für alles, was Ihr getan haben, zum Ausdruck bringen.\n\nDies ist ein Tag großer Freude. Ich bin sehr froh, dass Ihr hier seid und ihn miterleben könnt!', '', '', '', '', '', 'Sprecht mit Kalisthene am Quell der Treue.', 39653),
(63590, 'deDE', 'Das Vesperglockenläuten', 'Beschützt Polemarch Adrestes, während er den Tempel der Loyalität umwidmet.', 'Loyalität soll nicht länger ein obligatorischer Grundsatz des Pfades sein, sondern eher ein Wert, den man sich verdient... eine Wahlmöglichkeit.\n\nWir müssen uns um jene kümmern, die zu kämpfen haben, seien es kürzlich eingetroffene Seelen oder Gleichgesinnte, die unsere Hilfe brauchen.\n\nEs wird jegliche Anima brauchen, über die wir verfügen, um diesen Tempel umzuwidmen und somit ein neues Zeitalter für die Kyrianer einzuläuten.\n\nIch fürchte, dass die Schlundgebundenen versuchen werden, unsere Pläne zu durchkreuzen. Beschützt mich während des Rituals, $n. Wir müssen es zu Ende bringen.', '', '', '', '', '', '', 39653),
(63589, 'deDE', 'Hingabe hervorbringen', 'Leitet die Anima von der Zitadelle der Loyalität zum Tempel um.', 'Die fünf Tempel der Bastion haben seit ihrer Erschaffung standgehalten. Die Idee, einen von ihnen umzuwidmen, wurde noch nie angedacht und wird zweifelsohne eine erhebliche Menge Anima erfordern.\n\nUnter diesem Tempel befinden sich Vorräte an Anima, die wir für die Dürre rationiert haben. Jetzt, wo die Anima zurückkehrt, können wir diese Reserven für unsere Zwecke nutzen.\n\nIhr werdet Kanalisierer und Sammler auf dem gesamten Gelände einsetzen müssen, um die Anima nach oben zu leiten. Das sollte mir die benötigte Kraft geben.', '', '', '', '', '', '', 39653),
(63588, 'deDE', 'Vertrauen zurückgewinnen', 'Überzeugt $1oa Verschmähte, zum Pfad zurückkehren.', 'Die Verschmähten sind Verlorene, $n.\n\nSie sind wie Geister, die durch den Tempel der Loyalität streifen. Sie können nirgendwo anders hin. Sie sind ohne Führung, ohne Aufgabe und verlassen.\n\nWir müssen ihnen einen Pfad aufzeigen.\n\nGestattet mir, Euch in den Tempel zu begleiten, um mit ihnen zu reden und ihre Gefühle anzusprechen. Vielleicht können wir sie überzeugen, Adrestes\' neuem Pfad eine Chance zu geben.', '', '', '', '', '', '', 39653),
(63587, 'deDE', 'Zurückgewinnbare Anima', 'Sammelt $1oa besudelte Zenturionenkerne von den Zenturionen der Verschmähten ein.', 'Mikanikos hat mir viel über die Zenturionen der Verschmähten erklärt, $n.\n\nIch kann nicht behaupten, dass ich alles verstanden habe, aber es scheint, dass er bislang noch keinen zuverlässigen Weg gefunden hat, sie wieder in ihren regulären Betriebsmodus zu versetzen.\n\nAber ihre Anima könnte dennoch hilfreich sein!\n\nAdrestes hat sich auf die Umwidmung des Tempels konzentriert, aber nicht auf seine eigene Sicherheit. Ich fürchte, der Prozess wird ihm viel seiner Anima rauben.\n\nWenn es Euch gelingt, Kerne von den Zenturionen der Verschmähten zu besorgen, könnten wir diese als Animavorrat für Adrestes verwenden.', '', '', '', '', '', '', 39653),
(63586, 'deDE', 'Mitfühlende Hingabe', 'Trefft Adrestes bei der Provostenrast.', 'Unser erster Tagesordnungspunkt ist die Umwidmung des Tempels der Loyalität.\n\nPelagos hat sich angeboten, hierzubleiben und bei der Vorbereitung der Zeremonie zu helfen. Ich habe Nikolon gebeten, uns mit seinen Gefährten in der Provostenrast zu treffen, um uns zu helfen, einige der Verschmähten von unserem neuen Pfad zu überzeugen.\n\nTrefft uns dort, wenn es Euch möglich ist.', '', '', '', '', '', 'Trefft Adrestes bei der Provostenrast.', 39653),
(63585, 'deDE', 'Blinde Loyalität', 'Schließt Euch Polemarch Adrestes an der Elysischen Feste für eine Audienz bei der Archon an.', 'Der weitere Pfad der Kyrianer liegt jetzt klar vor mir.\n\nAber zunächst müssen wir mit Nikolon sprechen. Ich bitte Euch eindringlich, zu bleiben und zuzuhören.\n\nAnschließend müssen wir zur Elysischen Feste zurückkehren.\n\nIch werde dort um eine Audienz bei der Archon bitten und ich brauche Euch alle dabei an meiner Seite.', '', '', '', '', '', '', 39653),
(63584, 'deDE', 'Eine triumphale Rückkehr', 'Trefft Kalisthene bei der Elysischen Feste.\n\nDie kyrianische Kurierin kann Euch hinfliegen.', 'Dieser Tempel stellt einen neuen Anfang für die Bastion dar, $n.\n\nDer Tempel der Hingabe wird als Ort der Verbundenheit dienen. Wir werden mit den Verschmähten, den Aspiranten und Kyrianern aller Erfahrungsstufen und Hintergründe zusammenarbeiten, um eine Zukunft zu schaffen, auf die alle stolz sein können.\n\nLasst uns in die Elysische Feste zurückkehren. Ich möchte, dass Ihr Euch uns zu einem bedeutsamen Anlass anschließt: dem Aufstieg eines neuen Paragons und der Erschaffung eines neuen Siegels.', '', '', '', '', '', 'Trefft Kalisthene bei der Elysischen Feste.', 39653),
(63583, 'deDE', 'Ich beabsichtige, ewig zu leben', 'Helft Uther, seine letzte Erinnerung zu durchleben.', '$n, bitte. Ich bin noch nicht fertig.\n\nEs gibt noch eine weitere Erinnerung, die ich mir anschauen muss. Eine weitere, der ich mich stellen muss.\n\nEs... Es wird nicht leicht. Ich benötige weiterhin Hilfe von Euch allen.\n\nAber es muss getan werden.', '', '', '', '', '', '', 39653),
(63582, 'deDE', 'Er war mein Schüler', 'Helft Uther, seine zweite Erinnerung zu durchleben.', 'Uthers Erinnerungen an diesen Prinz Arthas verfolgen ihn unerbittlich. Er ist der Grund für die Fragmentierung von Uthers Seele und Devos\' Schicksal.\n\nDer Schmerz in diesen Erinnerungen ist spürbar.\n\nWir müssen noch tiefer graben. Uther muss sich der Quelle dieser Finsternis stellen.\n\nIhr müsst Euch noch einmal in seine Vergangenheit begeben, um seine Zukunft zu schützen.', '', '', '', '', '', '', 39653),
(63581, 'deDE', 'Ins Licht treten', 'Verwendet den Seelenspiegel, um Uther zu helfen, seine Vergangenheit zu durchleben.', 'Es ist, wie ich befürchtet hatte.\n\nDieses Fragment von Uthers Seele wurde von der Gramklinge, die ihn tötete, verfinstert. Seine Erinnerungen sind zersplittert und verzerrt.\n\nDamit Uther sich von dem Schmerz befreien und seine Trauer überwinden kann, muss er seine Vergangenheit erneut durchleben.\n\nAber er muss es nicht allein tun.\n\nMit meinem Seelenspiegel können wir Uther auf seinem Weg durch diese Erinnerungen leiten, damit er seinen Frieden mit all den Gefühlen machen kann, die darin enthalten sind. Wir müssen ihm helfen, diese Trugbilder zu durchschauen und ihre Wahrheit zu erkennen.', '', '', '', '', '', '', 39653),
(63580, 'deDE', 'Verwundete Erinnerungen', 'Helft Uther, eine Verbindung zum Überrest der Gerechtigkeit herzustellen.', 'Die Ankunft von Uthers verwundeter Seele war Auslöser für viele Ereignisse, die zu unseren aktuellen Kämpfen geführt haben.\n\nDevos\' gebrochenes Vertrauen. Ihre Verwicklung mit Helya. Der Aufstieg der Verschmähten.\n\nDie Bastion muss sich ändern, aber wir haben uns schwergetan, eine Lösung zu finden.\n\nVielleicht wird uns dieses Seelenfragment wertvolle Erkenntnisse liefern.', '', '', '', '', '', '', 39653),
(63579, 'deDE', 'Die Seele eines Paladins', 'Erobert den Überrest der Gerechtigkeit aus dem Ossuarium der Verbannten in Torghast zurück.', 'Bolvar Fordragon hatte Visionen von einer Kammer tief im Innern von Torghast, wo der Kerkermeister Seelen gefangen hält, die er als wertvoll erachtet.\n\nUther wurde von einer Gramklinge niedergestreckt. Wird eine solche Klinge mit großem Zorn geschwungen, kann sie eine Seele in Fragmente zerschmettern.\n\nWenn der Kerkermeister im Besitz eines Teils von Uthers Seele ist, kann sie ohne dieses fehlende Stück nicht vollständig wiederhergestellt werden.\n\nNehmt diesen abgestimmten Splitter mit nach Torghast, $p. Er sollte Euch zu der Kammer führen.\n\nFindet das fehlende Fragment von Uthers Seele, damit er wieder ganz sein kann.', '', '', '', '', '', 'Trefft Thenios beim Tempel der Weisheit in der Bastion.', 39653),
(63578, 'deDE', 'Die Schlacht um den Ardenwald', 'Beschützt das Siegel der Winterkönigin in der Schlacht um den Ardenwald.', 'In Anbetracht des Verrats von Graf Denathrius und der Abwesenheit des Primus von Maldraxxus müssen wir davon ausgehen, dass die Winterkönigin das nächste Ziel des Kerkermeisters ist.\n\nUnd wir dürfen nicht zulassen, dass sich jemand ihres Siegels bemächtigt!\n\nDer Ardenwald hat viel durchgemacht, aber er ist ein Reich von großer und geheimnisvoller Macht. Es ist nicht immer alles so, wie es scheint.\n\nDas werden wir zu unserem Vorteil nutzen. Ganz gleich, wer die Königin angreift.', '', '', '', '', '', '', 39653),
(63576, 'deDE', 'Der erste Schritt', 'Sprecht mit Polemarch Adrestes in Oribos.', 'Während die Pakte sich um die Verteidigung der Schattenlande bemühen, ist der Kerkermeister in Torghast nicht untätig geblieben. Er scheint die nächste Phase seines Plans in Gang setzen zu wollen.\n\nPolemarch Adrestes hat uns beunruhigende Nachrichten aus der Elysischen Feste gebracht. Er wird von seinen Beobachtungen berichten, sobald Ihr angekommen seid.\n\nEilt Euch. Ich fürchte, die Zeit wird knapp.', '', '', '', '', '', '', 39653),
(63543, 'deDE', 'Nekrolordangriff', 'Schließt $1oa Quests in der Verdammnisfestung und im Antlitz des Vergessens ab.', 'Unser Angriff hat die Truppen des Kerkermeisters überrumpelt. Wir werden die Verdammnisfestung überrennen und seine Champions am Altar der Herrschaft besiegen!\n\nWir brauchen Euch, $gSchlundgänger:Schlundgängerin;. Unterstützt unsere Soldaten auf dem Schlachtfeld!', '', '', '', '', '', '', 39653),
(63435, 'deDE', 'Tempeltacheles', 'Besiegt Anthea in einem Haustierkampf.', 'Meine Eltern verteidigen gerade den Schrein der... Acht... Kokosnüsse...? Ich hab nicht richtig aufgepasst. Darum haben sie mich vielleicht hiergelassen.\n\nSie haben mir gesagt, ich soll mit der großen weißen Katze trainieren! Ich werde nämlich eine Ninja!\n\n<Anthea führt mehrere Tritte in Eure Richtung aus.>\n\nYa! Kya! Passt bloß auf!\n\n...\n\nMir ist so langweilig. Habt Ihr Lust auf einen Haustierkampf? Ich hab alle meine Lieblingshaustiere dabei.', '', '', '', '', '', '', 39653),
(63419, 'deDE', 'Sporen über Sporen', 'Sammelt $1oa seltsame Sporen ein.', 'Chuck erklärt noch einmal, dass der Dschungel ein Eigenleben zu führen scheint und wie falsch das sei.\n\nEr bittet Euch, die Sporen von den Fungianern und den infizierten Tieren einzusammeln.\n\nChuck befürchtet, dass etwas gänzlich Unnatürliches vor sich geht.', '', '', '', '', '', '', 39653),
(63418, 'deDE', 'Forscher vermisst', 'Rettet Chucks Freunde.', 'Chuck erklärt, dass etwas Seltsames im Dschungel vor sich zu gehen scheint und seine Gruppe von wilden Fungianern gefangen genommen wurde.\n\nEr bittet Euch, seine Freunde zu retten und so zu helfen, die Vorfälle im Dschungel aufzuklären.', '', '', '', '', '', '', 39653),
(62917, 'deDE', 'Geteilte Seelen', 'Trefft die Anklägerin in der Schmiede der Bande.', 'Die Macht der Ernter fließt durch Euren sterblichen Körper. Doch Ihr könntet über noch mehr Macht verfügen, wenn Ihr Eure Seele an eine andere bindet.\n\nDies birgt keine bekannten Risiken, sondern bietet viele Vorteile für beide beteiligten Seiten.\n\nDie Anklägerin wird den Vorgang überwachen. Trefft sie an der Schmiede der Bande, wenn Ihr bereit seid.', '', '', '', '', '', '', 39653),
(62852, 'deDE', 'Champion der Wilden Jagd', 'Sprecht mit Aithlyn beim Herz des Waldes.', 'Gut gemacht, $n!\n\nIhr habt Euch gegenüber ganz Ardenwald als würdig erwiesen. Wir möchten Euch für Eure gerissene Kühnheit weiter belohnen.\n\nTrefft mich im Herz des Waldes.', '', '', '', '', '', '', 39653),
(62851, 'deDE', 'Champion der Unvergänglichen Armee', 'Sprecht mit Nalcorn Talsen im Theater der Schmerzen.', 'Eure andauernden Bestrebungen im Dienste der Unvergänglichen Armee bringen Euch den anhaltenden Respekt unserer Truppen ein. \n\nIch wurde autorisiert, Euch zum Dank einen Teil unserer jüngsten Kriegsbeute zu geben. Bitte kommt zum Sitz des Primus, um die Beute einzusammeln, sobald Ihr Zeit habt.', '', '', '', '', '', '', 39653),
(62850, 'deDE', 'Champion der Aufgestiegenen', 'Sprecht mit Adjutantin Nikos in Heldenrast in der Bastion.', '$gSchlundgänger:Schlundgängerin. \n\nEure Mühen haben den Aufgestiegenen einen entscheidenden Vorteil verschafft.\n\nNeben unserem Dank erwarten Euch Belohnungen.', '', '', '', '', '', '', 39653),
(62849, 'deDE', 'Champion des Hofes der Ernter', 'Sprecht mit Herrin Mihaela in Dunkelhafen.', '$gSchlundgänger:Schlundgängerin. \n\nEure Mühen haben dem Hof der Ernter einen entscheidenden Vorteil im Konflikt mit den Fanatikern und Loyalisten verschafft, die sich an Graf Denathrius\' vergebliche Mühen klammern.\n\nWenn Ihr mich in Dunkelhafen trefft, können wir unseren Dank auf eine... physischere... Weise ausdrücken. \n\nDamit meine ich natürlich Schätze.', '', '', '', '', '', '', 39653),
(62136, 'deDE', 'Klumplump', '', '', '', '', '', '', '', '', 39653),
(62113, 'deDE', 'Ungebetene Gäste', '', '', '', '', '', '', '', '', 39653),
(62112, 'deDE', 'Schwappi', '', '', '', '', '', '', '', '', 39653),
(61162, 'deDE', 'Ungeladene Gäste!', '', '', '', '', '', '', '', '', 39653),
(60602, 'deDE', 'Geheimdienst', '', '', '', '', '', '', '', '', 39653),
(60342, 'deDE', 'Stutzt sie zusammen', 'Tötet Charthox im Gräberwald von Revendreth.', 'Untätige Hände sind eine vergeudete Chance. Ich muss meine Hände beschäftigen, sonst wären diese Klingen eine Verschwendung!\n\nMan sagte mir, es gäbe einen Verschlinger in Revendreth, der haushoch aufragt. Lasst uns den anderen Konstrukten das eine oder andere zeigen, indem wir das Monster ausschalten!', '', '', 'Charthox', '', '', '', 39653),
(60215, 'deDE', 'Bei Verdammniswandeln muss man handeln', 'Besiegt Verdammniswandler in Tanaris.', 'Habt Ihr dieses riesige mechanische Monstrum gesehen, das in den Dünen da draußen herumstapft? Es stammt von einem Ort außerhalb der Zeit und nicht einmal aus Azeroth!\n\nDie Zeitlinien sind um diese Jahreszeit immer ganz schön aus der Fassung.\n\n<Chromie zieht eine kleine surrende Stoppuhr hervor und schraubt daran herum. Sie scheint Euch kurzzeitig vergessen zu haben.>\n\nOh, Ihr seid ja noch da! Das ist toll. Könntet Ihr dieses Ding bitte erledigen? Sonst haben die Leute noch Schwierigkeiten, zum Fest zu gelangen!', '', '', '', '', '', '', 39653),
(59598, 'deDE', 'Gut für die Seele', 'Sprecht mit Merick.', 'Zwei Seelen sind besser als eine! Wir können bei Weitem mehr gemeinsam als allein erreichen.\n\nAllerdings sind es nicht nur wir beide, die sich allen Gefahren stellen. Es gibt viele mehr, die uns in den kommenden Schlachten beistehen.\n\nSprechen wir mit Merick, um mehr darüber zu erfahren. Seid nicht schüchtern, ich kann Euch vorstellen!', '', '', '', '', '', '', 39653),
(59259, 'deDE', 'Der ewige Peiniger', '', '', '', '', '', '', '', '', 39653),
(57465, 'deDE', 'Drecksarbeit: Holzarbeiten', '', '', '', '', '', '', '', '', 39653),
(56470, 'deDE', 'Lasst die Knochen knacken!', 'Sammelt $1oa Stücke Marklarvenfleisch von riesigen Marklarven.', 'Louison hat mir Knochenknacker ausgeliehen, um ein paar Marklarven aufzuspüren, aber ich bin mit den Öfen hier beschäftigt. Könntet Ihr so lieb sein und für mich jagen gehen?\n\nKnochenknacker macht sich gerne über die kleinen Knabberer her und macht dabei eine Menge Lärm. Das wird die größeren Marklarven in die Flucht schlagen.\n\nBenutzt einfach diesen leckeren Knochen, um Knochenknacker in die Nähe der Knabberer zu locken. Oh, und vergesst bitte nicht, Fleisch von den riesigen Marklarven mitzubringen! Um das geht es nämlich.', '', '', '', '', '', '', 39653),
(41561, 'deDE', 'Teufelsbalg', '', '', '', '', '', '', '', '', 39653),
(41210, 'deDE', 'Schwefelzerstörer', '', '', '', '', '', '', '', '', 39653);
